values ('F23L1S003', '438', null, '600', '2', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед, Компјутерски апстракции и технологии
	2. Перформанси и benchmarking
	3. Инструкции и операнди, репрезентација на различни типови инструкции, репрезентација на целобројни и знакови операнди
	4. Програмски конструкти во MIPS. Процедури
	5. MIPS адресирање. Преведување и стартување на програми
	6. Компјутерска аритметика: Собирање, одземање, множење и делење. Броеви со подвижна запирка
	7. Процесор. MIPS имплементација. Градење на податочна патека.
	8. Градење на контролна патека. Вовед во проточност и паралелизам
	9. Податочни и структурни проточни конфликти
	10. Контролни проточни конфликти. Прекини и исклучоци
	11. Експлоатација на мемориската хиерархија и Кеш Меморија
	12. Кеш Меморија и TLB

Вежби:
	1. Вовед и бројни системи, SM, RC, DC, Excess Code
	2. Перформанси и benchmarking
	3. Основни МИПС инструкции. Репрезентација на целобројни и знакови операнди
	4. Програмски конструкти во MIPS. Процедури
	5. MIPS адресирање
	6. Компјутерска Аритметика. Броеви со подвижна запирка
	7. Основи на логички дизајн: Вовед, порти, табели на вистинитост, комбинациони кола, вовед во HDL
	8. Аналогија на C код во MIPS Асемблер
	9. MIPS Асемблер
	10. Предвидување на гранење
	11. Кеш Меморија и перформанси
	12. Кеш Меморија и перформанси
', 'Lectures:
1. Introduction, Computer Abstractions and Technologies
2. Performance and benchmarking
3. Instructions and operands, representation of different types of instructions, representation of integer and character operands
4. Program constructs in MIPS. Procedures
5. MIPS addressing. Translation and launch of programs
6. Computer arithmetic: Addition, subtraction, multiplication and division. Floating point numbers
7. Processor. MIPS implementation. Building a data path.
8. Building a control path. Introduction to Flow and Parallelism
9. Data and structural flow conflicts
10. Control flow conflicts. Interrupts and exceptions
11. Exploitation of the memory hierarchy and Cache Memory
12. Cache Memory and TLB

Exercises:
1. Introduction and number systems, SM, RC, DC, Excess Code
2. Performance and benchmarking
3. Basic MIPS instructions. Representation of integer and signed operands
4. Program constructs in MIPS. Procedures
5. MIPS addressing
6. Computer Arithmetic. Floating point numbers
7. Fundamentals of Logic Design: Introduction, Gates, Truth Tables, Combinational Circuits, Introduction to HDL
8. Analogy of C code in MIPS Assembler
9. MIPS Assembler
10. Prediction of branching
11. Cache Memory and Performance
12. Cache Memory and Performance',
        'Разбирање на главните компјутерски архитектури, внатрешната организација, проценка на перформансите на поедините делови и компјутерскиот систем во целинa.',
        'Understanding of the main computer architectures, internal organization, performance assessment of individual parts and the computer system as a whole.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и',
        'механизам на интерна евалуација и анкети', null, '15.1 и 15.2', '30', '45', '15', '15', '75', '180', '10',
        '15', '70', '10');
