values ('F23L1S016', '452', 'Object-oriented programming', '600', '2', '1', '2023', 'Македонски и англиски', '1. Вовед (курс), вовед во ООП (структури)
	2. Класи и објекти, животен циклус на објект
	3. Класи, објекти и нивоа на пристап
	4. Копирање на објекти, this
	5. Оператори
	6. Наследување
	7. Полиморфизам
	8. Апстрактни класи
	9. Напредни техники на наследување
	10. Исклучоци
	11. Темплејти', '1. Introduction (course), introduction to CSR (structures)
2. Classes and objects, life cycle of an object
3. Classes, objects and access levels
4. Copying objects, this
5. Operators
6. Inheritance
7. Polymorphism
8. Abstract classes
9. Advanced inheritance techniques
10. Exceptions
11. Templates', 'Целта на предметот е да го запознае студентот со основните концепти на објектно-ориентираното програмирање. За таа цел ќе бидат воведени концептите на објекти и класи, eнкапсулација, наследување и полиморфизам. Студентите ќе бидат запознаени и со хиерахијата на класи. Ќе се направат споредби на имплементациите на објектно-ориентираните концепти во различни програмски јазици.
По завршување на курсот студентот ќе ги разбира принципите на објектно-ориентираното програмирање и биде оспособен за развој на програми кои ги подржуваат овие принципи.', 'The aim of the course is to familiarize the student with the basic concepts of object-oriented programming. For this purpose, the concepts of objects and classes, encapsulation, inheritance and polymorphism will be introduced. Students will also be introduced to the hierarchy of classes. Comparisons will be made of implementations of object-oriented concepts in different programming languages.
After completing the course, the student will understand the principles of object-oriented programming and will be able to develop programs that support these principles.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети', null, 'Реализирани актибвности 15.2 и 16.1',
        '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
