values ('F23L1S023', '439', 'Business statistics', '600', '2', '1', '2023', 'Македонски и англиски',
        'Вовед. Видови податоци, собирање на податоци, примерок,  распределба на честоти на податоци, графички методи за прикажување на распределбата на честотите, истражувачка анализа на податоците. Мерки на централна тенденција и расејување на податоците.  Моделирање на несигурност. Основни елементи од веројатност, условна веројатност, независност, Баесова теорема. Случајни променливи, распредeлби на веројатности, очекување и дисперзија. Дискретни распределби: биномна распределба, Пуасонова распределба, геометриска распределба и примени. Апсолутно-непрекинати  распределби: рамномерна, експоненцијална и нормална распределба, основни својстава, стандардизација  и користење на таблици за определување на веројатности од настани. Популација и примерок. Распределба на статистики на примерок. Оценување на параметри: интервали на доверба за математичко очекување, дисперзија на популација и пропорции.  Тестирање на хипотези. Корелација и линеарна регресија. Непараметарски тестови за совпаѓање на распределби и независност на категориски карактеристики.',
        'Introduction. Types of data, data collection, sample, frequency distribution of data, graphical methods of displaying frequency distribution, exploratory data analysis. Measures of central tendency and dispersion of data. Modeling uncertainty. Basic elements of probability, conditional probability, independence, Bayes theorem. Random variables, probability distributions, expectation and dispersion. Discrete distributions: binomial distribution, Poisson distribution, geometric distribution and applications. Absolute-continuous distributions: uniform, exponential and normal distribution, basic properties, standardization and use of tables for determining probabilities of events. Population and sample. Distribution of sample statistics. Parameter estimation: confidence intervals for mathematical expectation, population dispersion and proportions. Hypothesis testing. Correlation and linear regression. Nonparametric tests for matching distributions and independence of categorical features.',
        'Запознавање со основните статистички методи и техники за прикажување, анализа и истражување на податоци.',
        'Introduction to basic statistical methods and techniques for data presentation, analysis and research.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети', null, 'Реализирани актибвности 15.2 и 16.1',
        '45', '45', '30', '10', '50', '180', '0', '10', '90', '0');
