values ('F23L1S026', '440', 'Marketing', '600', '4', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Креирање на вредност за клиентите
	2. Компанијата и маркетинг стратегија
	3. Анализа на маркетинг опкружувањето
	4. Менаџмент на маркетинг информации за стекнување увид во клиентите
	5. Разбирање на однесување при купување
	6. Маркетинг стратегија водена од вредност за клиентите
	7. Производи, услуги и брендови
	8. Прв колоквиум
	9. Разбирање и земање вредност од клиентите
	10. Маркетинг канали за испорака на вредност
	11. Заложба на клиентите и комуницирање вредност со клиентите
	12. Лична продажба
	13. Продажна промоција
	14. Директен, онлајн, мобилен маркетинг и социјални медиуми
	15. Втор колоквиум
', 'Lectures:
1. Creating value for customers
2. The company and marketing strategy
3. Analysis of the marketing environment
4. Management of marketing information to gain insight into customers
5. Understanding buying behavior
6. Marketing strategy driven by customer value
7. Products, Services and Brands
8. First colloquium
9. Understanding and getting value from customers
10. Marketing channels to deliver value
11. Commitment to customers and communicating value to customers
12. Personal Selling
13. Sales promotion
14. Direct, online, mobile marketing and social media
15. Second colloquium',
        'Вовед во главните елементи за развој на маркетинг стратегија и планирање на програма за маркетинг; Развој на вештини за решавање на маркетинг проблеми преку аналитички алатки (рамки, поими, модели и техники); Анализа на примери и студии на случај како претпријатијата го организираат својот маркетинг, со акцент на ИКТ претпријатија; Подобрување на комуникациските вештини, усни и писмени, работа во тим при изработка на проектна задача, презентирање на проектната задача.',
        'Introduction to the main elements for developing a marketing strategy and planning a marketing program; Development of skills for solving marketing problems through analytical tools (frameworks, concepts, models and techniques); Analysis of examples and case studies of how enterprises organize their marketing, with an emphasis on ICT enterprises; Improving communication skills, oral and written, working in a team during the preparation of a project task, presenting the project task.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
