values ('F23L1S052', '488', 'E-learning', '600', '2', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Вовед во курсот. Oсновни концепти за е-учење, м-учење, е-учење 2.0
	2. Модели/теории за учење: Бихејвиоризам
	3. Модели/теории за учење: Когнитивизам, конструктивизам...
