	6. Примена на ИКТ во образованието
	7. Системи за управување со настава и наставни материјали од аспект на корисник
	8. Системи за управување со настава и наставни материјали од аспект на наставник
	9. Пример системи и алатки за е-учење во разни области. Системи и алатки за проверка на знаење
	10. Масивни отворени онлајн курсеви, оддалечени и виртуелни лаборатории и виртуелни училници во образованието
	11. Компјутерски (видео) игри, социјални мрежи и мултимедија во образованието

