values ('F23L1S120', '526', 'Creative skills for problem solving', '600', '2', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед
	2. Разбери го проблемот
	3. Справи се со интуицијата
	4. Направи модел
	5. Математички принципи
	6. Ограничувања
	7. Оптимизација
	8. Веројатност
	9. Статистика
	10. Симулации
	11. Препознавање на шеми
	12. Стратегии', 'Lectures:
1. Introduction
2. Understand the problem
3. Go with intuition
4. Make a model
5. Mathematical principles
6. Limitations
7. Optimization
8. Probability
9. Statistics
10. Simulations
11. Pattern recognition
12. Strategies',
        'Студентот ќе се здобие со способност за критичко размислување и развој на вештините на размислување надвор од стандардните норми и принципи. Ќе биде во можност да го постави проблемот во рамка и да го изложи правилно, како и да решава неструктурирани проблеми. Ќе има подобрени вештини за општо решавање на проблеми од различен карактер кои стимулираат логичко размислување.',
        'The student will acquire the ability to think critically and develop thinking skills beyond standard norms and principles. He will be able to frame the problem and present it correctly, as well as solve unstructured problems. There will be improved general problem solving skills of a different nature that stimulate logical thinking.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања и вежби, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'нема', 'мин 50% присуство на настава', '30', '45', '15', '15',
        '75', '180', '10', '15', '50', '20');
