values ('F23L1S146', '505', 'Fundamentals of Web design', '600', '2', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед во веб дизајн и структура на веб страници
	2. Работа со текст, листи и вовед во CSS
	3. Работа со линкови, слики и мултимедија
	4. Работа со табели и форми
	5. Естетика
	6. Напреден CSS
	7. Веб сајт архитектури
	8. BOX model
	9. Позиционирање на елементи
	10. Типографија
	11. Принципи на добар веб дизајн
	12. Usability при дизајн на веб страници
	13. Дизајнирање на пристапни (accessible) веб страници
	14. Вовед во JavaScript

Вежби:
	1. Вовед во веб дизајн и структура на веб страници
	2. Работа со текст, листи и вовед во CSS
	3. Работа со линкови, слики и мултимедија
	4. Работа со табели и форми
	5. Воспоставени принципи на веб дизајн
	6. Употреба на каскадни стилови
	7. Напредна манипулација со CSS
	8. Box model
	9. Позиционирање на елементи
	10. Типографија за веб
	11.
	12. Usability при дизајн на веб страници
	13. Дизајнирање на пристапни (accessible) веб страници
	14. Основи на JavaScript
', 'Introduction to WWW, History of WWW, Browser Basics. Web page structure with HTML 5 tags, properties, tag history and systems. Compatibility with earlier versions of HTML and XHTML. Cascading Styles – CSS3, Properties, Length Units, Selectors, Pseudo-Elements, Model Box, Positioning, Margins, Arrange Page Layout – Methods
Introduction to Design, Methodologies, Site Structure and Architecture, Navigation, Functionality, Writing for the Web, Typography, Color, Design Concepts, Golden Ratio, Contrast. Basics of Usability, Basics of Accessibility
Introduction to JavaScript', 'По комплетирање на курсот кандидатите се очекува студентите да добијат воведни знаењаза развој на веб страници со современ дизајн, употреба на ХТМЛ и каскадни стилови. Се очекува кандидатите да:
1. Демонстрираат основно разбирање на важноста на добар дизајн на веб страниците.
2. Демонстрираат практично знаење за технологиите за веб дизајн и да можат да го применат знаењето при основно дизајнирање на веб сајтови.
3. Да комуницираат со терминологија специфична за оваа област.
4. Критички да евалуираат примери на веб сајтови.', 'After completing the course, candidates are expected to have an introductory knowledge of developing web pages with modern design, use of HTML and cascading styles. Candidates are expected to:
1. Demonstrate a basic understanding of the importance of good web page design.
2. Demonstrate practical knowledge of web design technologies and be able to apply the knowledge in basic web site design.
3. To communicate with terminology specific to this field.
4. Critically evaluate examples of web sites.', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и
семинарска работа, учење во електронско опкружување (форуми, консултации).', 'механизам на интерна евалуација и анкети',
        null, 'реализирани активности 15.1 и 15.2', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
