values ('F23L1W004', '2962', 'Sport and Health', '200', '1', '1', '2023', 'Македноски и Англиски',
        'кошарка, мал фудбал, одбојка, ракомет, танцови фитнес програми (аеробик, степ-аеробик, пилатес. За студентите со посебни потреби: физички активности во зависност од дијагнозата на студентот. Факултативно учество во спортски натпревари.',
        'basketball, football, volleyball, handball, dance fitness programs (aerobics, step-aerobics, pilates. For students with special needs: physical activities depending on the student`s diagnosis. Optional participation in sports competitions.',
        'Целта на предметот спорт и спортски активности е усвојување на нови и усовршување на старите моторни знаења и вештини, подобрување на моторните и фукционалните спсособности се со цел унапредување на здравјето, задоволувањето на потребате за движење, оспообување на студентот за рационално, содржајно користење на слободното време како и подобрување на квалитетот на животот во младоста, во зрелата возраст и староста. Унапредување на социјалната комуникација. Очекувани резултати: Оспособување на студентот за самостојно спортување и физичко вежбање, запознавање со законитостите на физичката култура и правилната исхрана. Стекнување знаења за структурата, правилата, принципите на тренажниот процес и специфичностите на избраната кинезиолошка активност.',
        'The purpose of the subject is the acquisition of new and improvement of old motor knowledge and skills, improvement of motor and functional abilities with the aim of improving health, satisfying the needs for movement, enabling the student to use his free time rationally and meaningfully. as well as improving the quality of life in youth, adulthood and old age. Promotion of social communication. Expected results: Empowering the student for independent sports and physical exercise, familiarization with the laws of physical culture and proper nutrition. Acquiring knowledge about the structure, rules, principles of the training process and the specifics of the chosen kinesiological activity.',
        null, 'Анонимни анкети', null, null, null, '30', '0', '0', '30', '180', null, '0', null, null);
