values ('F23L1W005', '428', 'Business and Management', '600', '1', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Менаџерите на своето работно место
	2. Донесување одлуки
	3. Менаџмент на опкружувањето и културата на организацијата
	4. Планирање на работните активности, менаџирање стратегија
	5. Дизајн на организациска структура - основни дизајни
	6. Дизајн на организациска структура - адаптивни дизајни
	7. Менаџирање на човечки ресурси
	8. Креирање и менаџирање на тимови
	9. Менаџирање на комуникации
	10. Разбирање и управување со индивидуалното однесување
	11. Мотивирање на вработени
	12. Лидестрво
	13. Мониторирање и контролирањеж

Вежби:
	1. Историја на менаџмент
	2. Анализа на студии на случај за донесување одлуки
	3. Анализа на студии на случај за менаџмент на опкружувањето и културата на организацијата
	4. Анализа на студии на случај за планирање на работните активности и  менаџирање стратегија
	5. Анализа на студии на случај за дизајн на организациска структура - основни дизајни
	6. Анализа на студии на случај за дизајн на организациска структура - адаптивни дизајни
	8. Анализа на студии на случај за менаџирање на човечки ресурси
	8. Анализа на студии на случај за креирање и менаџирање на тимови
	9. Анализа на студии на случај за креирање и менаџирање на комуникации
	10. Анализа на студии на случај за разбирање и управување со индивидуалното однесување
	11. Анализа на студии на случај за мотивирање на вработени
	12. Анализа на студии на случај за лидерство
	13. Анализа на студии на случај за мониторирање и контролирање',
        'Basic concepts and definitions of management; enterprises and management; history of the management science; management constraints and challenges today; change and innovation management; management of social responsibility and ethics; managers as decision makers; planning basics; strategic management; planning tools and techniques; traditional and modern types of organization design; human resource management; career management; teams management; understanding the behavior of individuals; managers and communications; motivating employees; leadership; controlling; operations management; management in a global environment.', 'Развој на менаџерски способности: техничка, концепциска, комуникациска, аналитичка.
Усвојување на рамки, поими, модели и техники од областа на менаџментот.
Презентирање и анализа на примери, студии на случај и најдобри менаџмент практики од повеќе бизнис области и студии на случај на поодделни бизниси.', 'Managerial skills` development: technical, conceptual, communication, analytical.
Frameworks adoption, concepts, models and management techniques.
Examples presentation and analysis, case studies and best management practices from multiple business areas and case studies of individual businesses.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
