(10) Computer networks
(11) Security and Privacy
    (12) Introduction to Artificial Intelligence',
        'Солидно познавање на основите на информатичко-комуникациските технологии, нивното создавање, моментална состојба и иднината; начинот на кој функционираат сметачите, основите на Веб, обработката на сликите, видеото и анимациите; клучните области на информациско-комуникациските технологии и нивното влијание: спососност за манипулација со текст, табели, графикони, слики, аудио и видео.',
        'Solid knowledge of the basics of information and communication technologies, their creation, current state and future; how computers work, Web basics, image processing, video and animations; key areas of information and communication technologies and their impact: ability to manipulate text, tables, graphs, images, audio and video.',
