values ('F23L1W018', '427', 'Professional skills', '400', '1', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Вовед во предметот
	2. Комуникациски вештини
	3. Пишување биографија
	4. Пишување електронско и придружно писмо
	5. Пишување препорака и деловно писмо
	6. Подготовка и вежбање на интервју
	7. Организирање на настани
	8. Деловни состаноци, преговарање и тимска работа
	9. Пишување извештаи и есеи
	10. Академско пишување
	11. Подготовка и вежбање на презентации', 'Lectures:
1. Introduction to the subject
2. Communication skills
3. Writing a biography
4. Writing an electronic and cover letter
5. Writing a recommendation and business letter
6. Interview preparation and practice
7. Organizing events
8. Business meetings, negotiation and teamwork
9. Writing reports and essays
10. Academic writing
11. Preparation and practice of presentations',
        'Целта на курсот е да студентите да се стекнат со вештини потребни за академско и техничко пишување и презентирање, со водење сметка за етиката и критичкото мислење. По завршување на курсот се очекува студентот да може да изработи квалитетни академски текстови (резиме, есеј, CV, формално писмо) на англиски и македонски јазик; да разликува помеѓу различни технички текстови (спецификација, елаборат, извештај, техничка документација) и да идентификува нивни делови; да одржи ефективна презентација на зададена тема и да одговори на прашања поврзани со презентацијата;',
        'The aim of the course is for students to acquire the skills needed for academic and technical writing and presentation, taking into account ethics and critical thinking. After completing the course, the student is expected to be able to produce quality academic texts (summary, essay, CV, formal letter) in English and Macedonian; to distinguish between different technical texts (specification, elaboration, report, technical documentation) and to identify their parts; to hold an effective presentation on a given topic and answer questions related to the presentation;',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети', null, 'Реализирани активности 15.2 и 16.1', '60', '0', '15', '15',
        '60', '180', '0', '15', '0', '5');
