values ('F23L1W020', '448', 'Structured programming', '600', '1', '1', '2023', 'Македонски и англиски', '1. Вовед. Алгоритми и програми. Програмирање и програмски јазици. Структурно програмирање. Процес на креирање и извршување на програма
2. Алгоритамски контролни структури. Редоследна структура. Елементи од С++. Величини и податоци. Променливи. Оператор за доделување. Основни типови на податоци. Влез и излез. Први програми со редоследна структура.
 3.  Претставување на броеви во компјутер, опсег на броеви, повеќе за типови  на податоци и нивни опсези. Конверзија на тип на податоци. Релациски оператори. Споредбени и логички изрази. Структура за избор од 2 можности.
 4. Контролни структури за избор (if – else, Условен оператор ?:, switch)
 5. Контролни структури за повторување
 6. Алгоритамско размислување, правилен алгоритам. Внимателна употреба на break и continue и неупотреба на goto. Сложеност на алгоритми. Временска сложеност.
 7. Функции. Примена на функции. Подрачје на важење на променливите
 8. Низи: еднодимензионални, дводимензионални....
 9. Едноставни алгоритми за работа со низи/ познати алгоритми и решавање проблеми (пребарување, сортирање...)
10. Рекурзија и покажувачи
11. Работа со низи од знаци, стрингови, датотеки', '1. Introduction. Algorithms and programs. Programming and programming languages. Structured programming. The process of creating and executing a program
2. Algorithmic control structures. Sequential structure. Elements of C++. Variables. Assignment operator. Basic data types. Input and output. First programs with sequential structure.
 3. Representation of numbers in computer, range of numbers, more about data types and their ranges. Data type conversion. Relational operators. Relational and logical expressions. Simple selection structure.
 4. Control structures for selection (if – else, Conditional operator ?:, switch)
 5. Control structures for iteration
 6. Algorithmic thinking, correct algorithm. Careful use of break and continue and non-use of goto. Complexity of algorithms. Time complexity.
 7. Functions. Application of functions. Scope of variables
 8. Arrays: one-dimensional, two-dimensional...
