values ('F23L2S002', '653', 'Software requirements analysis', '600', '4', '1', '2023', 'македонски и англиски', '(1) Дефинирање на барања (на пр., Производ, проект, ограничувања, системски граници, надворешни и внатрешни)
(1) Процес на инженерство на барања
(1) Слоеви / нивоа на барања (на пр., Потреби, цели, кориснички барања, системски барања и софтверски барања)
(1) Карактеристики на барањата (на пример, тестирање, недвосмислена, конзистентна, точна, следи, и приоритет)
(1) Анализа на квалитетот (нефункционалните) барања (на пример, безбедноста, безбедноста, употребливоста и перформансите)
(1) Софтверски барања во контекст на системско инженерство
(1) Евалуација на барања, следење, приоритет, анализа на компромис, анализа на ризик и анализа на влијанието
(1) Управување со барања (на пример, управување со конзистентноста, планирање на издавање и повторна употреба), Интеракција меѓу барањата и архитектурата
(1) Елицитација на барања, извори за извлекување (на пр., засегнати страни, експерти за домен, и оперативни и организациски средини), техники за елицитација (на пример, интервјуа, прашалници / анкети, прототипови, случаи на употреба, опсервација и техники на партиципација)
(1) Спецификација и документација на барања, основа на документација за барања (на пр., видови, намена, структура, квалитет, атрибути и стандарди)
(1) Техники за спецификација на софтверски барања (на пр., Документација за барања за планови, табели за одлуки, кориснички приказни и спецификации за однесувањето)
(1) Валидација на барањата, Осврти и инспекции, Прототипирање за да се потврдат барањата
(1) Дизајн за тест за прифаќање, Потврдување на атрибути за квалитет на производот, Анализа на интеракција на барањата (на пример, функциска интеракција), Анализа на формални барања', '(1) Requirements definition (for example, product, project, restrictions, system boundaries, both external and internal)
(1) Requirements engineering process
(1) Layers/levels of requirements (for example, needs, goals, user requirements, system requirements and software requirements)
(1) Characteristics of requirements (for example, testing, unambiguous, consistent, precise, traceable and priority)
(1) Analysis of quality (nonfunctional) requirements (for example, reliability, security, usability and performance)
(1) Software requirements in the context of system engineering
(1) Evolution of requirements, tracing, priority, compromise analysis, risk analysis and influence analysis
(1) Requirements management (for example, consistency management, release planning and reusability), Interaction between requirements and architecture
(1) Requirements elicitation, sources of extraction (for example, stakeholders, domain experts, and operational and organizational environments), elicitation techniques (for example, interviews, questionnaires/surveys, prototypes, use cases, observation and participation techniques)
(1) Requirements specification and documentation, requirements documentation basics (for example, types, purpose, structure, quality, attributes and
standards)
(1) Techniques for software requirement specification (for example, planning requirements documentation, decision tables, user stories and behaviour specification)
(1) Requirements validation, desk-checks and inspections, prototyping for requirements verification
(1) Design of acceptance test, product quality attributes confirmation, requirements interaction analysis (for example, functional interaction), Formal
requirements analysis',
        'По завршувањето на предметот се очекува студентот да ги разбира и има продлабочено знаење во примена на техниките за извлекување знаење од клиентот, да ги разбира техниките за документирање на софтверски и бизнис потреби, да ги разбира и има продлабочено знаење во примената на техники за управување со промени кај софтверски и бизнис барања.', 'After finishing this course, the student is expected to understands and have deepened knowledge in application of knowledge extraction from his
