values ('F23L2S015', '576', 'Object-oriented analysis and design', '600', '2', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Основни објектно-ориентирани концепти. Класи, објекти, енкапсулација и полиморфизам. Интерфејси и реализација. Наследство и композиција.
	2. Вовед во УМЛ. Модели и потребата од моделирање. Класни дијаграми - атрибути и методи.
	3. Класни дијаграми - врски помеѓу класите. Објектни дијаграми.
	4. Кориснички сценарија и нивно моделирање преку use case дијаграми.
	5. Дијаграми на активности.
	6. Дијаграми на состојби.
	7. Секвенцни дијаграми.
	8. Колаборациски дијаграми.
	9. Интеракција со други системи. Дефинирање на интерфејси кон други системи со користење на УМЛ. Компонентни и развојни дијаграми.
	10. Интеракција со други системи. Дефинирање на интерфејси кон други системи со користење на УМЛ. Компонентни и развојни дијаграми (продолжение).
	11. Врска помеѓу УМЛ нотацијата и други нотации за моделирање на системи.
	12. Практични примери за примена на УМЛ стандардот.

Вежби:
	1. Основни објектно-ориентирани концепти. Класи, објекти, енкапсулација и полиморфизам. Интерфејси и реализација. Наследство и композиција.
	2. Вовед во УМЛ. Модели и потребата од моделирање. Класни дијаграми - атрибути и методи.
	3. Класни дијаграми - врски помеѓу класите. Објектни дијаграми.
	4. Кориснички сценарија и нивно моделирање преку use case дијаграми.
	5. Дијаграми на активности.
	6. Дијаграми на состојби.
	7. Секвенцни дијаграми.
	8. Колаборациски дијаграми.
	9. Интеракција со други системи. Дефинирање на интерфејси кон други системи со користење на УМЛ. Компонентни и развојни дијаграми.
	10. Интеракција со други системи. Дефинирање на интерфејси кон други системи со користење на УМЛ. Компонентни и развојни дијаграми (продолжение).
	11. Врска помеѓу УМЛ нотацијата и други нотации за моделирање на системи.
	12. Практични примери за примена на УМЛ стандардот.
