values ('F23L2S017', '551', 'Operating systems', '600', '4', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед. Процеси
	2. Процеси
	3. Распоредување на процеси
	4. Меѓупроцесна комуникација
