	8. Датотечни системи
	9. Имплементација на датотечни системи
	10. Партиционирање и надежност на датотечни системи (RAID)
	11. Влезно-излезни уреди и SSD дискови

Вежби:
	1. Основи на UNIX & команди за процеси
	2. Креирање на процеси (fork & exec)
