values ('F23L2S029', '442', 'Software engineering', '600', '4', '1', '2023', 'Македонски и англиски', '(1) Вовед во софтверското инженерство
(1) Карактеристики на софтверот и софтверските проекти
(2) Процес и методологии за развој на софтвер: декомпозиција, апстракција, објектен модел
(1) Анализа и моделирање на барањата: структурирана анализа, објектно-ориентирана анализа, формални спецификации
(2) Дизајнирање на софтвер и софтверски архитектури: пишување спецификација, концептуален, логички и физички дизајн на софтвер
(2) Шаблони за дизајн, статичка и динамичка анализа, имплементација, документација, планирање
(1) Вовед во тестирање: функционално тестирање, систематско тестирање
(1) Водење и управување на софтверски проекти', '(1) Introduction to Software Engineering
(1) Features of software and software projects
(2) Software development process and methodologies: decomposition, abstraction, object model
(1) Requirements analysis and modeling: structured analysis, object-oriented analysis, formal specifications
(2) Designing software and software architectures: specification writing, conceptual, logical and physical design of software
(2) Patterns for design, static and dynamic analysis, implementation, documentation, planning
(1) Introduction to testing: functional testing, systematic testing
(1) Leading and managing software projects',
        'Целта на предметот е запознање со: методологиите за дизајн и имплементација на софтверски системи преку анализа на барањата, развој и анализа на дизајнот, имплементацијата, интеграцијата и тестирањето на софтверот; анализа на проблем за развој на софтвер, дизајнирање на модуларна структура на решението која го решава проблемот и анализа и евалуација на алтернативи; имплементација на ефикасни и исправни модули, нивна  интеграција и тестирање, планирање и водење на софтверските проекти.',
        'The purpose of the course is to get acquainted with: the methodologies for design and implementation of software systems through the analysis of requirements, development and analysis of the design, implementation, integration and testing of the software; analyzing a software development problem, designing a modular solution structure that solves the problem, and analyzing and evaluating alternatives; implementation of efficient and correct modules, their integration and testing, planning and management of software projects.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети', 'Објектно-ориентирано програмирање',
        'Реализирани активности 15.2 и 16.1', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
