        'Успешниот студент ќе има продлабочени познавања од основните области на вештачката интелигенција, вклучувајќи ги: пребарувањето, решавањето проблеми, претставувањето на знаењето, расудувањето, донесувањето одлуки, планирањето и учењето и нивната примена. Исто така, ќе биде во состојба да ги дизајнира и реализира клучните проблеми од интелигентните системи со средна сложеност и да го процени нивното однесување.',
        'The successful student will have in-depth knowledge of the fundamental areas of artificial intelligence, including: search, problem solving, knowledge representation, reasoning, decision making, planning and learning and their application. It will also be able to design and realize key problems from intelligent systems of medium complexity and evaluate their behavior.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
