        'Релации, подредувања. Еквиваленции. Индукција и рекурзија. Броење. Основна комбинаторика. Принцип на гулабови дупки. Напредни комбинаторни техники. Биномна формула. Графови (основни поими, претставување и својства) Изоморфизам, пат планарност. Дрва и нивни својства.  Дрва на пребарување',
