        'The course provides an introduction to the basic mathematical concepts necessary for advanced computer science courses. Advanced proof techniques, induction and recursion will be studied. Students should acquire skills for solving combinatorial problems. To become familiar with basic terminology and the basics of graph representation.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
