        'Интегрирање: неопределен интеграл, интегрирање со замена. Определен интеграл. Фундаментална теорема во калкулус. Техники на интегрирање: парцијална интеграција, тригонометриски интеграли, тригонометриски смени, интегрирање на дробно-рационални функции. Примена на интеграли за пресметување на: плоштина, волумен, должина на лак на крива, плоштина на ротациона површина. Низи и редови. Диференцијални равенки: решавање на равенки со раздвоиви променливи, линеарни диференцијални равенки од прв ред, хомогени и нехомогени линеарни диференцијални равенки од втор ред.',
