values ('F23L2S051', '493', 'Computational thinking in education', '600', '4', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Вовед во информатичко размислување
	2. Користење на апстракции и препознавање на шаблони за прикажување на проблеми на нови и различни начини
	3. Логично организирање и анализа на податоци
	4. Декомпозиција на проблеми во помали делови
	5. Онлајн и офлајн алатки за развој на информатичкото размислување
	6. Напад на проблемот користејќи техники за алгоритамско размислување
	7. Информатичко размислување во развојот на софтвер
	8. Елементи од блоковски (визуелен) програмски јазик
	9. Елементи од блоковски (визуелен) програмски јазик 2
	10. Имплементација на решенија во блоковски (визуелен) програмски јазик
	11. Информатичко размислување во едукативни дигитални игри

Вежби:
