values ('F23L2S090', '568', 'Introduction to random processes', '600', '4', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Дефиниција на случаен процес. Математичко очекување, почетен момент од ред 1-1, корелциона функција.
	2. Специјални случајни процеси: со независни, некорелирани, ортогонални вредности. Стационарни случајни процеси.
	3. Вериги на Марков: дефиниција, хомогени вериги. Веројатноти на премин за еден и n чекори. Примери од реалноста.
	4. Стационарност на веригите на Марков: строга и асимптотска.
	5. Класификација на веригите на Марков. Примена во Page Rank.
	6. Условно математичко очекување. Процеси на разгранување: математичко оекување и дисперзија.
	7. Генерирачка функција на дискретна случајна променлива. Веројатност на изумирање кај веригите на Марков.
	8. Пуасонови процеси: дефиниција и својства.
	9. Маркови процеси: дефиниција, хомогеност. Веројатности на премин за време t. Веројатности на состојби.
	10. Брзина на премин кај вериги на Марков. Равенства на Чепман-Колмогоров. Процеси на раѓање и умирање.
	11. Системи за масовно опслужување: дефиниција и основни поими. Едноставни системи за масовно опслужување.
	12. Брауново движење (Винеров процес): дефиниција и основни својства.

Вежби:
	1. Дефиниција на случаен процес. Математичко очекување, почетен момент од ред 1-1, корелциона функција.
	2. Специјални случајни процеси: со независни, некорелирани, ортогонални вредности. Стационарни случајни процеси.
	3. Вериги на Марков: дефиниција, хомогени вериги. Веројатноти на премин за еден и n чекори. Примери од реалноста.
	4. Стационарност на веригите на Марков: строга и асимптотска.
