values ('F23L2S097', '593', 'Algorithm design', '600', '4', '1', '2023', 'македонски и англиски',
        'Што е алгоритам. Техники за дизајнирање на алгоритми и техники за пресметување на сложеност. Повеќедимензионално динамичко и алчно програмирање. Мемоизација во ДП. Пребарување во графови (класификација на ребра и темиња, време на посета и својства поврзани со нив). Алгорими за најкратки патишта од секое до секое теме и нивна примена. Алгоритми кои користат техники за премерување. Union find, фибоначиев куп и други понапредни структури  и пимена. Проток низ мрежа и min-cut max-flow. Дрва за пребарување (сегментни, интервални индексни). Алгоритми за шаблони во стрингови. Геометриски алгорими.',
        'What is an algorithm? Algorithm Design Techniques and Complexity Computing Techniques. Multidimensional Dynamic and Greedy Programming. Memoization in DP. Graph search (classification of edges and vertices, visit time and properties related to them). Algorithms for shortest paths from each to each vertex and their application. Algorithms that use surveying techniques. Union find, fibonacci pile and other more advanced structures and pimena. Flow through network and min-cut max-flow. Search trees (segmented, interval indexed). Algorithms for patterns in strings. Geometric algorithms.',
        'Во овој курс ќе се научат повеќе алгоритми и методи за решавање на проблемите со компјутер, како и одредени структури на податоци за имплементација на истите. Студентот ќе стекне искуство од програмирање, ќе ги разбере  принципите на дизајнирање на алгоритми, анализа на перформансите на алгоритмите и ќе ги научи фундаменталните идеи за дизајн на ефикасен алгоритам и комбинирање на истиот со соодветна структура на податоци. Идеите ќе се применат во пракса преку лабораториск вежби.',
        'In this course, you will learn more algorithms and methods for solving computer problems, as well as certain data structures for their implementation. The student will gain programming experience, understand the principles of algorithm design, algorithm performance analysis, and learn the fundamental ideas of designing an efficient algorithm and combining it with an appropriate data structure. Ideas will be put into practice through laboratory exercises.', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка на домашни задачи. учење во
електронско опкружување (форуми, консултации).
