values ('F23L2S099', '539', 'E-government', '600', '4', '1', '2023', 'македонски', 'Предавања:
	1. Вовед во е-влада; Дефинирање на информациски системи и информациската технологија; Дефинирање на јавниот сектор и примената на информациската технологија во јавниот сектор
	2. Теориски модели на управување: минимална држава; корпоративно управување; нов јавен менаџмент;
добро управување; социо-кибернетски систем; само-организирачки мрежи
	3. Фази на развој на е-влада и е-управување
	4. Придобивки и ризици на е-влада и е-управување; Дигитален јаз
	5. Теории и модели за е-управување: Модел на интеракција меѓу јавната администрација и граѓаните од аспект на информациските системи од Chadwick и May; Моделот на четири фази на Layne и Lee; Стратегиската рамка на Watson и Mundy за е-Демократија
	6. Адаптацијата на Flak и Rose на Теоријата на стеикхолдери од менаџмент теоријата кон областа на е-влада или е-управување; Моделот на Henderson и Venkatraman; Адаптација на теоријата на Henderson и Venkatraman, како доминантна теорија за примена на информациската технологија во приватниот сектор за примена во јавниот сектор
	7. Согледување на светските искуства од најважните области на примена на е-Влада и на стратегиите за примена на информациските технологии во јавниот сектор според области на примена: е-инфраструктура, е-бизнис
	8. Примена на информациските технологии во јавниот сектор според области на примена: е-здравство, е-образование, е-партиципација
	9. Преглед на успешни стратегии на најнапредните земји од областа на е-влада: Естонија, Словенија, Австрија
	10. Преглед на успешни стратегии на најнапредните земји од областа на е-влада: Данска, Ирска, Финска, Индија, Сингапур
	11. Преглед на успешни стратегии на најнапредните земји од областа на е-влада: Европска Унија
	12. Компаративна анализа на ИКТ проектите на владите на Македонија, Естонија и Словенија
	13. Утврдување на перспективите на примената на информациската технологија во јавниот сектор и на е-влада во Република Македонија', 'Lectures:
1. Introduction to e-government; Defining information systems and information technology; Defining the public sector and the application of information technology in the public sector
2. Theoretical management models: minimal state; corporate governance; new public management;
good governance; socio-cybernetic system; self-organizing networks
3. Stages of development of e-government and e-management
4. Benefits and risks of e-government and e-management; Digital divide
5. Theories and models for e-governance: Model of interaction between public administration and citizens from the aspect of information systems by Chadwick and May; Layne and Lee`s four-stage model; Watson and Mundy`s Strategic Framework for e-Democracy
6. Flak and Rose`s adaptation of the Stakeholder Theory from management theory to the field of e-government or e-management; Henderson and Venkatraman`s model; Adaptation of Henderson and Venkatraman`s theory as the dominant theory for the application of information technology in the private sector for application in the public sector
7. Perception of world experiences from the most important areas of application of e-Government and strategies for the application of information technologies in the public sector according to areas of application: e-infrastructure, e-business
8. Application of information technologies in the public sector according to areas of application: e-health, e-education, e-participation
9. Overview of successful strategies of the most advanced countries in the field of e-government: Estonia, Slovenia, Austria
10. Overview of successful strategies of the most advanced countries in the field of e-government: Denmark, Ireland, Finland, India, Singapore
11. Review of successful strategies of the most advanced countries in the field of e-government: European Union
12. Comparative analysis of the ICT projects of the governments of Macedonia, Estonia and Slovenia
13. Determination of the perspectives of the application of information technology in the public sector and e-government in the Republic of Macedonia',
        'Целта на курсот е студентите да се запознаат со испораката на услугите од страна на владините институции кон корисниците: граѓаните, бизнисите и организациите од невладиниот сектор и примената на информациските технологии во тие процеси; да се запознаат со напредните држави и напредните области на примена на е-влада преку анализа на примери, студии на случај и најдобри практики; Подобрување на комуникациските вештини, усни и писмени, работа во тим при изработка на проектна задача, презентирање на проектната задача.',
        'The aim of the course is for students to become familiar with the delivery of services by government institutions to the users: citizens, businesses and organizations from the non-governmental sector and the application of information technologies in those processes; to become familiar with advanced countries and advanced areas of e-government application through the analysis of examples, case studies and best practices; Improving communication skills, oral and written, working in a team during the preparation of a project task, presenting the project task.',
        'предавања, аудиториски вежби, проектни задачи, домашни задачи', 'механизам на интерна евалуација и анкети',
        'Бизнис и менаџмент', 'Реализирани актибвности 15.2 и 16.1', '30', '45', '15', '15', '75', '180', '0', '15',
        '80', '10');
