values ('F23L2S114', '517', 'Computre graphics', '600', '4', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед. Терминологија. Примена. Уреди. Софтвер.
	2. Графички примитиви. Координатни системи. Репрезентација на графички примитиви. Атрибути на примитивите.
	3. Графички примитиви. Имплементациски алгоритми.
	4. 2Д трансформации. Видови. Хомогени координати. Комбинирање на трансформации.
	5. Трансформации на поглед во 2Д. Проточен модел. Отсекување и алгоритми за отсекување.
	6. Сплајнови во 2Д. Репрезентација на криви. Терминологија. Кубични сплајнови. Hermite сплајн. Bezier криви. Геометриски алгоритам за исцртување на сплајнови.
	7. 3Д трансформации.
	8. 3Д поглед. 3Д проточен модел. Проекции. Отсекување во 3Д.
	9. Светлински модел.  Извори на светлина. Површински ефекти. Рефлексија. Транспарентност. Методи за рендерирање на полигони.
	10. Невидливи површини. Техники за рендерирање на видливите површини и отстранување на невидливите површини.
	11. Ray tracing.  Алгоритам за рендерирање со следење на зраци.
	12. Текстури. Дефиниција.  Видови текстури. Техники за лепење на текстури на полигони.
', 'Lectures:
1. Introduction. Terminology. Application. Devices. Software.
2. Graphics primitives. Coordinate systems. Representation of graphic primitives. Attributes of primitives.
3. Graphics primitives. Implementation algorithms.
4. 2D transformations. Species. Homogeneous coordinates. Combining transformations.
5. View transformations in 2D. Flow model. Clipping and clipping algorithms.
6. Splines in 2D. Representation of curves. Terminology. Cubic splines. Hermite spline. Bezier curves. A geometric algorithm for drawing splines.
7. 3D transformations.
8. 3D view. 3D flow model. Projections. Cropping in 3D.
9. Light model. Light sources. Surface effects. Reflection. Transparency. Methods for rendering polygons.
10. Invisible surfaces. Techniques for rendering visible surfaces and removing invisible surfaces.
11. Ray tracing. Ray-tracing rendering algorithm.
12. Textures. Definition. Types of textures. Techniques for pasting textures to polygons.',
        'Целта на предметот е запознавање на студентите со теориските основи и концепти на 2D и 3D компјутерска графика, геометриското моделирање, трансформациите, рендерирањето и генерирањето криви и површини со помош на сплајнови. Практичната имплементација на алгоритмите ќе се реализира со помош на OPEN GL. По завршување на курсот се очекува студентот да демонстрира познавање на теориските основи и концепти на 2Д и 3Д компјутерската графика, да користи OpenGL библиотека и графички софтверски пакети за практична реализација на проблеми од компјутерската графика.',
        'The aim of the course is to acquaint students with the theoretical foundations and concepts of 2D and 3D computer graphics, geometric modeling, transformations, rendering and generation of curves and surfaces using splines. The practical implementation of the algorithms will be realized with the help of OPEN GL. After completing the course, the student is expected to demonstrate knowledge of the theoretical foundations and concepts of 2D and 3D computer graphics, to use the OpenGL library and graphics software packages for the practical implementation of computer graphics problems.',
        '/', 'механизам на интерна евалуација и анкети', 'Објектно-ориентирано програмирање',
        'освоени 50% од предвидените поени од проектот', '30', '45', '15', '15', '75', '180', '20', '15', '40', null);
