values ('F23L2S119', '570', 'Concepts of information society', '600', '4', '1', '2023', 'македонски и англиски',
        'Развојот на информатичкото општество и основни концепти; Глобализацијата и информатичката технологија: развојот на информатичкото општество и влијанието на глобализацијата на дигиталниот свет; Победници и губитници во времео на информатичкото општество: анализа на теми на национално, локално и индивидуално ниво; Дигитален јаз. Информатичките технологии и дигиталните домови. Влијанието на мобилните телефони, WIFI, дигиталните технологии во начинот на живеење; Интернет и неговото значење во секојдневниот живот на луѓето; Концептуални рамки за анализа на различните влијанија на информатичките технологии; Компјутерски криминал; 	Паметни картички, дигитален индетитет; Компјутерска етика; Надгледувано општество и ИТ; 	ИТ и заканите за безбедност во модерните општества.',
        'The development of the information society and basic concepts; Globalization and information technology: the development of the information society and the impact of globalization on the digital world; Winners and losers in the age of the information society: analysis of topics at the national, local and individual level; Digital divide. Information technologies and digital homes. The impact of mobile phones, WIFI, digital technologies in the way of living; Internet and its importance in people`s daily life; Conceptual frameworks for the analysis of the various impacts of information technologies; Computer crime; Smart cards, digital identity; Computer ethics; Supervised society and IT; IT and security threats in modern societies.', 'Целта на курсот е да се запознаат студентите со теориите и пристапите кои ја анализираат улогата на информатичката технологија, медиумите и знаењето во модерното општество. По завршување на модулот студентите треба да бидат способни да:
1.	Систематски и критично дискутираат, евалуираат и ги анализираат главните теми, принципи, концепти и теории на информатичкото општество
2.	Применуваат различни концепти од информатичкото општество
3.	Покажат разбирање за важноста на информатичката технологја и знаењето во модерното општество', 'The aim of the course is to familiarize students with theories and approaches that analyze the role of information technology, media and knowledge in modern society. After completing the module students should be able to:
1. Systematically and critically discuss, evaluate and analyze the main topics, principles, concepts and theories of the information society
2. They apply different concepts from the information society
3. Demonstrate an understanding of the importance of information technology and knowledge in modern society',
        'предавања, проекти, дискусии, работилници', 'механизам на интерна евалуација и анкети',
        'Вовед во компјутерски науки', 'Реализирани активности 15, 16', '30', '45', '15', '15', '75', '180', '10', '15',
        '70', '10');
