values ('F23L2S124', '531', 'Media and communication', '600', '4', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Воведно предавање; Запознавање со целите и содржините на предметот, начинот на кој ќе се изведувва наставата, типот и обемот на доманите работи, есеите и проектините задачи,
	2. Основни на теорија на комуникации; историски развој на комуникации; комуникации и медиуми; развој и подлеба на медиуми (традиционални, нови и ултра нови медиуми), влијание на технолошкиот развој врз медиумите и комуникациите,
	3. Комуникациски модели, Тро-нивовски комуникациски модел, Нарушувања на комуникацискиот модел поради влијанија на медиумите,
	4. Раскажување на приказни, Структура на приказна, Значењето на разкажување на приказни, влијанието на медиумите врз разкажувањето на приказни
	5. Јавен настап, Јавен настап во име на институција или компанија, основи на односи со јавност
	6. Социјални мрежи како медиум, ефект на вмреженост, влијателност наспроти популарност,
	7. Анализа на јавно мнение: Потреба, принципи и пристапи; Техники и алатки за анализа на јавното мислење, Користење на нови медиуми како алатки за анализа на јавното мислење (предности и недостатоци)
	8. Бренд и корпоративен идентитет и неговата поврзаност со претставување на брендот преку медиумите, Користење на социјалните мрежи како алатки за развој на брендот,
	9. Граѓански активизам, медиуми и социјални мрежи; Технолоки алатки за зголемување на импактот
	10. Витуелни заедници, типови и карактеристики, виртуелни светови, Основи на кибер култура
	11. Игри како медиуми; Од игри до гејмификација; Примена на гејмификација
	12. Феномени што произлегуваат од социјалните мрежи, технофилија, зависност од технологија, технофобија

Вежби:
	1. Утврдување на алатки за комуникација во текот на семестарот, дефинирање на критериуми за добро изработени анкети и есеи
	2. Практични вежби за илустрација на различни комуникациски техники
	3. Практични вежби за илустрација на комуникациските модели
	4. Практични примери за примена на раскажување на приказни
	5. Анализа на јавни настапи, студии на случај
	6. Практични вежби за илустрација на ефектите на социјалните мрежи, Студии на случај
	7. Анализа на студии на случај, дефинирање на хипотези, дефинирање на одбирок на испитаници, примена на алатки за статистичка анализа на резултатите
	8. Студии на случај
	9. Анализа на студии на случај
	10. Студии на случај
	11. Студии на случај
	12. Анализа на студии на случај (На пример, лажни вести)
',
        'Theory of communications, communication models, storytelling, public performance, public relations, ICT as a communication tool, Types of Media, Characteristics of electronic media, new media and social networks, technological tools for business communication, basics of public opinion analysis, brand definition, social networks as branding tools, virtual societies, basic concepts of cyber-culture.', 'По завршувањето на предметот се очекува студентот да ги разбира основните
поими од комуникатологијата како наука, како и да има продлабочено знаење во примена на постоечките техники и
сознанија за подобрување за комуникацијата помеѓу чинителите на комуникацијата. Посебен осврт ќе биден даден на комуникацијата преку новите медиуми и начинот на кој новите медиуми влијаат во различни општествени сфери. Студентите ќе бидат запознаени со основните принципи за испитување на јавно мислење и користење на новите медиуми (со посебен фокус на социјалните мрежи) за градење и промовирање на бренд (личен или корпоративен).', 'After completing the course, the student is expected to understand the basic
concepts of communication science as a science, as well as have in-depth knowledge of the application of existing techniques and
insights to improve communication between communication actors. Special attention will be given to communication through new media and the way new media influence different social spheres. Students will be introduced to the basic principles of surveying public opinion and using new media (with a special focus on social networks) to build and promote a brand (personal or corporate).', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, тимска работа, пример
случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во
електронско опкружување (форуми, консултации).
', 'механизам на интерна евалуација и анкети', 'Вовед во компјутерски науки',
        'Редовно посетување настава (до 3 отсуства), навремно доставување домашни задачи, семинарски работи, дискусии на форум и проект',
        '30', '45', '15', '15', '75', '180', '10', '15', '20', '20');
