values ('F23L2S164', '534', 'Information theory and digital communication', '600', '4', '1', '2023',
        'македонски и англиски', '1. Дефиниција на случајни процеси. Карактеристики: математичко очекување, почетен момент од ред 1-1. Корелациона функција.
	2. Својства на корелациона функција. Видови на стационарност на случајни процеси.
	3. Ентропија на случајна променлива. Ентропија на случаен вектор. релативна ентропија. Информација. Верижни правила.
	4. Својства на ентропија и информација.
	5. Вериги на Марков: дефиниција, својства. стационарност.
	6. Рата на ентропија
	7. Компресија на податоци: дефиниција на код, несингуларен код, код со својство на префикс, Крафтово неравенство.
	8. Оптимални кодови. Хуфманов код. Код на Шенон-Фано-Елијас. Аритметички кодови.
	9. Капацитет на канал. Дефиниција. Определување на капацитет на познати канали.
	10. Диференцијална ентропија. Гаусов канал.
	11. Идеална шема за декодирање за бинарен симетричен канал.
	12. Линеарни кодови. Кодови кои откриваат и поправаат грешки.', '1. Definition of random processes. Properties: mathematical expectation, initial moment of order 1-1. Correlation function.
2. Properties of correlation function. Types of stationarity of random processes.
3. Entropy of a random variable. Entropy of a random vector. relative entropy. Information. Chain rules.
4. Properties of entropy and information.
5. Markov chains: definition, properties. stationarity.
6. Rate of entropy
7. Data compression: definition of code, non-singular code, code with prefix property, Kraft`s inequality.
8. Optimal codes. Huffman code. Shannon-Fano-Elias code. Arithmetic codes.
9. Channel capacity. Definition. Determination of capacity of known channels.
10. Differential entropy. Gaussian channel.
11. Ideal decoding scheme for a binary symmetric channel.
12. Linear codes. Codes that detect and correct errors.',
        'Студентите ќе бидат запознаени со квантитативната теорија на информации и нејзината примена во надежни и ефикасни комуникациски системи. Дополнително ќе бидат запознаени со математичкиот модел на комунникацискиот систем.',
        'Students will be introduced to quantitative information theory and its application in reliable and efficient communication systems. Additionally, they will be introduced to the mathematical model of the communication system.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'Веројатност и статистика или Математика 3 или Бизнис и статистика',
        '15.1 и 15.2', '30', '45', '15', '15', '75', '180', '0', '15', '90', '10');
