values ('F23L2W001', '429', 'Algorithms and data structures', '600', '3', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед во податочни структури
	2. Анализа на алгоритми и сложеност на алгоритми
	3. Репрезентација на податоци со фундаментални податочни структури (низи и листи)
