	9. Графови
', '(1) Introduction to data structures
(1) Analysis of algorithms and complexity of algorithms
(2) Data representation with fundamental data structures (arrays and lists)
(2) Introduction to algorithms and techniques for creating algorithms (brute force, greedy, divide-and-conquer, dynamic programming...)
(1) One-dimensional data structures (stack, queue)
(1) Sorting algorithms
(1) HASH structures
(2) Hierarchical structures - trees
(2) Graphs', 'Запознавање со основните податочни структури и алгоритми кои се понатаму неопходни за работа со бази на
податоци како и за други апликации. Студентот ќе биде оспособен за користење и развој на структури и алгоритми
со линеарни листи, стебла, графови како и и индекси за пребарување. Исто така ќе биде оспособен за
имплемнтација на различните архетипи на алгоритми што се користат во практичната имплементација на многу
софтверски решенија.', 'Getting to know the basic data structures and algorithms that are further necessary for working with databases
data as well as for other applications. The student will be able to use and develop structures and algorithms
with linear lists, trees, graphs as well as search indexes. He will also be trained to
implementation of the various archetypes of algorithms used in the practical implementation of many
software solutions.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка на домашни задачи. учење во електронско опкружување (форуми, консултации).',
