values ('F23L2W002', '2967', 'Mathematics 1', '600', '1', '1', '2023', 'Македонски', '1.	Дефиниција на функција. Својства на функции. Коренски функции. Функции дефинирани по делови. Oперации со функции (збир, разлика, производ, количник и композиција).
2.	Растегнување, компресија, транслација и рефлексија на график на функција. Парни и непарни функции. Прави (равенка на права низ две точки, коефициент на правец). Фамилии од функции (степенски функции).
3.	Полиноми, рационални функции, тригонометриски функции (дефиниција, период, график, домен). Инверзни функции (домен, ранг, определување на инверзна функција, услови за постоење на инверзна функција).
4.	Експоненцијални и логаритамски функци (дефиниција, график, домен, ранг, експоненцијално и логаритамско растење). Лимеси (интуитивна дефиниција, определување на еднострани и двострани лимеси од график на функција).
5.	Бесконечни лимеси и лимеси во бесконечност. Вертикална и хоризонтална асимптота. Пресметување на лимеси (основни лимеси, лимес од збир, разлика, производ, количник, лимеси од функции дефинирани по делови).
6.	Непрекинатост на функции. Лимеси и непрекинатост на тригонометриски функции.
7.	Дефиниција на извод. Тангента. Диференцијабилност. Техники на диференцирање (извод од константа, степенска функција, збир, разлика, производ, количник).
8.	Изводи од тригонометриски функции. Верижно правило за извод од композиција на функции. Изводи од експоненцијални и логаритамски функции. Локална линеарна апроксимација.
9.	Лопиталово правило. Примена на изводи: монотоност на функции.
10.	Примена на изводи: конвексност и конкавност на функции, локални екстреми. Испитување на својства и скицирање на график на функција.
11.	Интегрирање (проблем на плоштина, метод на правоаголници и метод на антиизвод). Неопределен интеграл. Интегрирање со замена.
12.	Определен интеграл. Фундаментална теорема во калкулус. Парцијална интеграција. Несвојствени интеграли (само со бесконечни граници)', '1. Definition of a function. Properties of functions. Root functions. Functions defined by parts. Operations with functions (sum, difference, product, quotient and composition).
2. Stretching, compression, translation and reflection of a graph of a function. Even and odd functions. Lines (equation of a line through two points, direction coefficient). Families of functions (power functions).
3. Polynomials, rational functions, trigonometric functions (definition, period, graph, domain). Inverse functions (domain, rank, determination of an inverse function, conditions for the existence of an inverse function).
4. Exponential and logarithmic functions (definition, graph, domain, rank, exponential and logarithmic growth). Limes (intuitive definition, determination of one-sided and two-sided limes from the graph of a function).
5. Infinite limes and limes in infinity. Vertical and horizontal asymptote. Calculation of limes (basic limes, limes of sum, difference, product, quotient, limes of functions defined by parts).
6. Continuity of functions. Limes and continuity of trigonometric functions.
7. Definition of derivative. The tangent. Differentiability. Techniques of differentiation (derivative of a constant, power function, sum, difference, product, quotient).
8. Derivatives of trigonometric functions. Chain rule for the derivative of a composition of functions. Derivatives of exponential and logarithmic functions. Local linear approximation.
9. Lopital`s rule. Application of derivatives: monotonicity of functions.
10. Application of derivatives: convexity and concavity of functions, local extrema. Examining properties and sketching the graph of a function.
11. Integrating (area problem, method of rectangles and antiderivative method). Indefinite integral. Integrating with Substitution.
12. Definite integral. Fundamental theorem in calculus. Partial integration. Improper integrals (only with infinite limits)',
        'Предметот е од подршка и е неопходен за воведување на поимите за функција, лимес, извод и интеграли кои се неопходни во скоро сите предмети од повисоки години.',
        'The subject is of support and is necessary to introduce the concepts of function, limes, derivative and integrals which are necessary in almost all subjects of higher years.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски',
        'механизам на интерна евалуација и анкети', null, null, '45', '45', '10', '0', '80', '180', null, '0', null,
        null);
