values ('F23L2W006', '449', 'Probability and statistics', '600', '3', '1', '2023', 'Македонски и англиски', 'Елементи од комбинаторика. Веројатност на случајни настани. Својства на веројатности. Дискретен простор на веројатност. Класична дефиниција. Условна веројатност. Баесово правило. Независност на случајни настани.  Бернулиева шема. Дискретни и непрекинати распределби. Случајни вектори: маргинални и условни распределби. Функции од случајни променливи. Бројни карактеристики на случајни променливи: математичко очекување, дисперзија на случајна променлива, коефициент на корелација помеѓу две случајни променливи.
Закон на големите броеви. Централна гранична терорема. Елементи од статистика: популација и примерок, параметри и статистики.  Основна обработка на податоци и дескриптивни статистики. Математички модел на случаен примерок. Распределби на статистики на примерок: нормална, t-распределба, Хи квадрат и F-распределба. Оценување на параметри на обележјето: метод на моменти, метод на       максимална подобност, интервали на доверба. Параметарски тестови. Непараметарски тестови. Линеарна регресија, оценување со метод       на најмали квадрати.', 'Elements of combinatorics. Probability of random events. Properties of probabilities. A discrete probability space. Classic definition. Conditional probability. Bayes rule. Independence of random events. Bernoulli scheme. Discrete and continuous distributions. Random vectors: marginal and conditional distributions. Functions of random variables. Numerous characteristics of random variables: mathematical expectation, dispersion of a random variable, correlation coefficient between two random variables.
Law of large numbers. Central Border Terrorism. Elements of Statistics: Population and Sample, Parameters and Statistics. Basic data processing and descriptive statistics. Mathematical model of random sampling. Distributions of sample statistics: normal, t-distribution, Chi-square, and F-distribution. Estimation of feature parameters: method of moments, method of maximum likelihood, confidence intervals. Parametric tests. Nonparametric tests. Linear regression, least squares estimation.',
        'Да се воведат основните концепти од веројатност и статистичка анализа со дискусија на примените во компјутерските науки. Да се оспособат студентите за успешно следење на стручните предмети во кои се применуваат елементи од теорија на веројатност и статистика.',
        'To introduce the basic concepts of probability and statistical analysis with a discussion of applications in computer science. To enable students to successfully follow vocational courses in which elements of probability theory and statistics are applied.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети', 'Калкулус 1 или Математика 1',
        'Реализирани актибвности 15.2 и 16.1', '45', '45', '45', '0', '45', '180', '0', '0', '100', '0');
