values ('F23L2W041', '481', 'Digital circuit design', '600', '1', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Бројни системи со основа r и конверзија. Аритметички операции во бинарен броен систем.
	2. Претставување на броеви со знак со комплементи (DC и RC комплемент). Аритметички операции со комплементи.
	3. Бинарни кодови, тежински кодови, BCD, Грејов код. Кодови за детекција на грешки. Кодови за корекција на грешки (Хамингов код)
	4. Булова алгебра
	5. Прекинувачки функции. Минтерми и макстерми. Логички порти. Нивоа на интегираност
	6. Минимизација на прекинувачки функции со Карнови мапи  и Квин Меклавски
	7. Анализа и дизајн на комбинациони логички кола
	8. Мултиплексери, демултиплексери, кодери, декодери, ROM и програмибилни логички низи
	9. Синхрони секвенцијални кола (флип-флопови, лечеви)
	10. Анализа на секвенцијални кола. Равенки на состојба. Табела на состојба. Секвенцијални кола од Милиев и Муров тип.
	11. Синтеза и на секвенцијални кола. Кодирање на состојби. Минимизација на состојби.
	12. Регистри. Паралелно и сериско полнење. Поместување. Ротација.
	13. Асинхрони и синхрони бојачи. Модуло бројач. Кружен бројач. Џонсонов бројач

Вежби:
	1. Бројни системи со основа r и конверзија. Аритметички операции во бинарен броен систем.
	2. Претставување на броеви со знак со комплементи (DC и RC комплемент). Аритметички операции со комплементи.
	3. Бинарни кодови, тежински кодови, BCD, Грејов код. Кодови за детекција на грешки. Кодови за корекција на грешки (Хамингов код)
	4. Булова алгебра
	5. Прекинувачки функции. Минтерми и макстерми. Логички порти. Нивоа на интегираност
	6. Минимизација на прекинувачки функции со Карнови мапи  и Квин Меклавски
	7. Анализа и дизајн на комбинациони логички кола
	8. Мултиплексери, демултиплексери, кодери, декодери, ROM и програмибилни логички низи
	9. Синхрони секвенцијални кола (флип-флопови, лечеви)
	10. Анализа на секвенцијални кола. Равенки на состојба. Табела на состојба. Секвенцијални кола од Милиев и Муров тип.
	11. Синтеза и на секвенцијални кола. Кодирање на состојби. Минимизација на состојби.
	12. Регистри. Паралелно и сериско полнење. Поместување. Ротација.
	13. Асинхрони и синхрони бојачи. Модуло бројач. Кружен бројач. Џонсонов бројач
', 'Lectures:
1. Numerous systems with base r and conversion. Arithmetic operations in binary number system.
2. Representation of signed numbers with complements (DC and RC complement). Arithmetic operations with complements.
3. Binary codes, weight codes, BCD, Gray code. Error detection codes. Error correction codes (Hamming code)
4. Boolean algebra
5. Interrupting functions. Minterms and maxterms. Logic gates. Levels of integration
6. Minimization of switching functions with Karn maps and Quin-Meklavsky
7. Analysis and design of combinational logic circuits
8. Multiplexers, demultiplexers, encoders, decoders, ROMs and programmable logic arrays
9. Synchronous sequential circuits (flip-flops, lenses)
10. Analysis of sequential circuits. Equations of state. Status chart. Sequential circuits of Miliev and Murov type.
11. Synthesis of sequential circuits. Coding of states. Minimization of states.
12. Registers. Parallel and serial charging. Displacement. Rotation.
13. Asynchronous and synchronous dyers. Modulo counter. Round counter. Johnson counter

Exercises:
1. Numerous systems with base r and conversion. Arithmetic operations in binary number system.
2. Representation of signed numbers with complements (DC and RC complement). Arithmetic operations with complements.
3. Binary codes, weight codes, BCD, Gray code. Error detection codes. Error correction codes (Hamming code)
4. Boolean algebra
5. Interrupting functions. Minterms and maxterms. Logic gates. Levels of integration
6. Minimization of switching functions with Karn maps and Quin-Meklavsky
7. Analysis and design of combinational logic circuits
8. Multiplexers, demultiplexers, encoders, decoders, ROMs and programmable logic arrays
9. Synchronous sequential circuits (flip-flops, lenses)
