11. Synthesis of sequential circuits. Coding of states. Minimization of states.
12. Registers. Parallel and serial charging. Displacement. Rotation.
13. Asynchronous and synchronous dyers. Modulo counter. Round counter. Johnson counter', 'Запознавање со основните методи за анализа и дизајн на логички кола и логички мрежи, како комбинациони така
и секвенцијални кола, регистри и бројачи.', 'Getting to know the basic methods for analysis and design of logic circuits and logic networks, such as combinational and so on
and sequential circuits, registers, and counters.',
