values ('F23L2W046', '458', 'Computer networks', '600', '3', '1', '2023', 'македонски и англиски',
        '(1) Mрежи, класификација на мрежи, модел на комуникациски систем, стандарди, протоколи, слоевитост. (1) Пренос на податоци, типови на медиуми, спектар и пропусен опсег, аналогни и дигитални податоци, шум, капацитет на комуникациски канал. (1) Податочен слој, врамување, детекција на грешки, PPP, контрола на проток, лизгачки прозорци, ARQ механизми, HDLC. (1) Tехнологии кај LAN и MAC подслој. ЛАН топологии. Повеќекратен пристап, MAC протоколи. (1) Принципи на работа на hub. Преплавување. Баферирање. Преклопување. (1) Ethernet. Структура на рамка. Адресирање. CSMA/CD. Switch. Учење наназад. Бродкаст и колизиски домени. ARP. (1) Mостови за поврзување различни технологии. Бродкаст бура. Протокол на скелетно дрво.  (1) Пакетен пренос. Датаграми и виртуелни кола. (1) Мрежен слој. IP. Адресирање. Упатување. Работа на упатувачи. Рутирачки табели.  (1) Протоколи за упатување. Типови на упатување. Статички патеки. IRP vs ERP. AS. Метрики. DV vs LS. (1) Приватни адреси, NAT, PAT, IPv6, DHCP. (2) Транспортен слој. Воспоставување на конекцијата. Мултиплексирање. UDP. RTP. TCP. Контрола на задушување. Порти (1) Web. HTTP. FTP. DNS.',
        '(1) Networks, classification of networks, communication system model, standards, protocols, layering. (1) Data transmission, media types, spectrum and bandwidth, analog and digital data, noise, communication channel capacity. (1) Data layer, framing, error detection, PPP, flow control, sliding windows, ARQ mechanisms, HDLC. (1) Technologies at LAN and MAC sublayer. LAN topologies. Multiple access, MAC protocols. (1) Principles of operation of the hub. Flooding. Buffering. Overlap. (1) Ethernet. Frame structure. Addressing. CSMA/CD. Switch. Learning backwards. Broadcast and Collision Domains. ARP. (1) Bridges for connecting different technologies. Broadcast storm. Skeleton Tree Protocol. (1) Packet transmission. Datagrams and virtual circuits. (1) Network layer. IP. Addressing. Referral. Referral work. Routing tables. (1) Referral protocols. Referral Types. Static paths. IRP vs ERP. AS. Metrics. DV vs LS. (1) Private addresses, NAT, PAT, IPv6, DHCP. (2) Transport layer. Establishing the connection. Multiplexing. UDP. RTP. TCP. Choking control. Ports (1) Web. HTTP. FTP. DNS.',
        'Вовед во основните концепти на компјутерските мрежи. Студентот ќе се здобие со знаења поврзани со мрежната архитектура, мрежните протоколи и дизајн на мрежи. Студентот ќе се запознае со главните компоненти и апликации на TCP/IP свитата од протоколи.',
        'An introduction to the basic concepts of computer networks. The student will acquire knowledge related to network architecture, network protocols and network design. The student will become familiar with the main components and applications of the TCP/IP protocol suite.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, учење со примери, употреба на симулатори и други електронски алатки за анализа на мрежата, протоколите и сообраќајот, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'Освоени најмалку 18 ЕКТС', 'реализирани лабораториски вежби', '30',
        '60', '15', '0', '75', '180', '10', '0', '70', '10');
