values ('F23L2W049', '482', 'Physics', '600', '1', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Физички велични и единици. Скаларни и векторски величини
	2. Кинематика на материјална точка
	3. Њутнови закони на движењето
	4. Работа, енергија, импулс и закони за запазување
	5. Осцилаторно движење
	6. Осцилаторно движење (продолжение)
	7. Механички бранови
	8. Механика на кружното движење
	9. Механика на флуиди
	10. Температура и топлина. Гасни закони
	11. Геометриска оптика
	12. Физичка оптика

Вежби:
	1. Решавање задачи со димензионална анализа и вектори
	2. Решавање задачи од праволиниско движење
	3. Решавање задачи со движење во две димензии
	4. Решавање задачи со користење на Њутновите закони
	5. Решавање задачи со закони за запазување
	6. Решавање задачи со осцилаторно движење
	7. Решавање задачи со механички бранови
	8. Решавање задачи со механика на кружното движење
	9. Решавање задачи со механика на флуиди
	10. Решавање задачи со гасни закони
	11. Решавање задачи со геометриска оптика
	12. Решавање задачи со физичка оптика
', 'Lectures:
1. Physical great and units. Scalar and vector quantities
2. Kinematics of a material point
3. Newton`s laws of motion
4. Work, energy, momentum and conservation laws
5. Oscillatory movement
6. Oscillatory motion (continued)
7. Mechanical waves
8. Mechanics of circular motion
9. Fluid mechanics
10. Temperature and heat. Gas laws
11. Geometrical optics
12. Physical optics

Exercises:
1. Solving problems with dimensional analysis and vectors
2. Solving rectilinear movement problems
3. Solving tasks with movement in two dimensions
4. Solving tasks using Newton`s laws
5. Solving problems with conservation laws
6. Solving tasks with oscillatory motion
7. Solving problems with mechanical waves
8. Solving problems with the mechanics of circular motion
9. Solving problems with fluid mechanics
10. Solving problems with gas laws
11. Solving tasks with geometric optics
12. Solving problems with physical optics',
        'Студентите ќе се запознаат со основните физички величини и закони од класичната механика. Тие ќе се стекнат со основни вештини за експериментална работа, како и за пресметување и правилно толкување на добиените резултати од областите кои се дел од содржината. Теоретските знаења на студентите ќе бидат солидна подлога за понатамошна надградба која е потребна за разбирање и моделирање на различните процеси каде што се применуваат информатиката и компјутерското инженерство.',
        'Students will get to know the basic physical quantities and laws of classical mechanics. They will acquire basic skills for experimental work, as well as for calculating and correctly interpreting the obtained results from the areas that are part of the content. The students` theoretical knowledge will be a solid foundation for further upgrading that is needed to understand and model the various processes where informatics and computer engineering are applied.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети', null, 'завршени лабораториски вежби', '45',
        '30', '15', '15', '75', '180', '10', '15', '70', '10');
