values ('F23L2W055', '491', 'Multimedia technologies', '600', '3', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Вовед во предметот
	2. Примена на мултимедијата
	3. Развој на мултимедиски проекти
	4. Текст
	5. Графика
	6. Видео
	7. Анимација
	8. Интерактивност и виртуелна реалност
	9. Звук
	10. Комбинирање на мултимедија
	11. Креирање мултимедиски проект

Вежби:
	1.
	2. Примена на мултимедијата
	3. Развој на мултимедиски проекти
	4. Работа со мултимедиски апликации
	5. 2Д графика. Гимп
	6. Работа со камера
	7. 3Д моделирање
	8. Софтвери за анимација
	9. Софтвери за анимација
	10. Работа со видео софтвер
	11. Креирање на проект
',
        'General terms related to different media, meaning, impacts and ubiquity of multimedia in today`s society. Planning and steps when creating multimedia projects. Development of a script for a multimedia project. Storage and transmission of multimedia data. Text. Audio technologies. Graphics and images. Video technologies. Animations, computer technologies for animation development and modeling. Introduction to virtual and augmented reality. Techniques for compression and transmission of multimedia data. Copyright and performance rights - legislative.',
        'Целта на предметот е студентот да се запознае со основите на различните медии: аудио, графика, видео и анимации и да ги сфати различните својства на секоја од нив. Студентот треба да ги запознае различните формати и да се оспособи за користење за различни апликации за креирање на мултимедијални содржини. Како повисока цел, студентот треба да може да развие мал мултимедијален производ со примена на изучените техники и методи.',
        'Student should become familiar with the basics of different media: audio, graphics, video, animations and to understand the different properties of each of them. The student should get learn about the different formats and be able to use different applications to create multimedia content. As a higher goal, the student should be able to develop a small multimedia product by applying the learned techniques and methods.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети', 'Вовед во компјутерски науки',
        'Реализирани актибвности 15.2 и 16.1', '30', '45', '15', '15', '75', '180', '0', '15', '50', '25');
