values ('F23L2W067', '459', 'Foundations of Information Theory', '600', '3', '1', '2023', 'Македонски и англиски', '(1) Елементи од комбинаторика. Веројатност на случајни настани. Својства на веројатности. (1) Дискретен простор на веројатност. Класична дефиниција. Условна веројатност. Баесово правило. (1) Независност на случајни настани.  Бернулиева шема.
    (2) Дискретни и непрекинати распределби. (1) Случајни вектори: маргинални и условни распределби. Функции од случајни променливи. (1) Бројни карактеристики на случајни променливи: математичко очекување, дисперзија на случајна променлива, коефициент на корелација помеѓу две случајни променливи. Централна гранична теорема. (2) Ентропија и инфомација
    (3) Компресија на податоци: оптимални кодови со својство на префикс. Хуфманов алгоритам. Алгоритам на Шенон-Фано-Елијас.      Аритметички кодови. (1) Комуникациски канал.', '(1) Elements of combinatorics. Probability of random events. Properties of probabilities. (1) Discrete probability space. Classic definition. Conditional probability. Bayes rule. (1) Independence of random events. Bernoulli scheme.
(2) Discrete and continuous distributions. (1) Random vectors: marginal and conditional distributions. Functions of random variables. (1) Numerous characteristics of random variables: mathematical expectation, dispersion of a random variable, correlation coefficient between two random variables. Central Limit Theorem. (2) Entropy and information
(3) Data compression: optimal codes with prefix property. Huffman`s algorithm. Shannon-Fano-Elias algorithm. Arithmetic codes. (1) Communication channel.',
        'Студентите ќе бидат запознати со основите на теорија на веројатност, а потоа и основните поими од теорија на информации и нејзината примена во реални комуникациски системи.',
        'Students will be introduced to the basics of probability theory, and then the basic concepts of information theory and its application in real communication systems.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети', 'Калкулус 1 или Математика 1', 'Реализирани активности', '30', '45',
        '15', '15', '75', '180', '0', '15', '90', '10');
