        'Запознавање на студентите со педагогијата како наука, педагошките дисциплини, воспитанието и училишниот систем.',
        'Acquaintance of students with pedagogy as a science, pedagogical disciplines, upbringing and the school system.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
