values ('F23L2W096', '597', 'Digitization', '600', '3', '1', '2023', 'Македонски', 'Предавања:
	1. Вовед во дигитизација
	2. Планирање на проект за дигитизација
	3. Авторски права
	4. Метаподатоци
	5. Дигитизација на слики преку скенирање
	6. Дигитизација на тексутални податоци. Оптичко препознавање на знаци (OCR)
	7. Дигитизација на аудио записи
	8. Дигитизација на видео записи
	9. Дигитизација на 3Д објекти
	10. Дигитални библиотеки и софтвери за архивирање
	11. Дигитална презервација
	12. Презентација на дигитизирани записи

Вежби:
	1. Основни поими за дигитизација
