	4. Разработка на различните стандарди за метаподатоци
	5. Техники за дигитизација на слики. Квалитет на слики
	6. Aлгоритми и техиники за дигитизација на текст. Оптичко препознавање на карактери
	7. Техники за дигитизација на слики. Параметри за квалитет на аудио записи. Аудио формати и компресија
	8. Техники за дигитизација на видео записи. Параметри за квалитет на видео записи. Видео формати, контејнери, енкодери и компресија
	9. Техники за дигитизација на 3Д објекти. Формати и интерпретирање
	10. Дигитални библиотеки и софтвери за архивирање
	11. Техники за зачувување на дигитизираните фајлови
	12. Методи и стандарди за презентација на дигитизирани податоци
', 'Lectures:
