values ('F23L2W100', '541', 'Economy for ICT engineers', '600', '3', '1', '2023', 'Македонски и англиски',
        'Што е економија? Економскиот проблем;  Понуда и побарувачка; Еластичност; Ефикасност и праведност; Организација на производството; Аутпут и трошоци; Главни активности кои се извршуваат при финансиски менаџмент на ИКТ услуги; Вреднување на ИКТ услугите; Моделирање побарувачка на ИКТ услугите; Менаџмент на портфолио на ИКТ услуги;  Оптимизација на обезбедување ИКТ услуги; Анализа на инвестиции во ИКТ услугите; Буџетирање, сметководство и определување цени; Финансиска усогласеност',
        'What is economics? The economic problem; Offer and demand; Elasticity; Efficiency and fairness; Production organization; Output and costs; Main activities performed in the financial management of ICT services; Valuation of ICT services; Modeling demand for ICT services; ICT services portfolio management; Optimization of providing ICT services; Analysis of investments in ICT services; Budgeting, accounting and pricing; Financial compliance',
        'ИКТ инженерите, изработувајќи и нудејќи ИКТ услуги, се соочуваат со прашања во врска со SLA договорите, продавачите, добавувачите, со финансиските аспекти на ИКТ услугите – колку чини услугата, зошто токму толку, колкави се трошоците, колку е дозволено да бидат трошоците и слично. Области кои им е потребно да ги владеат се буџетирање, книговодство, определување на цени, финансиско планирање, финансиска анализа и известување. Овој курс има за задача да им овозможи да ги совладаат овие области преку опис на основните  економски модели; демонстрирање како овие модели работат; опис на главните економски феномени со користење економски модели.',
        'ICT engineers, creating and offering ICT services, face questions related to SLA agreements, vendors, suppliers, financial aspects of ICT services – how much does the service cost, why exactly, what are the costs, how much are the costs allowed to be, etc. . Areas they need to master are budgeting, bookkeeping, pricing, financial planning, financial analysis and reporting. This course aims to enable them to master these areas by describing the basic economic models; demonstrating how these models work; description of the main economic phenomena using economic models.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети', 'Бизнис и менаџмент',
        'Реализирани актибвности 15.2 и 16.1', '30', '45', '35', '30', '40', '180', '10', '30', '70', '10');
