values ('F23L2W104', '573', 'Mathematics for engineers', '600', '3', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Нумеричка математика - Приближни броеви: претставување и операции, Видови грешки (апсолутна и релативна грешка).
	2. Нумеричка математика - Заокружување на приближни броеви: точни и значајни цифри.
	3. Нумеричка математика - Грешки при пресметување вредности на функции од една независна променлива.
	4. Нумеричка математика - Приближно решавање на нелинеарни равенки, Нумерички методи за решавање на системи линеарни равенки.
	5. Нумеричка математика - Пресметувачки шеми за полиноми и нивна практична примена.
	6. Нумеричка математика - Граници на интервал во кој се наоѓаат реалните корени на полиномните
равенки.
	7. Математички трансформации - Комплексни броеви: дефиниција, својства, модул, аргумент,
	8. Математички трансформации - Комплексни функции, Видови комплексни функции, Извод на комплексни функции, Коши- Риманови услови
	9. Математички трансформации - Лапласова трансформација (дефиниција, егзистенција, својства), Инверзна Лапласова трансформација,
	10. Математички трансформации - Методи за решавање на обични диференцијални равенки со Лапласова трансформација.
	11. Математички трансформации - Фуриеви трансформации, Фуриеви редови.
	12. Математички трансформации - Фуриев интеграл, Инверзна Фуриева трансформација.

Вежби:
	1. Практични задачи со приближни броеви.
	2. Примери за точни и значајни цифри.
	3. Примери за грешки на елементарни функции.
	4. Задачи и примери со различни нумерички методи.
	5. Практични примери со пресметувачки шеми за полиноми.
	6. Практични задачи со критериуми на Лагранж, Нутн, Декарт.
	7. Практични примери и задачи.
	8. Примери за комплексни функции.
	9. Задачи со примена на Лапласова трансформација и Инверзна Лапласова трансформација.
	10. Практични примери за решавање на обични диференцијални равенки со Лапласова трансформација.
	11. Практични задачи за определување на Фуриеви трансформации за функции.
	12. Практични задачи за определување на Инверзни Фуриеви трансформации за функции.
', 'Lectures:
1. Numerical Mathematics - Approximate numbers: representation and operations, Types of errors (absolute and relative error).
2. Numerical Mathematics - Rounding Approximate Numbers: Exact and Significant Figures.
3. Numerical mathematics - Errors when calculating values of functions from one independent variable.
4. Numerical mathematics - Approximate solution of nonlinear equations, Numerical methods for solving systems of linear equations.
5. Numerical mathematics - Calculation schemes for polynomials and their practical application.
6. Numerical mathematics - Limits of an interval in which the real roots of polynomials are located
equations.
7. Mathematical transformations - Complex numbers: definition, properties, modulus, argument,
8. Mathematical transformations - Complex functions, Types of complex functions, Derivation of complex functions, Cauchy-Riemann conditions
9. Mathematical transformations - Laplace transform (definition, existence, properties), Inverse Laplace transform,
10. Mathematical transformations - Methods for solving ordinary differential equations with Laplace transformation.
11. Mathematical transformations - Fourier transformations, Fourier series.
12. Mathematical transformations - Fourier integral, Inverse Fourier transformation.

Exercises:
1. Practical problems with approximate numbers.
2. Examples of exact and significant figures.
3. Examples of elementary function errors.
4. Problems and examples with different numerical methods.
5. Practical examples with calculation schemes for polynomials.
6. Practical tasks with criteria of Lagrange, Nutn, Descartes.
7. Practical examples and tasks.
8. Examples of complex functions.
9. Tasks using Laplace transform and Inverse Laplace transform.
10. Practical examples for solving ordinary differential equations with Laplace transform.
11. Practical tasks for determining Fourier transforms for functions.
12. Practical tasks for determining Inverse Fourier transforms for functions.', 'Предметот опфаќа методи за нумеричкото решавање на повеќе математички проблеми, како и примена на некои
позначајни математички трансформации во инженерството.', 'The subject includes methods for the numerical solution of several mathematical problems, as well as the application of some
more significant mathematical transformations in engineering.', 'Предавања, вежби, самостојна работа, проектни задачи, семинарски
работи', 'Механизам за интерна евалуација и анкети', 'Калкулус 1 или Математика 1', 'реализирани 15 и 16', '30', '45',
        '15', '15', '75', '180', '10', '15', '70', '10');
