        'Студентите ќе се запознаат со основните концепти за анализа на реалните сигнали и системи, со посебен фокус на анализата на комуникациски сигнали и нивниот пренос низ медиум, типовите на модулација и влијанието на шумот врз модулациските техники. Дополнително студентите ќе се здобијат со познавање од софтверски дефинирано радио, современите комуникациски системи и нивниот тековен развој.',
        'Students will be introduced to the basic concepts of analysis of real signals and systems, with a special focus on the analysis of communication signals and their transmission through a medium, types of modulation and the impact of noise on modulation techniques. In addition, students will gain knowledge of software-defined radio, modern communication systems and their current development.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
