values ('F23L2W165', '524', 'Technical support management', '600', '3', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Запознавање со предметот
	2. Вовед во ITIL Foundations
	3. Имплементација на ланец за обезбедување на вредност на сервисот
	4. 7 водечки принципи
	5. сервисни практики
	6. структура на организација, тимови и организациска култура
	7. вредносни протоци за нов сервис
	8. вредносни протоци за поддршка на сервис
	9. FitSM стандард за управување со сервиси. Елементи. Примена. Примери. Процеси. Придобивки. Сличности и разлики со ITIL.
	10. Service Level Agreements. Управување со сервисни нивоа. Типови на сервисни договори. Креирање на SLA. Мерење на SLA. Алатки.
	11. TM Forum Стандардизација. Open Digital Frameworx.
	12. одбрана на проектна задача

Вежби:
	1. запознавање со активностите на вежби
	2. канбан
	3. канбан алатки
	4. ticketing
	5. ticketing системи
	6. OTRS основни функционалности 1
	7. OTRS основни фунцкионалности 2
	8. OTRS ITSM CMDB
	9. OTRS управување со процеси 1
	10. OTRS управување со процеси 2
	11. OTRS web services
	12. OTRS services & SLA
', 'Lectures:
1. Getting to know the subject
2. Introduction to ITIL Foundations
3. Implementation of a chain to ensure the value of the service
4. 7 guiding principles
5. service practices
6. organization structure, teams and organizational culture
7. value streams for a new service
8. value streams for service support
9. FitSM service management standard. Elements. Application. Examples. Processes. Benefits. Similarities and differences with ITIL.
10. Service Level Agreements. Service Level Management. Types of service contracts. Creating an SLA. Measuring SLAs. Tools.
11. TM Forum Standardization. Open Digital Frameworks.
12. defense of a project assignment

Exercises:
1. familiarization with the activities of exercises
2. kanban
3. kanban tools
4. ticketing
5. ticketing systems
6. OTRS Basic Functionalities 1
7. OTRS basic functionalities 2
8. OTRS ITSM CMDB
9. OTRS process management 1
10. OTRS process management 2
11. OTRS web services
12. OTRS services & SLA',
        'По завршувањето на курсот се очекува студентот да ги разбира методите и системите за решавање на ИТ проблемите преку обезбедување на квалитетна техничка поддршка.',
        'After completing the course, the student is expected to understand the methods and systems for solving IT problems by providing quality technical support.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'Освоени најмалку 18 ЕКТС', 'нема', '30', '45', '15', '15', '75',
        '180', '10', '15', '50', '20');
