values ('F23L2W167', '518', 'User Interface Design Patterns', '600', '3', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Однесување на корисници. Вовед, кратка историја,  однесување на корисниците при работа со интерактивни системи, шаболни за опишување на однесувањето на корисниците
	2. Организација на содржина во интерактивни системи. Организациски шеми, организација на структура, шаблони за организирање и прикажување на податоци
	3. Навигација. Проблеми. Принципи за добра навигација. Навигациски модели. Шаблони за дизајнирање на навигација во интерактивни системи (навигациски модели, комбинирање на изглед и навигациски модели, поставување на ознаки, анимирани премини)
	4. Организација на екран. Основни поими (визуелна хиерархија, визуелен тек). Техники за групирање и пордедување на елементи. Гешталтови принципи. Шаблони за организирање на екраните.
	5. Форми и внесување на податоци. Принципи за дизајн на форми. Видови елементи за внесување на податоци и контроли. Шаблони за дизајнирање на форми (релации меѓу елементи, вредности на елементи, )
	6. Акции и команди. Рендерирање на акции. Репрезентација на акции. Шаблони за акции и команди (приказ на акции, подобрување на изборот на акциите, информации за долготајни акции, работа со низи од акции)
	7. Интеракција со листи на податоци. Архитектура на информациите. Интеракциски модели.
	8. Интеракција во социјални медиуми. Принципи и начин на коминукација во и со социјални медуиму. Интеракциски модели.
	9. Интеракција во мобилни уреди. Карактеристики што ја одредуваат интеракцијата во мобилните уреди. Интеракциски модели.

Вежби:
	1. Вовед во технологија за имплементација на шаблони за кориснички интерфејси. Примери поврзани со основните карактеристики.
	2. Понапредни концепти и можности на технологијата за имплементација на шаблоните за кориснички интерфејси. Примери што ги илустрираат овие концепти и можности.
	3. Имплементација на шаблоните за дизајнирање на навигација во интерактивните системи. Имплементација на примери во кои тие се употребуваат.
	4. Имплементација на шаблоните за организирање на екраните. Имплементација на примери во кои тие се употребуваат.
	5. Имплементација на примери во кои се вклучени форми, елементи за внесување податоци и контроли.
	6. Имплементација на примери што вклучуваат шаблони за акции и команди.
	7. Имплементација на интеракциските шаблони за листи на податоци и илустрација на примери во кои тие наоѓаат примена.
	8. Овозможување интеракција со социјални медиуми. Имплементација на интеракциските модели.
	9. Имплементација на карактеристични примери за интеракција во мобилните уреди со употреба на интеракциските модели.
',
        'Introduction to the course. User Behavior. Introduction, brief history, user behavior when working with interactive systems, patterns for describing the user behavior. Content organization in interactive systems. Organization schemes, structure organization, patterns for organizing and displaying data. Navigation. Problems. Principles of good navigation. Navigation models. Patterns for designing navigation in interactive systems (navigation patterns, combining appearance and navigation patterns, placing signposts, animated transitions). Screen organization. Basic concepts (visual hierarchy, visual flow). Techniques for grouping and ordering elements. Gestalt principles. Patterns for organizing screens. Forms and input. Principles of form design. Types of data entry elements and controls. Patterns for designing forms (relationships between elements, element values…) Actions and commands. Rendering actions. Representation of actions. Patterns for actions and commands (representation of actions, improve action selection, time consuming actions, work with sequences of actions). Interacting with lists of data. Information architecture. Interaction models. Interaction in social media. Principles and way of communication in and with social media. Interaction models. Interaction in mobile devices. Characteristics that determine interaction in mobile devices. Interaction models.',
        'Целта на предметот е да ги запознае студентите со основните проблеми и начини на решавање на истите за различните видови кориснички интерфејси и корисничка интеракција. По завршување на курсот се очекува студентот да демонстрира познавање на основните видови корисничка интеракција и принципите за нивно дизајнирање, и да може самостојно да развива интерактивни апликации со користење на програмски алатки следејќи ги научените принципи.',
        'The aim of the course is to familiarize students with the basic problems and ways of solving them for different types of user interfaces and user interaction. After completing the course, the student is expected to demonstrate knowledge of the basic types of user interaction and the principles for their design, and to be able to independently develop interactive applications using programming tools following the learned principles.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'Механизам за интерна евалуација и анкети', 'Структурно програмирање', 'Реализирани активности 15, 16', '30',
        '45', '15', '15', '75', '180', '20', '15', '70', '10');
