values ('F23L2W201', '2965', 'Application of algorithms and data structures', '600', '3', '1', '2023', 'македонски', '1. Вовед во податочни структури
	2. Анализа на алгоритми и сложеност на алгоритми
	3,4. Репрезентација на податоци со фундаментални податочни структури (низи и листи)
	5. Вовед во алгоритми и техники за креирање алгоритми
	6. Еднодимензионални податочни структури (магацин, редица)
	7. Алгоритми за сортирање
	8. Хеш структури
	9. Хиерархиски структури - дрва, Графови', '1. Introduction to data structures
2. Analysis of algorithms and complexity of algorithms
3,4. Data representation with fundamental data structures (arrays and lists)
5. Introduction to algorithms and techniques for creating algorithms
6. One-dimensional data structures (store, queue)
7. Sorting algorithms
8. Hash structures
9. Hierarchical structures - trees, Graphs', 'Запознавање со основните податочни структури и алгоритми кои се понатаму неопходни за работа со бази на
податоци како и за други апликации. Студентот ќе биде оспособен за користење на структури и алгоритми
