with linear lists, trees, graphs as well as search indexes. He will also be trained to
recognizing and using the various archetypes of algorithms used in the practical implementation of many
software solutions.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка на домашни задачи. учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'Структурно програмирање', null, '30', '60', '10', '10', '70',
        '180', null, '10', null, null);
