values ('F23L3S010', '444', 'Human-computer interaction design', '600', '6', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Вовед, терминологија, историја.
	2. Човекот во интеракција човек-компјутер, физички карактеристики,  когнитивни аспекти.
	3. Употребливост, принципи, стандарди, пристапност,  корисничко искуство.
	4. Процес на дизајнирање на интеракција човек компјутер, пристапи и карактеристики на процесот на дизајнирање.
	5. Собирање на барања, техники на интервјуирање, набљудување, дефинирање на персони и сценарија.
	6. Репрезентација на дизајнот, скици, storyboards,  прототипови, прототипови со мала верност, прототипови со голема верност.
	7. Анализа на задачи.
	8. Принципи за дизајнирање на интеракција, елементи на визуелен интерфејс, справување со грешки, помош и документација.
	9. Евалуација на кориснички интерфејс, начини и техники за евалуација, мерки за евалуација, евристика за употребливост и принципи за тестирање на  употребливост', 'Lectures:
1. Introduction, terminology, history.
2. Man in human-computer interaction, physical characteristics, cognitive aspects.
3. Usability, principles, standards, accessibility, user experience.
4. Human computer interaction design process, approaches and characteristics of the design process.
5. Gathering requirements, interviewing techniques, observation, defining personas and scenarios.
6. Design representation, sketches, storyboards, prototypes, low-fidelity prototypes, high-fidelity prototypes.
7. Task analysis.
8. Interaction design principles, visual interface elements, error handling, help and documentation.
9. User Interface Evaluation, Evaluation Methods and Techniques, Evaluation Measures, Usability Heuristics, and Usability Testing Principles',
        'Целта на предметот е да ги запознае студентите со основните принципи за дизајнирање на компјутерски системи што вклучуваат интеракција човек-компјутер. За таа цел студентите ќе бидат запознаени со процесот на дизајнирање на интерактивни системи, фазите за дизајнирање (собирање и анализа на барања, креирање на прототипови, имлементација и тестирање на употребливост). По завршување на курсот се очекува студентот да демонстрира познавање на процесот и чекорите за дизајнирање на системи што вклучуваат интеракција човек-компјутер и да може да самостојно или во тим да реализира едноставен проект за дизајнирање на интерактивни системи.',
        'The aim of the course is to introduce students to the basic principles of designing computer systems that involve human-computer interaction. For this purpose, students will be familiar with the process of designing interactive systems, the design phases (collection and analysis of requirements, creation of prototypes, implementation and usability testing). After completing the course, the student is expected to demonstrate knowledge of the process and steps for designing systems that include human-computer interaction and to be able to independently or in a team realize a simple project for designing interactive systems.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури',
        'Реализирани актибвности 15.2 и 16.1', '30', '45', '15', '15', '75', '180', '20', '15', '30', '0');
