values ('F23L3S012', '451', 'System Integration', '600', '6', '1', '2023', 'Македонски и англиски', 'Курсот опфаќа дизајн, избор, имплементација и менаџмент на ентерпрајз IT решенија. Фокусот е на апликациите и инфраструктурата и нивното поклопување со бизнисот. Студентите ќе научат за рамки и стратегии за менаџирање инфраструктура,
систем администрација, податочни архитектури, менаџирање со содржини,  дистрибуирано процесирање, интеграција на legacy системи, консолидација на системи, избор на софтвер, пресметка на вкупна цена на чинење, анализа на IT инвестиции
и нови технологии. Менаџирање ризик и безбедност како и поддршка на стандарди.  Ќе се обрне внимание и на способноста кај студентите да се пренесат стратегиите  за технолошките архитектури на општата деловна заедница.  (1) Вовед во интеграција на ИТ системи (enterprise architecture frameworks). (1) Типови на системска интеграција (софтверска, хардверска). (1) Enterprise data models, Data / information architecture and data integration. (1) Data / information architecture and data integration (методологии). (2) Вовед во складишта на податоци, ETL и манипулација со податоци. (2) Технологии за системска интеграција (XML, SOA, Web Services, COTS). (1) Виртуелизација, Облак, Software as a Service, Отворен код. (2) Enterprise Resource Planning Systems and business process models. (1) Менаџирање со ризици, тотална цена на чинење и поврат на инвестиција, ревизија и стандарди. (1) IT стратегија и метрика, Emerging technologies, System administration', 'The course covers design, selection, implementation and management of enterprise IT solutions. The focus is on applications and infrastructure and their alignment with the business. Students will learn about infrastructure management frameworks and strategies,
system administration, data architectures, content management, distributed processing, legacy systems integration, systems consolidation, software selection, total cost calculation, IT investment analysis
and new technologies. Risk management and security as well as standards support. Attention will also be paid to students` ability to communicate technology architecture strategies to the general business community. (1) Introduction to the integration of IT systems (enterprise architecture frameworks). (1) Types of system integration (software, hardware). (1) Enterprise data models, Data / information architecture and data integration. (1) Data / information architecture and data integration (methodologies). (2) Introduction to data warehouses, ETL and data manipulation. (2) Systems integration technologies (XML, SOA, Web Services, COTS). (1) Virtualization, Cloud, Software as a Service, Open Source. (2) Enterprise Resource Planning Systems and business process models. (1) Risk management, total cost and return on investment, auditing and standards. (1) IT strategy and metrics, Emerging technologies, System administration',
        'По завршување на курсот се очекува студентите да се оспособени за  дизајн, избор, имплементација и менаџмент на ентерпрајз IT решенија.  Да бидат способни за работа во  корпоративна средина при имплементација и одржување со надградба на ентерпрајз IT решенија. Да бидат способни да развиваат стратегии за технолошки архитектури на комплексни софтверски системи кои опслужуваат обемни податоци, многу корисници и широк спектар деловно процеси.',
        'After completing the course, students are expected to be trained in the design, selection, implementation and management of enterprise IT solutions. To be able to work in a corporate environment during the implementation and maintenance with the upgrade of enterprise IT solutions. Be able to develop strategies for technology architectures of complex software systems that serve large data, many users and a wide variety of business processes.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети',
