',
        'Introduction to Machine Learning, Generative Models, Gaussian Models, Univariate and Multivariate Linear Regression, Logistic Regression (Hypothesis Representation, Cost Functions, Error Evaluation, Model Selection and Validation), Unsupervised Learning, Mixed Models and EM Algorithm, Kernel methods, support vector machines, Neural networks, regularization in neural networks, Classification and regression decision trees, Deep learning.',
        'Целта на курсот е студентите да се запознаат со основите на модерните техники од областа на машинско учење. По завршувањето на курсот кандидатите: ќе имаат продлабочени знаења за напредните технологии и методи за машинско учење; ќе можат да разберат, анализираат и формулираат генерални проблеми од областа на машинско учење; ќе можат успешно да применат алгоритми за машинско учење при решавање на реални проблеми; ќе можат да конципираат, анализираат, реализираат и проценат перформанси на систем за машинско учење.',
        'The aim of the course is for the students to become familiar with the basics of modern machine learning techniques. Upon completion of the course, candidates will have deeper knowledge of advanced technologies and methods of machine learning; they will be able to understand, analyze and formulate general problems in the field of machine learning; they can successfully apply algorithms for machine learning in solving real problems; will be able to conceptualize, analyze, realize and evaluate the performance of a machine learning system.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети',
