values ('F23L3S039', '473', 'Basics of theory of computing', '600', '6', '1', '2023', 'Македонски и англиски', '1. Основни концепти за јазици, граматики и автомати
	2. Регуларни изрази и регуларни јазици
	3. Детерминистички конечни автомат
	4. Недетерминистички конечни автомати, Еквиваленција меѓу детерминистички и недетерминистички конечни автомати и редукција на број на состојби.
	5. Својства на регуларните јазиции лема за пумпање кај регуларни јазици.
	6. Контекстно слободни јазици
	7. Push-down автомати
	8. Врска меѓу контекстно слободни јазици и Push-down автомати
	9. Лема за пумпање кај конекстно слободни јазици и затварач.
	10. Тјурингови машини.
	11. Хиерархија кај јазици (рекурзивнијазици, контекстно сензитивни...)
	12. Вовед во компјутерска комплексност (П, НП)
	13. Пресметливост.', '1. Basic concepts of languages, grammars and automata
2. Regular expressions and regular languages
3. Deterministic finite automaton
4. Non-deterministic finite automata, Equivalence between deterministic and non-deterministic finite automata and reduction of number of states.
5. Properties of regular languages and pumping lemma for regular languages.
6. Context-free languages
7. Push-down machines
8. Relationship between context-free languages and Push-down automata
9. Pumping lemma for connected free languages and a closure.
10. Turing machines.
11. Hierarchy in languages (recursive languages, context sensitive...)
12. Introduction to computer complexity (P, NP)
13. Computability.',
        'На овој курс ќе стекнете основно разбирање за класичните модели кои се користат во основата на компјутерските науки за анализа на пресметковните процеси, вклучувајќи конечни автомати, граматики и Тјурингови машини. Овие  модели може да се користат за да се одговори на прашања како што се кои проблеми може да се решат со компјутер и дали има некои проблеми кои се суштински потешки за решавање од другите.',
        'On this course you will gain a basic understanding of the classical mathematical models used to analyze computing processes, including finite automata, grammars, and Turing machines. These mathematical models can be used to answer questions such as what problems can be solved by computer, and whether there some problems that are intrinsically harder to solve than others.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети',
        'Дискретна математика или Дискретни структури 2 или Математика 2 или Избрани теми од математика',
        'Реализирани активности 15.2 и 16.1', '30', '45', '15', '15', '75', '180', '0', '15', '90', '0');
