values ('F23L3S047', '486', 'Signal processing', '600', '6', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Вовед во дигитално процесирање на сигналите и потребните математички вештини
	2. Основни сигнали во дискретно време и операции со нив
	3. Дискретна Фуриеова трансформација и Фуриеова трансформација во дискретно време
	4. Врски меѓу Фуриеовите трансформации и нивни особини
	5. Брза Фуриеова трансформација
	6. Линеарни временски инваријатни системи
	7. z – трансформација и инверзна z – трансформација
	8. Дигитални филтри. Дизајнирање на филтри
	9. Земање примероци и интерполација
	10. Процесирање на стохастични сигнали и квантизација
	11. Дводимензионална Фуриеова анализа
	12. Основи на теорија на управување

Вежби:
	1. Повторување на математичките алатки потребни за дигиталното процесирање на сигналите
	2. Решавање задачи со основните видови сигнали во дискретно време
	3. Решавање задачи со Дискретна Фуриеова трансформација
	4. Решавање задачи каде што се применуваат особините на Фуриеовите трансформации
	5. Решавање задачи со практично пресметување на дискретната Фуриеова трансформација
	6. Решавање задачи со линеарни временски инваријатни системи
	7. Решавање задачи со z – трансформација и инверзна z – трансформација
	8. Решавање задачи со дизајнирање на филтри
	9. Решавање задачи со земање примероци од сигнали и интерполација
	10. Решавање задачи со стохастични сигнали и квантизација на сигнали
	11. Решавање едноставни задачи со дводимензионална Фуриеова анализа
	12. Решавање едноставни примери со теорија на управување
', 'Lectures:
1. Introduction to digital signal processing and the necessary mathematical skills
2. Basic signals in discrete time and operations with them
3. Discrete Fourier transform and discrete time Fourier transform
4. Relationships between Fourier transforms and their properties
5. Fast Fourier transform
6. Linear time-invariant systems
7. z – transformation and inverse z – transformation
8. Digital filters. Designing filters
9. Sampling and interpolation
10. Stochastic signal processing and quantization
11. Two-dimensional Fourier analysis
12. Foundations of management theory

Exercises:
1. Repetition of mathematical tools needed for digital signal processing
2. Solving tasks with the basic types of signals in discrete time
3. Solving problems with Discrete Fourier transformation
4. Solving tasks where the properties of Fourier transformations are applied
5. Solving problems with practical calculation of the discrete Fourier transform
6. Solving problems with linear time-invariant systems
7. Solving problems with z-transformation and inverse z-transformation
8. Solving tasks by designing filters
9. Solving problems with signal sampling and interpolation
10. Solving problems with stochastic signals and quantization of signals
11. Solving simple problems with two-dimensional Fourier analysis
12. Solving simple examples with management theory',
        'Познавањето на основите и техниките на дигиталното процесирање на сигнали е важно за секој инженер кој работи на апликации каде што има процесирање на сигнали. Со курсот студентите се воведуваат во теоретските основи дигитално процесирање на сигнали кои вклучуваат дискретизација, Фуриеова и z – трансформација. Студентите ќе стекнат и познавања од основните алатки како што се дигиталните IIR и FIR филтри. Во курсот ќе бидат дадени и основите на теоријата на управување. Преку бројните примери и вежби студентите ќе научат и практично да користат готови алатки за процесирање на сигнали.',
        'Knowledge of the fundamentals and techniques of digital signal processing is important for any engineer working on signal processing applications. The course introduces students to the theoretical foundations of digital signal processing, including discretization, Fourier and z-transformation. Students will also gain knowledge of basic tools such as digital IIR and FIR filters. The course will also cover the basics of management theory. Through numerous examples and exercises, students will learn to practically use ready tools for signal processing.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети', 'Математика 1 или Калкулус 1',
        'Реализирани актибвности 15.2 и 16.1', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
