values ('F23L3S054', '497', 'Methods in teaching informatics', '600', '8', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Вовед во предметот
	2. Карактеристики и особености на наставата по информатика.
	3. Развивање на критично мислење и алгоритмаско размислување за ученици од средните училишта
	4. Научни методи во наставата по информатика.
	5. Користење ЕСР рамка.
	6. Современи етоди на одржување разни видови часови.
	7. Техники на презентирање.
	8. Превртена училница
	9. Гемификација
	10. Предизвици на онлалн наставата
	11. Проверка на знаење. Оценување
	12. Мотивација и работа во групи

Вежби:
	1. Вовед
	2. Карактеристики и особености на наставата по информатика.
	3. Развивање на критично мислење и алгоритмаско размислување за ученици од средните училишта
	4. Научни методи во наставата по информатика.
	5. Користење ЕСР рамка.
	6. Современи методи на одржување разни видови часови.
	7. Примена на ехники на презентирање.
	8. Практични реализација на вревртена училница
	9. Разработка на едукативни игри
	10. Апликации кои покагаат во онлалн наставата
	11. Вежби за роверка на знаење. Оценување
	12. Мотивација и работа во групи
',
        'Characteristics and peculiarities of the teaching of informatics. Organization of the class. Scientific methods in the teaching of informatics. Using an ESR framework. Methods of holding various types of classes. Presentation techniques. Developing students` critical thinking. Active teaching. Knowledge check. Evaluation. Motivation and working in groups. Flipped classroom and online teaching',
        'Целта на предметот е оспособување на студентите да користат најсовремени техники за работа на час за да го предизвикаат интересот на учениците и истите да ги поттикнат на усвојување нови знаења за време на наставата во училницата. Студентите ќе се оспособат да спроведуваат активна настава во училницата, користејќи креативни техники според возраста на учениците и материјалот според наставниот план.',
        'The aim of the course is to enable students to use the most up-to-date techniques for class work to arouse students` interest and encourage them to acquire new knowledge during classroom instruction. Students will be trained to implement active teaching in the classroom, using creative techniques according to the age of the students and the material according to the curriculum.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети', 'Освоени најмалку 150 кредити',
        'Реализирани актибвности 15.2 и 16.1', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
