values ('F23L3S057', '495', 'Working with gifted students', '600', '6', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Техники за препознавање надарени ученици
	2. Техники за развивање мотивација за екстракурикуларни активности
со надарени ученици
	3. Техника на бура на идеи за развивање алгоритми
	4. Основи на структури на податоци и соодветни алгоритми за задачи за  Натпревари: (листи, дрва, графови);
