	4. Задачи со листи, дрва, графови прилагодено за ученици од средни училишта
	5. Задачи со  алчни алгоритми,  раздели па владеј, динамичко програмирање прилагодено за ученици од средни училишта
	6. Задачи за натпревари  - лавиринти
	7. Задачи за натпревари  - оптимизација
