', 'Lectures:
1. Techniques for recognizing gifted students
2. Techniques for developing motivation for extracurricular activities
with gifted students
3. Brainstorming technique for developing algorithms
4. Basics of data structures and appropriate algorithms for tasks for Competitions: (lists, trees, graphs);
5. Recursion, greedy algorithms, divide and conquer, dynamic programming
6. Types of tasks for competitions - mazes
7. Types of tasks for competitions - optimization
8. Types of tasks for competitions - logical games
9. Rules and regulations for participation in International Olympiads.
10. Development of tasks from competitions
11. Introduction

Exercises:
1. Techniques for recognizing gifted students
2. Techniques for developing motivation for extracurricular activities
with gifted students
3. Brainstorming technique for developing algorithms
4. Tasks with lists, trees, graphs adapted for high school students
5. Tasks with Greedy Algorithms, Divide and Conquer, Dynamic Programming Tailored for High School Students
6. Tasks for competitions - mazes
7. Tasks for competitions - optimization
8. Tasks for competitions - logical games
9. Rules and regulations for participation in International Olympiads.
10. Development of tasks from competitions
11. Gifted students in the world',
        'Студентите се оспособуваат да станат професори кои успешно ќе идентификуваат ученици кои имаат потенцијал да го прошират знаењето од областа на информатиката и решавање задачи од алгоритамска природа, со употреба на напредни структури и алгоритми коишто не се опфатени со редовната програма. Идните наставници се оспособуваат да пренесат основно знаење за напредната програма на учениците и да ги насочат во процесот на учество на национални и интернационални натпревари по информатика.',
        'Students are trained to become professors who will successfully identify students who have the potential to expand knowledge in the field of informatics and solving tasks of an algorithmic nature, using advanced structures and algorithms that are not covered by the regular program. Future teachers are trained to convey basic knowledge about the advanced program to students and guide them in the process of participating in national and international competitions in informatics.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури',
        'Реализирани актибвности 15.2 и 16.1', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
