values ('F23L3S062', '469', 'Virtualization', '600', '6', '1', '2023', 'Македонски и англиски',
        'Концепти на виртуелизација. Типови на хипервизори. Теорија на виртуелизација, придобивки во сервер околина, виртуелизација на апликации. Виртуелни машини. Типови на CPU виртуелизација. Виртуелизација на физички машини. Процесор и меморија во виртуелна средина. Паравиртуелизација. Xen. Нови архитектури за виртуелизација. Виртуелизација на уреди за складирање на податоци. Динамичко и статичко складирање. Клонирање и копирање. Редундантност, заштитна копија, клонирање и templates. Snapshot и checkpoint. Управување со уреди во виртуелна околина. Споделување на ресурси. Виртуелизација на мрежниот дел. ористење на виртуелизација. Безбедност во виртуелна средина. Консолидација на сервери. Миграција на виртуелни машини.',
        'Concepts of virtualization. Types of hypervisors. Virtualization theory, benefits in a server environment, application virtualization. Virtual machines. Types of CPU virtualization. Virtualization of physical machines. Processor and memory in a virtual environment. Paravirtualization. Xen. New Virtualization Architectures. Virtualization of data storage devices. Dynamic and static storage. Cloning and copying. Redundancy, backup, cloning and templates. Snapshot and checkpoint. Device management in a virtual environment. Resource sharing. Virtualization of the network part. orization of virtualization. Security in a virtual environment. Consolidation of servers. Migration of virtual machines.',
        'Запознавање со виртуелизацијата како парадигма на креирање на виртуелни компјутерски системи преку софтверска виртуелизација на харверските компоненти. Обработка на различните аспекти на виртуелизацијата, технологиите и техниките вклучени во процесот, како и придобивките и губитоците кои се појавуваат во процесот на виртуелизација.',
        'Familiarity with virtualization as a paradigm of creating virtual computer systems through software virtualization of hardware components. Covering the various aspects of virtualization, the technologies and techniques involved in the process, and the benefits and pitfalls that occur in the virtualization process.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети', 'Оперативни системи',
        'Реализирани актибвности 15.2 и 16.1', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
