values ('F23L3S063', '470', 'Computer network design', '600', '8', '1', '2023', 'Македонски и англиски',
        '(1) Воведување на QoS. Потреби. Конвергирани мрежи. Типови на доцнење. QoS барања за различен тип на сообраќај. QoS полиси. (1) Градбени блокови на QoS. Интегрирани и диференцирани сервиси. PHB. QoS механизми. (1) Kласификација и означување. Управување со задушување. Избегнување на задушување. (1) Полиси и обликување на сообраќај. Ефикасност на линк. (1) Автономни системи и упатување. RIP, EIGRP, OSPF. (1) Поврзување на автономни системи. BGP. (1) Mетодологии за дизајн на мрежи. Мрежна архитектура на бизнис мрежа. Структуриран дизајн на мрежа. Животен циклус на системски развој. (1) Чекори при мрежен дизајн. Цели и опфат на проектот. Контакт со клиентот. (1) Tехнички цели. Скалабилност. Достапност. Перформанси. Безбедност. Управливост. Корисност.  (1) Kарактеризација на постојна мрежа и сообраќај. Алатки за работа. Фактори кај мрежниот сообраќај. (1) Структурирање и модуларизација на мрежата. Дизајн на кампус мрежи и мрежи во податочни центри. Редундантност. Дизајн на јадро. Виртуелизирана мрежна околина. (1) Mултикаст сообраќај и протоколи. (1) SLA. Креирање и одржување на SLA.',
        '(1) Introduction of QoS. Needs. Converged networks. Types of delay. QoS requirements for different types of traffic. QoS policies. (1) Building blocks of QoS. Integrated and differentiated services. PHB. QoS mechanisms. (1) Classification and marking. Choking Management. Avoiding suffocation. (1) Traffic policies and shaping. Link efficiency. (1) Autonomous systems and referral. RIP, EIGRP, OSPF. (1) Connection of autonomous systems. BGP. (1) Network design methodologies. Network architecture of a business network. Structured Network Design. System development life cycle. (1) Steps in network design. Objectives and scope of the project. Contact with the client. (1) Technical goals. Scalability. Availability. Performance. Security. Manageability. Usefulness. (1) Characterization of existing network and traffic. Tools for work. Factors in network traffic. (1) Network structuring and modularization. Design of campus networks and networks in data centers. Redundancy. Core design. Virtualized network environment. (1) Multicast traffic and protocols. (1) SLA. Creating and maintaining SLAs.',
        'Целта на овој курсот е да го оспособи студентот да работи со големи компјутерски мрежи и да обезбеди колаборативна работа на различни административни региони, како и да дизајнира различни типови компјутерски мрежи според потребите на крајните корисници.',
        'The aim of this course is to enable the student to work with large computer networks and to ensure collaborative work of different administrative regions, as well as to design different types of computer networks according to the needs of end users.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети',
