values ('F23L3S069', '139', 'Adaptive and Interactive Web Information Systems', '600', '8', '1', '2023',
        'македонски и англиски', 'Податоците за употребата на системите, интересите на корисниците и нивните интеракции со системот и меѓусебни интеракции се основата за подобрување на пристапот до информациите кои ги чува  и презентира еден информациски систем. Поради тоа, содржините на предметот се организирани да ги опфатат трите основни методи за доаѓање до потребните информации и методите за презентација на информациите кои се поврзани со овие основи - хипермедија, пронаоѓање информации, системи за препорачување.

За секој тип на системи за овозможување и подобрување пристап до информации преку социјална навигација и интеракција, препорачувања, водење во донесување одлуки и презентација на информациите, предметот ќе тргне од три главни типа на погонувачи за подобрен пристап до информациите и препорачување - метаподатоци, клучни зборови и социјални, и темите на предавања ги опфаќаат различните техники и методи на прилагодување на системите од секој од овие три аспекти.

Вежбите на предметот се организирани така што го следат животниот циклус на развој на сопствено прототип решение за адаптивен и интерактивен веб информациски систем (АИИС), од идејно решение, дизајн на архитектура, дизајн на податочен модел и дизајн социјална навигација и интеракција, персонализација и адаптација, до презентирање на финален прототип на решение за интерактивна и адаптивна рамка за навигација и пристап до информации во системот.

На крај како финален испит на предметот се предвидува јавна презентација на проектите пред сите студенти на предметот, во кој сите студенти ќе се вклучат во анализа и критика на развиените решенија од нивните врсници.', 'The data on the use of the systems, the interests of the users and their interactions with the system and mutual interactions are the basis for improving the access to the information stored and presented by an information system. Therefore, the contents of the subject are organized to cover the three basic methods for reaching the necessary information and the methods for presenting the information related to these bases - hypermedia, information retrieval, recommender systems.

For each type of system for enabling and improving access to information through social navigation and interaction, recommendations, decision-making guidance and information presentation, the course will start from three main types of drivers for improved information access and recommendation - metadata, keywords and social, and lecture topics cover the various techniques and methods of adapting systems from each of these three aspects.

The course exercises are organized to follow the life cycle of developing a custom prototype solution for an adaptive and interactive web information system (AIIS), from conceptual solution, architecture design, data model design and social navigation and interaction design, personalization and adaptation , to presenting a final prototype solution for an interactive and adaptive framework for navigation and access to information in the system.

Finally, as a final exam of the subject, a public presentation of the projects is foreseen before all students of the subject, in which all students will be involved in the analysis and criticism of the developed solutions by their peers.', 'Индустријата за персонализација и адаптација на веб е во пораст. Компаниите, институциите, универзитетите, и истражувачките лаборатории имаат потреба од бројни експерти кои ги познаваат и разбираат како функционираат адаптивните интерактивни системи, персонализацијата и социјалната навигација и интеракција за да водат развој на сопствени решенија или да нарачуваат готови решенија.

Од овие причини курсот има за почетна цел да ги запознае студентите со светот на адаптивните и интерактивни веб информациски системи (АИИС). Потоа студентите ќе се стекнат знаења за различните аспекти на адаптација, персонализација, социјална навигација и интеракција во АИИС, и ќе се запознаат со во моментот најактуелните адаптивни веб технологии како готови решенија или како истражувачки демонстративни решенија кои се користат во пракса. Студентите ќе разгледуваат многу примери на модерни АИИС развиени од водечките Интернет компании како Google, Yahoo, IBM, Microsoft, Ebay, Facebook, Twitter, како и повеќе лидери на специјализирани индустрии како Netflix, Booking.com, Spotify, Hulu, Zalando.

Главна финална компетенција во овој предмет со која ќе се здобијат студентите е да го применат стекнатото знаење во реалниот свет преку анализа на потребите и исполнување на истите со постојните АИИС, критика на постојни АИИС и главните елементи од животен циклус за развој на сопствени решенија за АИИС, базирани на постојни техники и со користење на иновативни технологии за социјална интеракција и навигација, адаптација и персонализација.', 'The web personalization and adaptation industry is on the rise. Companies, institutions, universities, and research laboratories need numerous experts who know and understand how adaptive interactive systems, personalization and social navigation and interaction work to lead the development of their own solutions or to order ready-made solutions.

For these reasons, the course initially aims to introduce students to the world of adaptive and interactive web information systems (AIIS). Then the students will gain knowledge about the different aspects of adaptation, personalization, social navigation and interaction in AIIS, and they will get to know the most current adaptive web technologies at the moment as ready-made solutions or as research demonstration solutions used in practice. Students will look at many examples of modern AIIS developed by leading Internet companies such as Google, Yahoo, IBM, Microsoft, Ebay, Facebook, Twitter, as well as several leaders of specialized industries such as Netflix, Booking.com, Spotify, Hulu, Zalando.

The main final competence in this course that the students will acquire is to apply the acquired knowledge in the real world by analyzing the needs and fulfilling them with existing AIIS, criticism of existing AIIS and the main life cycle elements for developing own solutions for AIIS , based on existing techniques and using innovative technologies for social interaction and navigation, adaptation and personalization.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна или тимска изработка и одбрана на проектна задача, анализа и критика на решенија од врсници.',
        'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури',
        'освоени 50% од предвидените поени на индивидуалните задачи', '30', '45', '10', '60', '35', '180', null, '60',
        '10', '20');
