values ('F23L3S070', '498', 'Macedonian language', '600', '8', '1', '2023', 'Македонски и англиски', 'Теоретски основи на културата на говорот. Теоретски основи на културата на говорот (зборувањето). Културата на говорот во служба на комуникативното совршенство. Употребата на јазичната структура на македонскиот јазик во хуманитарните и природните науки. Јазикот како систем на знаци во меѓучовечката комуникација. Говорот како сукцесивна распределба и организација на јазичните знаци. Говорната дејност како целокупност на психо-физичките процеси на говорната реализација. Поимот текст: усна и писмена реализација на текстот. Содржината на текстот. Структура на говорот. Односот говор - јазик, Осносот говор мислење, Односот говор - реалност.  Односот говор - приемач (адресат). Односот говорни - неговорни структури. Правилност на говорот. Фонетски норми. Акцентски норми. Граматички норми.   Поимот стандарден јазик. Односот стандарден јазик - дијалектен јазик.
(1)Особини на успешниот говор. Точност на говорот. Логичност на говорот. Чистота на говорот. Изразност на говорот. Богатство на говорот. Умесност на говорот.
(1) Композиција на излагањето. Јазичните стилови и културата на говорот.
(1) Стилот и неговите видови. Стилските фигури и тропи. Комуникативната особина на говорот и јазичните стилови.
(1)Посебно за стиловите на јазикот: уметничкиот, научниот, деловниот, публицис- тичкиот, административниот, разговорниот. Културата на говорот во практична функција.
(1)Културата на говорот во научното општење. Културата на говорот во педагошката практика. Културата на говорот во јавниот настап. Културата на говорот и другите науки: психологијата, логиката, етиката, теоријата на комуникацијата и др. Психофизичките и моралните особини на говорникот. (1)Психологија на говорникот. Психологија на аудиториумот.', 'Theoretical foundations of speech culture. Theoretical foundations of speech culture. The culture of speech in the service of communicative perfection. The use of the language structure of the Macedonian language in humanities and natural sciences. Language as a sign system in interpersonal communication. Speech as a successive distribution and organization of language signs. Speech activity as a whole of psycho-physical processes of speech realization. The concept of text: oral and written realization of the text. The content of the text. Speech structure. The relationship between speech and language, the relationship between speech and opinion, and the relationship between speech and reality. The speech - receiver (addressee) relationship. The relationship between speech and non-speech structures. Correctness of speech. Phonetic norms. Accent norms. Grammatical norms. The term standard language. The relation standard language - dialect language.
(1) Characteristics of a successful speech. Accuracy of speech. Logic of speech. Purity of speech. Expressiveness of speech. Wealth of speech. Speaking skill.
(1) Composition of the exposition. Language styles and speech culture.
(1) Style and its types. The stylistic figures and tropes. The communicative feature of speech and language styles.
(1) Especially for language styles: artistic, scientific, business, journalistic, administrative, conversational. Speech culture in practical function.
(1) The culture of speech in scientific society. The culture of speech in pedagogical practice. The culture of speech in public performance. The culture of speech and other sciences: psychology, logic, ethics, theory of communication, etc. Psychophysical and moral qualities of the speaker. (1) Psychology of the speaker. Psychology of the auditorium.',
        'Стекнување на знаења и компетенции за Македонскиот јазик.',
        'Acquisition of knowledge and competences for the Macedonian language.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети', null, 'Реализирани актибвности 15.2 и 16.1',
        '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
