        'Агентно-базираното моделирање нуди природна метафора за разбирање и објаснување на многу феномени од доменот на биолошки и социјални системи – од еволуција и ширење на епидемии до сегрегација и формирање на коалиции. Многу системи може да се моделираат како средини составени од автономни агенти кои може да комуницираат, соработуваат, преговараат, да се спротивставуваат, да се водат од сопствени интереси или делуваат алтруистички. Микро-однесувањето на агенти водени од едноставни правила може да предизвика нови квалитети и комплексни појави во макро размери. Целта на предметот е запознавање на студентот со агентската парадигма за репрезентација и моделирање на системи од различни домени (пр. игри, роботи, однесување на социјални групи). По завршување на курсот се очекува студентот да има способност да дизајнира, моделира и реализира или симулира едно-агентен или повеќе-агентен систем.',
        'Agent-based modeling offers a natural metaphor for understanding and explaining many phenomena in the domains of biological and social systems – from the evolution and spread of epidemics to segregation and coalition formation. Many systems can be modeled as environments composed of autonomous agents that may communicate, cooperate, negotiate, oppose, be self-interested, or act altruistically. The micro-behavior of agents guided by simple rules can give rise to new qualities and complex phenomena on a macro scale. The aim of the course is to acquaint the student with the agent paradigm for the representation and modeling of systems from different domains (eg games, robots, behavior of social groups). After completing the course, the student is expected to have the ability to design, model and implement or simulate a single-agent or multi-agent system.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
