values ('F23L3W085', '555', 'Introduction to bioinformatics', '600', '7', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Основи на молекуларна биологија
	2. ДНА репликација и Централна догма
	3. Главни актери и процеси
	4. Генетски датотеки
	5. Контрола на генска експресија
	6. Метафори за разбирање на генетските процеси
	7. Вируси
	8. Еволуција на геномот
	9. Вештачки хромозоми
	10. Микробиом
	11. Порамнување секвенции
	12. Мотиви
	13. Посета на молекуларната лабораторија на ПМФ

Вежби:
	1. Биолошки бази на податоци и центри
	2. Формати на репрезентација и примена
	3. Аминокиселини
	4. Предвидување секундарна структура
	5. Регулација на генска експресија
	6. ДНА Микрополиња и онтологија на гени
	7. SARS-CoV-2
	8. Рекомбинација на гени
	9. Молекуларен докинг
	10. Анализа на податоци од микробиом
	11. Методи за порамнување секвенции
	12. Методи за пронаоѓање мотиви
	13. Посета на молекуларната лабораторија на ПМФ
',
        'What is Bioinformatics? A central paradigm in bioinformatics. DNA sequence analysis. RNA and protein secondary structure prediction. Tertiary protein structures and their relation to protein function. An introduction to computational tools and algorithms for solving problems in molecular biology. Concepts of gene expression and microarray technology. Concept of systems biology. Management structures in bioinformatics. DNA programming. Using genomic and protein databases. Introduction to Genetic Engineering.', 'Студентите да се запознаат со областите и проблемите кои ги покрива биоинформатиката, да
бидат во можност да вршат генска и протеинска секвенцна анализа, да користат биолошки бази
податоци, да ги запознаат пресметковните методи за решавање проблеми во молекуларната
биологија.',
        'Students to become familiar with the areas and problems covered by bioinformatics, to be able to perform gene and protein sequence analysis, to use biological databases, to learn computational methods for solving problems in molecular biology.',
        'предавања, проекти, дискусии, работилници', '/',
        'Вештачка интелигенција или Машинско учење или Вовед во науката за податоци', 'Реализирани активности 15, 16',
        '30', '45', '15', '15', '75', '180', '0', '15', '60', '10');
