values ('F23L3S086', '657', 'Introduction to cognitive sciences', '600', '8', '1', '2023', 'македонски', 'Што е когнитивна наука. Еволуција на умот. Визуелна репрезентација на невроните во
човечкиот мозок. Перцепцијата, визуелна когниција, мислење, меморија, фантазија,
внимание, емоции, лингвистика, интелигенција, донесување одлуки, решавање
проблеми. Учење, учечки агенти, таксономии на учење. Неврофизиологија и
оштетување на мозокот. Минато, сегашност и иднина на когнитивната наука.', 'What is cognitive science. Evolution of the mind. Visual representation of neurons in the
the human brain. Perception, visual cognition, opinion, memory, imagination,
attention, emotions, linguistics, intelligence, decision making, solving
problems. Learning, learning agents, taxonomies of learning. Neurophysiology and
brain damage. Past, present, and future of cognitive science.',
        'Целта е да се разбере како работи човечкиот мозок. Студентите ќе се запознаат со теоретските и емпириските погледи кои ја дефинираат когнитивната наука. Ќе се запознаат со истражувањата за природата на менталните процеси како перцепцијата, мислењето, меморијата, фантазијата, вниманието, јазикот, интелигенцијата, донесувањето одлуки и решавањето проблеми. Студентите ќе научат кои се алатките превземени од експерименталната психологија, наука на развојот, комјутерската наука, лингвистика, визуализацијата, филозофијата, антропологијата, бихевиоризмот, неврологијата. Курсот ќе ги поврзе сите овие пристапи кои се поврзуваат во когнитивната наука.',
        'The goal is to understand how the human brain works. Students will be introduced to the theoretical and empirical perspectives that define cognitive science. They will be introduced to research into the nature of mental processes such as perception, thought, memory, imagination, attention, language, intelligence, decision making and problem solving. Students will learn tools drawn from experimental psychology, developmental science, computer science, linguistics, visualization, philosophy, anthropology, behaviorism, neuroscience. The course will connect all these approaches that are connected in cognitive science.',
        'предавања, проекти, дискусии, работилници', '/', 'Освоени најмалку 120 ЕКТС', 'Реализирани активности 15, 16',
        '30', '45', '15', '15', '75', '180', '0', '15', '50', '15');

