values ('F23L3S087', '577', 'Introduction to network science', '600', '6', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед во мрежна наука и разгледување на пример социјални, информациски мрежи, биолошки,  и техничко-технолошки мрежи. Својства на реални комплексни мрежи: ефект на мал свет, транзитивност на јазли, поврзување со преференца.
	2. Модели на реални мрежи: Ердош-Рени, Барабаши-Алберт, Ватс-Строгац.
	3. Мерки за централност и алгоритми за рангирање. Робустност на комплексни мрежи.
	4. Мрежни структурни својства. Мерки за сличност на јазли и цели графови. Асортативност и дисортативност. Парадокси во социјални мрежи.
	5. Откривање на заедници и графлети во комплексни мрежи
	6. Динамички процеси во комплексни мрежи: ширење на влијанија, информации и зарази, консензус, синхронизација
	7. Машинско учење во графови. Класификација на јазли и предвидување на линкови.
	8. Репрезентација и емедирање на јазли и графови.
	9. Основни концепти на граф невронски мрежи. Граф конволуциски мрежи (GCN).
	10. Генерална архитектура на граф невронски мрежи. GCN, GraphSAGE, GAT (Graph Attention Networks)
	11. Примена на граф невронски мрежи. Проширување на графови. Предвидување со граф невронски мрежи. Тренирање на граф невронски мрежи.
	12. Хетерогени графови. Повеќеслојни графови. Графови на знаење.

Вежби:
	1. Тополошка анализа и визелузација на реални мрежи. Користење на алатки за анализа и визуелизација на својствата со масивни податоци од реални мрежи.
	2. Генерирање на мрежи според модели, споредба на својствата на реалните мрежи со генерираните мрежи
	3. Употреба на метрики и алгоритми за рангирање на врски и јазли (степен, споивост, блискост, pagerank, hits, богат-клуб) . Одредување на глобална робустност на пример реални мрежи.
	4. Испитување на структурни својства во реални мрежи. Проверка на асортативност и дисортативност. Откривање на парадокси во податоци од онлајн социјални мрежи
	5. Споредба и имплементирање на различни алгоритми за откривање на заедници и графлети со користење на податоци од реални мрежи.
	6. Моделирање и симулација на динамички процеси во комплексни мрежи. Откривање на нови модели базирани на податоци од реални мрежи
	7. Машинско учење во графови. Класификација на јазли и предвидување на линкови.
	8. Репрезентација и емедирање на јазли и графови.
	9. Основни концепти на граф невронски мрежи. Граф конволуциски мрежи (GCN).
	10. Генерална архитектура на граф невронски мрежи. GCN, GraphSAGE, GAT (Graph Attention Networks)
	11. Примена на граф невронски мрежи. Проширување на графови. Предвидување со граф невронски мрежи. Тренирање на граф невронски мрежи.
	12. Хетерогени графови. Повеќеслојни графови. Графови на знаење.
',
        'Introduction to Network Science. Properties in complex and real-data networks: small-world phenomenon, node transitivity, preferential attachment. Real-data network models. Social, information, biological and technological networks. Community detection and graphlets in complex networks. Node and edge analysis of network robustness. Centrality measures and ranking algorithms. Social network paradoxes: status homophily, value homophily, social influence, external influence. Dynamical processes in complex networks: influence spreading, information and virus spreading, consensus and synchronization. Game theory in social networks: monetization in social networks, social network formation, bidding and target set selection. Multilayer and temporal complex networks: models, algorithms and dynamical processes. Flow optimization, resource distribution, packing and routing in real networks.  Data mining and prediction in massive complex networks. Link and topology prediction. Prediction of the dynamical processes` outcome and traversing of complex networks..',
        'Запознавање со основните концепти од мрежна наука и нивна примена на реални податоци. Оспособување на студентите за анализа на својствата и динамичките процеси во реалните комплексни мрежи и нивно моделирање и визуелизација. Изучување на основните методи за октривање на заедници, оценка на робустноста, оптимизација, податочно рударење и предвидување во комплексни мрежи.',
        'Students will be introduced to concepts in Network Science on real data. At the end of the course the student would be able to analyze different properties and dynamical processes in real complex networks, and they would be able to model and visualize networks and dynamical processes on networks. Students throughout the course will learn the basic methods for community detection, robustness evaluation, network optimization, data mining and prediction in networks.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети',
        'Веројатност и статистика или Основи на теорија на информации или Математика 3 или Бизнис статистика',
        'Реализирани активности 15.1 и 15.2', '30', '45', '15', '15', '75', '180', '10', '15', '50', '10');
