values ('F23L3S093', '566', 'Digital forensics', '600', '6', '1', '2023', 'македонски и англиски', '(1) Основи на дигиталната форензика, анализа и менаџирање на ситуацијата по извршен напад
    (1) Форензика на податочен систем, план за форензика и технологии кај Linux и Android
