	8. Метаподатоци (продолжение)
	9. Интероперабилност: Протокол и сервиси
	10. Интернационализација: Глобален предизвик File
	11. Електронски книги
	12. Идни трендови на развој', 'Lectures:
1. Introduction to Digital Libraries File
2. Metadata
3. Work with text documents
4. Work with multimedia
