6. People in digital libraries
7. User Interfaces
8. Metadata (continued)
9. Interoperability: Protocol and services
10. Internationalization: Global Challenge File
11. Electronic books
12. Future development trends',
        'Запознавање на студенти со актуелните елементи од областа дигитални библиотеки (ДБ): основи и архитектури на дигитални библиотеки, технологии, управување, организација и развој на дигитални ресурси, презентација на знаење и негово откривање (прибирање на информации), мета-податоци, шеми и стандарди и релевантни интелектуални права. Во зависноста од тековниот интерес студентите ќе се запознаат со конкретен апликативен софтвер за дигитална библиотека и со практики во работењето како и евалуација на истите. По завршување на курсот се очекува студентот да демонстрира знаење за основни елементи на ДБ, технологии за развој и изградба на ДБ, начини на примена, управување и организација на ДБ',
        'Acquaintance of students with the current elements of the field of digital libraries (DB): basics and architectures of digital libraries, technologies, management, organization and development of digital resources, presentation of knowledge and its discovery (collection of information), meta-data, schemes and standards and relevant intellectual rights. Depending on the current interest, the students will get acquainted with specific application software for digital library and with practices in operation as well as their evaluation. After completing the course, the student is expected to demonstrate knowledge of basic elements of DB, technologies for development and construction of DB, methods of application, management and organization of DB',
        ' предавања, аудиториски вежби, лабораториски вежби, проектни задачи, домашни задачи',
