values ('F23L3S101', '525', 'Ethical hacking', '600', '8', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед во предметот
	2. Етика, поими од безбедност, вовед во етичко хакирање
	3. Фази на етичко хакирање - Извидница и скенирање
	4. Фази на етичко хакирање - Добивање на пристап
	5. Фази на етичко хакирање - Одржување на пристапот
	6. Фази на етичко хакирање - Прикривање траги и Известување
	7. Киднапирање  сесија
	8. Хакирање на веб апликации и сервери
	9. Хакирање со социјален инженеринг.
	10. Преполнување на бафери
	11. SQL Injection
	12. Пен тестирање и заштита на системи од напади

Вежби:
	1. Вовед за вежбите
	2. Вовед и воспоставување на работната околина
	3. Напади за пресретнување мрежен сообраќај
	4. Алатки за извидништво и скенирање
	5. Експлоатација со Metasploit
	6. Движење низ мрежата
	7. Post Explotation, Тројанци, одржување на пристапот, криење на сообраќајот (ICMP, DNS tunneling)
	8. Веб напади 1
	9. Веб напади 2
	10. Social Engineering
	11. Пробивање лозинки
	12. Практични проекти
', 'Lectures:
1. Introduction to the subject
2. Ethics, security concepts, introduction to ethical hacking
3. Stages of Ethical Hacking - Scouting and Scanning
4. Stages of Ethical Hacking - Gaining Access
5. Stages of Ethical Hacking - Maintaining Access
6. Stages of Ethical Hacking - Covering Your Tracks and Reporting
7. Session hijacking
8. Hacking web applications and servers
9. Hacking with social engineering.
10. Buffer overflow
11. SQL Injection
12. Pen testing and protection of systems from attacks

Exercises:
1. Introduction to the exercises
2. Introduction and establishment of the working environment
3. Attacks to intercept network traffic
4. Scouting and scanning tools
5. Exploitation with Metasploit
6. Movement through the network
7. Post Exploitation, Trojans, access maintenance, traffic hiding (ICMP, DNS tunneling)
8. Web attacks 1
9. Web attacks 2
10. Social Engineering
11. Cracking passwords
12. Practical projects',
        'Студентот ќе ги запознае основните концепти, техники и алатки кои се користат во полето на безбедност на системи. Со преземање на улогата на "напаѓач" студентот ќе се стекне со знаење за повеќето сигурносни слабости во неговата околина и начин како да се заштити од нив.',
        'The student will learn the basic concepts, techniques and tools used in the field of systems security. By assuming the role of "attacker" the student will gain knowledge about most of the security weaknesses in his environment and how to protect against them.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'Компјутерски мрежи или компјутерски мрежи и безбедност',
        'реализирани лабораториски вежби', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
