values ('F23L3S102', '607', 'ICT for development', '600', '8', '1', '2023', 'Македонски и англиски', 'Улогата на технолошките иновации а особено ИКТ во развојот на човекот и на општеството.
Одржлив развој. Цели на Обединети Нации за развој кои треба да го трансформираат светот во подобро место на живеење.
Совесен капитализам. Enviromental, Social и Governance (ESG) принципи за развој и инвестирање.
Социјални иновации и социјално претприемништво
Разгледување на нови ИКТ технологии ((Вештачка интелигенција, Машинско учење, Мобилни уреди, Социјални медиуми) и нивна примена во заштита на околината, грижа за луѓето, подобрување на условите за работа и владеењето.
Дизајн центриран кон човекот. Методологија на размислување за дизајн: (1)Емпатија (2) Дефинирање (3)Генерирање идеи (4)Изградба на прототип (5)Тестирање (6)Имплементација', 'The role of technological innovations and especially ICT in the development of man and society.
Sustainable development. United Nations Development Goals to transform the world into a better place to live.
Conscientious capitalism. Environmental, Social and Governance (ESG) principles for development and investment.
Social innovation and social entrepreneurship
Consideration of new ICT technologies ((Artificial Intelligence, Machine Learning, Mobile Devices, Social Media) and their application in protecting the environment, caring for people, improving working conditions and governance.
Human-centered design. Design Thinking Methodology: (1)Empathy (2)Defining (3)Idea Generation (4)Prototyping (5)Testing (6)Implementation',
        'Целта на курсот е да ги разгледа основите принципи и најдобри практики за користењето на технологијата за развој на човештвото. Да се разбере концептот на одржлив развој кој ги го вклучува влијанието врз природата, луѓето, општеството и управувањето. Разбирање на можностите за примена на нови ИКТ технологии за општо добро.',
        'The purpose of the course is to review the basic principles and best practices for using technology for human development. To understand the concept of sustainable development which includes impact on nature, people, society and governance. Understanding the possibilities of applying new ICT technologies for the common good.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети', 'Бизнис и менаџмент',
        'Реализирани актибвности 15.2 и 16.1', '30', '45', '15', '15', '75', '180', '0', '15', '60', '10');
