values ('F23L3S106', '591', 'Deep learning for knowledge discovery', '600', '8', '1', '2023', 'македонски и англиски', '1. Вовед во темите кои ги обработува предметот. Напредни методи на машинско учење и области на нивна примена.
	2. Граф-структурирани податоци. Анализа на статитичките и динамички својства на графови.
