	10. Мултимодална фузија
	11. Длабоки невронски мрежи за мултимодална фузија со области на примена
	12. Студии на случај на примена на ѕчење со поттикнување, граф-невронски мрежи и генеративни спротивстваени мрежи', '1. Introduction to the topics covered by the subject. Advanced methods of machine learning and areas of their application.
2. Graph-structured data. Analysis of static and dynamic properties of graphs.
3. Application of graph neural networks to graph analysis
4. Representation of nodes and links in graphs
5. Extracting knowledge from social networks: Predicting relationships. Classification and annotation of nodes.
