9. Application of GAN in machine vision and natural language processing
10. Multimodal fusion
11. Deep neural networks for multimodal fusion with application areas
12. Case studies of the application of boosted learning, graph neural networks and generative adversarial networks',
        'По завршување на предметот, студентот ќе биде оспособен за  избор на соодветни техники за откривање и извлекување на знаење од различен вид податоци. Студентот ќе поседува познавања за напредни архитектури за длабоко учење со примена во системи за препораки, анализа на граф-структурирани податоци и мултимодална фузија на податоци.',
        'After completing the course, the student will be able to choose appropriate techniques for discovering and extracting knowledge from different types of data. The student will possess knowledge of advanced deep learning architectures with applications in recommendation systems, graph-structured data analysis, and multimodal data fusion.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
