values ('F23L3S107', '565', 'Intelligent Systems', '600', '8', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Вовед во проблематиката на предметот
	2. Преглед на домените во кои се користат современи Интелигентни системи (медицина, процесирање јазици, роботика)
	3. Современи техники за претпроцесирање податоци - инженерство на податоци (Data Engineering): избор на податоци, чистење податоци, инженерство на атрибути (feature engineering)
	4. Современи техники од машинско учење и длабоко учење за градење модели на ИС; Трансферирано учење;
	5. Современи методи за евалуација на модели на ИС (класификација и регресија);
	6. Дискриминантни наспроти генеративни методи за градење ИС;
	7. Интерпретација на изградени модели - Shapley вредност (SHAP);
	8. Како да се избегуиваат скриените проблеми и опасности при градењето Интелигентни системи.
	9. Обработка на реален проблем – методи за најдобар избор на техники за претпроцесирање
	10. Обработка на реален проблем -  изградба на модел, евалуација
	11. Интерпретација на изградените модели
	12. Автоматизација на процесот на градење интелигентен систем - животен циклус крај-до-крај

Вежби:
	1. Вовед во Интелигентни системи
	2. Преглед на домените во кои се користат современи Интелигентни системи - примери
	3. Современи техники за претпроцесирање податоци - примери во Python
	4. Современи техники од машинско учење и длабоко учење за градење модели на ИС - примери во Python
	5. Современи методин за евалуација на модели на ИС (класификација и регресија) - примери во Python
	6. Дискриминантни наспроти генеративни методи за градење ИС - примери во Python
	7. SHAP во Python, Weighted SHAР, SHAP со GPU
	8. Како да се избегнуваат скриените проблеми и опасности при градењето Интелигентни системи.
	9. Претппроцесирање биосигнали со алатки во Python со податочни множества од пациенти
	10. Градење модели за предвидување со алатки во Python
	11. Интерпретација на изградените модели
	12. Алатки за автоматизација на градење ИС (open source платформа - MLflow)
',
        'Overview of the domains in which modern Intelligent Systems are used; Modern techniques for data preprocessing; Modern techniques from machine learning and deep learning for building IS models; Evaluation of IS models (classification and regression); Discriminative versus generative methods for building IS; Fast Fourier transform, time and space domain; Transferred learning; Interpretation of built models - Shapley value Processing of a real problem – methods for the best selection of techniques for preprocessing, model construction, evaluation and interpretation of built IS; Processing a real problem – designing an IS for a chosen domain and its evaluation and interpretation.',
        'Целта на предметот е да го заокружи знаењето на студентите од областа на интелигентните системи, почнувајќи од претпроцесирањена податоците до валидирање на изградениот систем. Студентите ќе се оспособат да изградат интелигентен систем од почеток до крај на реални проблеми од специфичен домен, користејќи алатки за автоматизација на процесот на градење ИС.',
        'The aim of the course is to complete the students` knowledge in the field of intelligent systems, starting from data preprocessing to validating the built system. Students will be able to build an intelligent system from start to finish on real problems from a specific domain, using platforms for automatization of the building IS processes.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети',
        'Вештачка интелигенција или Вовед во науката за податоци или Машинско учење',
        'Реализирани актибвности 15.2 и 16.1', '30', '45', '15', '15', '75', '180', '0', '15', '20', '10');
