3. Documenting IT assets (hardware, software, services)
4. Protection from outages and disasters, ensuring continuity of services
5. Change management
6. Tools for automated configuration management
7. Programming procedures for automated installation of systems
8. Programming procedures for automated configuration of systems', 'Студентот ќе се здобие со знаење за лесно и ефикасно менаџирање на IT системи, управување со традиционалните
податочни центри, приватни и јавни облаци и клиентските компјутери и уреди. Студентот ќе може да се запознае и со
платформи за менаџирање на повеќе хипервизори, физички ресурси и апликации.', 'The student will acquire knowledge about easy and efficient management of IT systems, management of traditional ones
data centers, private and public clouds, and client computers and devices. The student will be able to get acquainted with
platforms for managing multiple hypervisors, physical resources and applications.', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски
