        'Студентите треба да го разбрерат развојот и спектарот на програмските јазици, и да го сфатат процесот на конструкција на компајлер што ќе ги надгради како програмери кои навлегле во суштината на програмските јазици.',
        'Students should understand the development and spectrum of programming languages, and understand the process of building a compiler that will upgrade them as programmers who have penetrated the core of programming languages.',
