values ('F23L3S115', '594', 'Computer sounds, music and speech', '600', '6', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Вовед. Општи информации за звук и дигитален звук.
	2. Опрема и софтвери за снимање и обработка на звук.
