	4. PureData - Различни контролни механизми во Pure Data.
	5. PureData - Семплирање
	6. SuperCollider - Вовед и основни елементи за синтеза и обработка на звук
	7. SuperCollider - групи и модуларност, филтрирање по групи, семплови, таскови, секвенци
	8. WebAudio
	9. Вовед  во  тонална  музичка  теорија. Симболички претстави на музика (MIDI, MusicXML)
	10. Компоненти  на  човечкиот  говор. Системи  за говор  и  математички  модели. Анализа  и  синтеза  на  говор
	11. Компјутерски генерирана музика
	12. Иновации, нови трендови и истражувањаВ во генерирање звук, музика и говор', 'Lectures:
1. Introduction. General information about sound and digital sound.
2. Sound recording and processing equipment and software.
3. PureData - Introduction and fundamentals of sound synthesis and processing
4. PureData - Various control mechanisms in Pure Data.
5. PureData - Sampling
6. SuperCollider - Introduction and fundamentals of sound synthesis and processing
7. SuperCollider - groups and modularity, filtering by groups, samples, tasks, sequences
8. WebAudio
9. Introduction to tonal music theory. Symbolic representations of music (MIDI, MusicXML)
10. Components of human speech. Speech systems and mathematical models. Speech analysis and synthesis
11. Computer generated music
12. Innovations, new trends and research in sound, music and speech generation',
        'Да се стекнат со знаење на клучни прашања поврзани со анализата и генерирањето на звуци, музика и говор.',
        'To acquire knowledge of key issues related to the analysis and generation of sounds, music and speech.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури',
        'освоени 50% од предвидените поени на индивидуалните задачи', '30', '45', '10', '20', '75', '180', null, '20',
        '10', '20');
