values ('F23L3S118', '617', 'Continous integration and delivery', '600', '6', '1', '2023', 'македонски, англиски', '- Вовед во DevOps. Запознавање со CAMS (Culture, Automation, Measurement, Sharing) принципите.
- Развој и операции. Различните перспективи на развојот (Dev) и оперативните активности (Ops), потенцијални конфликти помеѓу нив и нивно разрешување.
- Користење на континуирана интеграција во процесот на развој на софтвер.
- Алатки за континуирано тестирање преку автоматизација на цевковод.
- Имплементирање на континуирана испорака во софтверските процеси.
- Континуиран менаџмент на технички долг.
- Менаџирање на софтверски изданија.
- Менаџирање со конфигурации.
- Мониторирање на сите процеси во извршувањето на цевководот.
- Користење и автоматизација на софтверски репозиториуми.
- Користење на системи за оркестрација на сервиси за извршување на операциите во цевководот.', '- Introduction to DevOps. Familiarity with CAMS (Culture, Automation, Measurement, Sharing) principles.
- Development and operations. The different perspectives of development (Dev) and operational activities (Ops), potential conflicts between them and their resolution.
- Using continuous integration in the software development process.
- Tools for continuous testing through pipeline automation.
- Implementing continuous delivery in software processes.
- Continuous management of technical debt.
- Management of software releases.
- Configuration management.
- Monitoring of all processes in pipeline execution.
- Use and automation of software repositories.
- Using service orchestration systems to perform pipeline operations.',
        'Запознавање со основните концепти на развој и операции (DevOps) преку континуирана интеграција, тестирање, испорака и распоредување на софтверски решенија и системи. Осознавање на различните перспективи на развојниот (Dev) и оперативниот (Ops) дел од животниот циклус на еден систем. Оспособување на студентите за употреба на алатки за автоматизација на процесите за интеграција, тестирање, испорака и распоредување. Запознавање со предизвиците и најдобрите практики за менаџирање со софтверски изданија и конфигурации.',
        'Familiarity with the basic concepts of development and operations (DevOps) through continuous integration, testing, delivery and deployment of software solutions and systems. Understanding the different perspectives of the development (Dev) and operational (Ops) part of the life cycle of a system. Empowering students to use process automation tools for integration, testing, delivery and deployment. Familiarity with the challenges and best practices for managing software releases and configurations.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети', 'Оперативни системи', 'Реализирани актибвности 15.2 и 16.1', '30',
        '45', '15', '15', '75', '180', '10', '15', '70', '10');
