Exercises:
1. Getting to know Python
2. Random number generation
3. Representation and simulation of examples from discrete systems
4. Representation and simulation of examples from continuous systems
5. Representation and simulation of high-dimensional systems
6. Models with agents
7. Simulations with game theory
8. Stochastic models and their application in finance
9. Waiting lines
10. Application of several algorithms for estimation on a real situation and parameters with real data and prediction of future behavior
11. Optimization techniques
12. Methods for reducing dimensionality', 'Студентот ќе се здобие со знаења за користење на техники за моделирање со цел да го евалуира однесувањето на реалните системи. Студентот ќе стекне способност за конструирање, верификација и решавање
на модели со различни нивоа на апстракција и деталност. Ќе бидат опфатени и методи за фитување на состојбата и параметрите на моделите со реални податоци, како и предвидување на идното однесување и "што-ако" анализи.', 'The student will acquire knowledge of using modeling techniques in order to evaluate the behavior of real systems. The student will acquire the ability to construct, verify and solve
of models with different levels of abstraction and detail. It will also cover methods for fitting the state and parameters of models with real data, as well as predicting future behavior and "what-if" analyses.', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и
софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на
проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети',
