values ('F23L3S132', '557', 'Modern trends in robotics', '600', '8', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед во предметот
	2. Роботски компоненти
	3. Роботска околина
	4. Движење кај модерните роботи. Формални дефиниции
	5. Чувствување на околината
	6. Сензорско - роботски системи
	7. Мерење и несигурност.
	8. Управувачки парадигми
	9. Учење и когниција. Однесување
	10. Роботика и емоции
	11. Интеракција човек - робот
	12. Еволуција - меѓу роботика и биологија

Вежби:
	1. Вовед во предметот
	2. трансформации
	3. кинематика на манипулатори
	4. траекторија на манипулатори
	5. Динамика на роботи
	6. Управување на роботи: Роботска рака , одечки робот, хексапод
	7. Чувствување и несигурност - Сензорен модел
	8. Управување на возилни роботи
	9. Контролен систем и роботско учење. Парадигми на роботско однесување.
	10. Емоционална роботика
	11. Интеракција човек - робот, алатки и примери
	12. Биороботика низ примери
',
        'Introduction to the modern topics in robotics. Robotic components. Robotic environment. Locomotion in modern robots. Formal definitions. Sensing the environment. Sensory - robotic systems. Measurement and Uncertainty. Management paradigms. Learning and Cognition. Conduct. Robotics and emotions. Human - robot interaction. Evolution - between robotics and biology',
        'Студентите ќе бидат воведени во модерните трендови во роботиката. Ќе бидат запознаени со современите техники на моделирање на околината, во која роботите стануваат секојдневие. Студентите ќе се стекнат со познавање на тековните трендови во роботиката како што се интеракција човек – робот, нанороботика, биолошки роботи, роботизирани производни процеси, роботика како асистивна технологија и други трендови',
        'Students will be introduced to modern trends in robotics. They will be introduced to modern techniques of modeling the environment, in which robots are becoming everyday visitors. Students will gain knowledge of current trends in robotics such as human-robot interaction, nanorobotics, biologically inspired robots, robotic manufacturing processes, robotics as assistive technology and other trends.',
        'Предавања, вежби, самостојна работа, проектни задачи, семинарски работи',
        'механизам на интерна евалуација и анкети', 'Оперативни системи', 'реализирани 15.1 и 15.2', '30', '45', '15',
        '15', '75', '180', '10', '15', '50', '10');
