values ('F23L3S135', '523', 'Multimedia systems', '600', '6', '1', '2023', 'македонски и англиски',
        'Вовед во мултимедија и класификација на мултимедиската содржина. Компоненти на еден мултимедиски систем. Креирање на мултимедиска содржина (signali, АД конверија, Фуриева трансформација, семплирање и квантизација, филтрирање и субсемплирање). Репрезентација и формати на мултимедиска содржина (слика, видео, аудио). YUV субсемплирање. Теорија на бои, трихроматност, физиологија на човековиот визуелен систем, колорни шеми (RGB, YUV, CMYK, ...).  Основи на компресија на мултимедиска содржина (ентропија, таксономија, метрики). Техники за компресија (Хофман кодирање, аритметичко кодирање, LZW, замена на урнеци, векторска квантизација, кодирање на подопсег, диференцијално пулсно-кодна модулација, хибридни шеми ...). Предизвици при компресија (симетрична vs. несиметрична, адаптивна vs. неадаптивна, брзина и комплексност на енкодер/декодер, ...). Компресија на слики (GIF, PNG, MPEG, MPEG 2000,  дискретна вејвлет трансформација, фрактално кодирање, ...). Компресија на видео (темпорална редундантност, блок-базирана предикција на рамки, пресметување на вектор на движење, I рамки, B рамки, P рамки, предикција на повеќе рамки, GOP видео структура). Комплексност на компензација на движење (логаритамско vs. хиерархиско пребарување). MPEG стандард. Компресија на аудио (делта модулација, логаритамска квантизација, ...). Основи за QoS и QoE.',
        'Introduction to multimedia and classification of multimedia content. Components of a multimedia system. Creation of multimedia content (signals, AD conversion, Fourier transform, sampling and quantization, filtering and subsampling). Representation and formats of multimedia content (image, video, audio). YUV subsampling. Color theory, trichromaticity, physiology of the human visual system, color schemes (RGB, YUV, CMYK, ...). Fundamentals of multimedia content compression (entropy, taxonomy, metrics). Compression techniques (Hoffman coding, arithmetic coding, LZW, pattern substitution, vector quantization, subband coding, differential pulse-code modulation, hybrid schemes ...). Compression challenges (symmetric vs. asymmetric, adaptive vs. non-adaptive, encoder/decoder speed and complexity, ...). Image compression (GIF, PNG, MPEG, MPEG 2000, discrete wavelet transform, fractal coding, ...). Video compression (temporal redundancy, block-based frame prediction, motion vector computation, I frames, B frames, P frames, multi-frame prediction, GOP video structure). Complexity of motion compensation (logarithmic vs. hierarchical search). MPEG standard. Audio compression (delta modulation, logarithmic quantization, ...). Basics of QoS and QoE.',
        'Запознавање на студентот со основните концепти за работа со мултимедиските податоци, начините на нивно моделирање и имплементирање и манипулација со истите. Студентот ќе биде способен да моделира мултимедиски податоци, ќе знае практично да го применува содржински-базираното пребарување на мултимедиските податоци, и ќе се здобие со воведни знаења за креирање на апликации базирани на  мултимедиските содржини.',
        'Acquaintance of the student with the basic concepts of working with multimedia data, the ways of their modeling and implementation and manipulation with them. The student will be able to model multimedia data, will know how to practically apply content-based retrieval to multimedia data, and will acquire introductory knowledge for creating applications based on multimedia content.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури',
        'реализирани активности 15.2 и 16.1 и 16.2', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
