values ('F23L3S138', '612', 'Advanced databases', '600', '6', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Складирање на податоци и структура на датотеки
	2. Индексирање и хаширање
	3. Извршување на прашалници
	4. Оптимизација на прашалници
	5. Управување со трансакции
	6. Контрола на конкурентност
	7. Системи за обновување
	8. Архитектури на системите за управување со бази на податоци;
	9. Паралелни бази на податоци
	10. Дистрибуирани бази на податоци
	11. Аналитички бази на податоци - податочни складови и податочно рударство
	12. Објектни и објектно релациони бази на податоци
	13. Трендови во развојот на базите на податоци', 'Lectures:
1. Data storage and file structure
2. Indexing and Hashing
3. Execution of questionnaires
4. Optimization of questionnaires
5. Transaction Management
6. Control of competitiveness
7. Recovery systems
8. Architectures of database management systems;
9. Parallel databases
10. Distributed databases
11. Analytical databases - data warehouses and data mining
12. Object and object relational databases
13. Trends in the development of databases',
        'Запознавање на студентите со напредните концепти на релационите бази на податоци, неопходни за моделирање, креирање, управување и одржување на базите на податоци, како и за  развој на податочно интензивни информациски системи. Со тоа студентите ќе се стекант со длабоки теоретски и практични знаења од областа на базите на податоци. Исто така, студентите ќе се запознат со современите текови на развој и проширување на традиционалните системи за управување на бази на податоци, а со цел да одговорат на актуелните предизвици во развојот на информатичката теорија и практика.',
        'Acquaintance of students with the advanced concepts of relational databases, necessary for modeling, creation, management and maintenance of databases, as well as for the development of data-intensive information systems. With this, students will acquire deep theoretical and practical knowledge in the field of databases. Also, students will be familiar with the modern trends of development and expansion of traditional database management systems, in order to respond to current challenges in the development of information theory and practice.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби  (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'Освоени најмалку 90 ЕКТС', 'изработени 50% од индивидуални задачи',
        '30', '45', '15', '15', '75', '180', null, '15', '10', '10');
