values ('F23L3S141', '575', 'Unstructured databases', '600', '8', '1', '2023', 'македонски', 'Предавања:
	1. Вовед во полуструктурирани податоци. ObjectExchangeModel (OEM). Вовед во XML. Структура на XML документите.
	2. Шеми на податоци - DTD
	3. Шеми на податоци - XMLSchema
	4. Препораки за трансформација на ЕЕР модели во XML шеми на податоци
	5. Манипулација за XML документите. Користење на xPath за навигација низ XML документите
	6. Манипулација врз XML документите преку XQuery, поставување на едноставни прашалници и користење на кориснички дефинирани функции
	7. Вовед во NoSQL базите на податоци. Запознавање со начинот на структурирање, чување и манипулација со податоците организирани преку NoSQLбазите на податоци.
	8. Map-Reduce методологија за паралелно решавање проблеми
	9. Агрегација на податоци и агрегатни податочни модели како основа на NoSQL базите на податоци
	10. Document базирани бази на податоци и key-value базирани бази на податоци
	11. Column-family базирани бази на податоци и graph базирани бази на податоци
	12. Најчесто користени NoSQL бази на податоци и нивна примена во различни домени и апликации

Вежби:
	1. ОЕМ примери. Вовед во XML. Примери за структура на XML документите (елементи, атрибути)
	2. Шеми на податоци DTD
	3. Шеми на податоци XMLSchema
	4. Трансформација на ЕЕР модели во XMLSchema
	5. Примери со навигација низ XML документи со XPath
	6. Манипулација врз XML документите преку XQuery
	7. Повторување на релациона алгебра
	8. Решавање на проблеми во Map-Reduce
	9. Решавање проблеми со агрегатни модели
	10. Проектна задача
	11. Проектна задача
	12. Проектна задача
', 'Lectures:
1. Introduction to semi-structured data. ObjectExchangeModel (OEM). Introduction to XML. Structure of XML documents.
2. Data Schemas - DTD
3. Data Schemas - XMLSchema
4. Recommendations for the transformation of EER models into XML data schemas
5. Manipulation of XML documents. Using xPath to navigate through XML documents
6. Manipulation of XML documents through XQuery, setting simple queries and using user-defined functions
7. Introduction to NoSQL databases. Getting to know the way of structuring, storing and manipulating data organized through NoSQL databases.
8. Map-Reduce methodology for parallel problem solving
9. Data aggregation and aggregate data models as the basis of NoSQL databases
10. Document based databases and key-value based databases
11. Column-family based databases and graph based databases
12. Commonly used NoSQL databases and their application in different domains and applications

Exercises:
1. OEM examples. Introduction to XML. Examples of structure of XML documents (elements, attributes)
2. DTD data schemas
3. XMLSchema data schemas
4. Transformation of EER models in XMLSchema
5. Examples of navigating through XML documents with XPath
6. Manipulation of XML documents through XQuery
7. Review of relational algebra
8. Problem Solving in Map-Reduce
9. Solving problems with aggregate models
10. Project assignment
11. Project task
12. Project assignment',
        'Целта на курсот е студентите да се запознаат со неструктурираните и полуструктурираните типови на податоци, нивната организација и чување, како и техниките за манипулација и обработка на истите. Исто така студентите ќе бидат запознаени и со NoSQL базите на податоци, современи бази на податоци кои не подлежат на релациониот модел, а се користат во дистрибуирани и кластер околини. Посебен акцент ќе биде ставен на практичното знаење на некоја од NoSQL базите на податоци.',
        'The aim of the course is for students to become familiar with unstructured and semi-structured types of data, their organization and storage, as well as techniques for their manipulation and processing. Students will also be introduced to NoSQL databases, modern databases that are not subject to the relational model, and are used in distributed and cluster environments. Special emphasis will be placed on practical knowledge of some of the NoSQL databases.',
        'предавања, аудиториски вежби, лабораториски вежби, проектни задачи, домашни задачи',
        'механизам на интерна евалуација и анкети', 'Бази на податоци', 'Реализирани активности 15, 16', '30', '45',
        '15', '15', '75', '180', '10', '15', '40', '10');
