values ('F23L3S150', '651', 'Data Mining', '600', '6', '1', '2023', 'македонски и англиски', '1. 1.	Вовед, примери за примена на методите на податочно рударење. Типови на податоци. Мерки на сличност и растојание меѓу податоците: мерки на сличност и растојание за номинални и бинарни. Стандардизација на нумерички атрибути. Мерки на растојание за нумерички атрибути: Растојание на Минковски и специјални видови, косинусно растојание, евклидско ратојание, Махаланобиево растојание. Растојание меѓу податоци со мешани атрибути.
	2. Техники за претпроцесирање на податоци: Квалитет на податоци, чистење на податочно множество, Интегрирање на податоци, редукција на податоци, трансформација на податоци и дискретизација на податоци.
	3. Напредна визуелизација на податоците.
	4. Модели за предвидување, регресиони модели. Напредни концепти (анализа на резидуали, confounding, adjustment, толкување на резултати)
	5. Класификација. Надгледувано и ненадгледувано учење.  Класификација со дрва на одлучување. LDA класификација
	6. Кластерирање и евалуација на кластери.
	7. Детекција и справување со аутлаери
	8. Евалуација на модели
	9. Анализирање на временски податоци и временски серии
	10. Екстрахирање, трансформирање и зачувување на податоци (Extract, Тransform, Load)
	11. Екстрахирање, трансформирање и зачувување на податоци (Extract, Тransform, Load)
	12. Завршен проект', '1. Introduction, examples of application of data mining methods. Data types. Similarity and distance measures between data: similarity and distance measures for nominal and binary. Standardization of numerical attributes. Distance measures for numerical attributes: Minkowski distance and special types, cosine distance, Euclidean square, Mahalanobis distance. Distance between data with mixed attributes.
2. Data preprocessing techniques: Data quality, data set cleaning, Data integration, data reduction, data transformation and data discretization.
3. Advanced data visualization.
4. Prediction models, regression models. Advanced concepts (analysis of residuals, confounding, adjustment, interpretation of results)
5. Classification. Supervised and unsupervised learning. Classification with decision trees. LDA classification
6. Clustering and evaluation of clusters.
7. Detection and handling of outliers
8. Evaluation of models
9. Analyzing time data and time series
10. Extract, transform and save data (Extract, Transform, Load)
11. Extract, transform and save data (Extract, Transform, Load)
12. Final project',
        'Запознавање со методи за идентификација на валидни, нови, корисни и разбирливи шеми во податоци и откривања на нови знаења. Претпроцесирање на податоците. Вовед во предиктивни модели од податоците: класификација, регресијa. Откривање на кластери. Совладување на техники за собирање на податоци, нивно траксформирање во облик погоден за интерно користење и нивно зачувување.',
        'Familiarity with methods for identification of valid, new, useful and understandable patterns in data and discovery of new knowledge. Data preprocessing. Introduction to predictive models from data: classification, regression. Cluster detection. Mastering techniques for collecting data, transforming them into a form suitable for internal use and saving them.',
        'предавања, аудиториски вежби, лабораториски вежби, проектни задачи, домашни задачи, разработка на програмски пакет со методи за податочно рударење',
        'механизам на интерна евалуација и анкети',
        'Веројатност и статистика или Математика 3 или  Основи на теорија на информации или Бизнис Статистика',
        'Реализирани активности 15, 16', '30', '45', '0', '30', '75', '180', '10', '30', '60', '10');
