values ('F23L3S153', '620', 'AI for Games', '600', '6', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Преглед на Вештачката интелигенција (ВИ) за игри.
	2. Претставување на знаење кај разни видови на игри.
	3. Движење и планирање кај игрите.
	4. Донесување на одлуки во контекст на игри.
	5. ВИ кај аркадните игри.
	6. ВИ кај стратешките игри во реално време.
	7. ВИ кај тимски игри.
	8. ВИ кај игри со улоги.
	9. Учење кај игрите.
	10. Процедурално создавање на содржина.
	11. Наративот на игрите и ВИ.
	12. Најновите истражувања и иднината на ВИ за игри.

