', 'The course deals with techniques of both AI behaviour in games and AI playing like humans. These techniques includе ways how game programs can learn responses and generate plans and movements based on players’ actions. Different traditional video games are analyzed, includiung arcade action games, strategy games, role-playing games, and other genres. Practically creating AI bots and procedural content generation systems. Other techniques covered include state- and goal-based behavior, inter-player communication, individual and team AI, graph theory, search, planning and optimization, triggers, scripting, finite state machines, perceptual modeling, goal evaluation. Analyzing and creating an engaging narative that involves AI in games.


Potential function based movements: a technique that handles chasing, evading swarming, and collision avoidance simultaneously
Basic pathfinding and waypoints, including an entire chapter devoted to the A* pathfinding algorithm
AI scripting
Rule-based AI: learn about variants other than fuzzy logic and finite state machines

Experience programming game AI with Finite State Machines
Experience programming game AI for team-based Game AI
Experience programming game AI for real-time strategy games
Experience programming game AI for arcade games',
        'Студентите ќе ги разберат тековните проблеми и техники во академската и индустриската Вештачка интелигенција (ВИ) за игри, во исто време стекнувајќи практично искуство во работењето со разни готови алатки за техниките на ВИ применувани во индустријата за игри денес. Ќе бидат оспособени за подобро да ја разберат врската помеѓу ВИ за игрите и естетиката, наративот и играчкото искуство, на тој начин обезбедувајќи зголемена вклученост и задоволство на играчите.',
        'Students will understand the current issues and techniques in academic and industry game AI, while gaining, in the same time, hands-on experience in working with different toolboxes of game AI techniques used in the gaming industry today. They will be able to better understand the relationship between game AI and aesthetics, narrative, and player experience, thus obtaining an increased engagement and enjoyment of the players.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури или Вештачка интелигенција',
        'Редовна посета на наставата, навремено предадени домашни и презентација на проектна задача', '30', '45', '15',
        '15', '75', '180', '10', '15', '50', '10');
