values ('F23L3S155', '580', 'Service-oriented architectures', '600', '6', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед во сервисно ориентирани архитектури
	2. Слоеви на сервиси и микросервиси
	3. Анализа и моделирање на софтвер со веб сервиси
	4. Анализа и моделирање на софтвер со REST сервиси и микросервиси
	5. Дизајн на сервисно API и договор кај веб сервиси
	6. Дизајн на сервисно API и договор кај REST сервиси и микросервиси
	7. Процес на развој на софвер со микросервисна архитектура
	8. Системски дизајн на микросервисна архитектура
	9. Безбедносни политики и заштита кај сервисно ориентираните архитектури

Вежби:
	1. Монолитна архитектура
	2. Микросервисна архитектура
	3. Градбени единки
	4. Влезна точка - API Gateway
	5. Бази на сервиси
	6. Пренос на пораки
	7. Проект
	8. Проект
	9. Проект
', 'Lectures:
1. Introduction to service-oriented architectures
2. Layers of services and microservices
3. Analysis and modeling of software with web services
4. Analysis and modeling of software with REST services and microservices
5. Design of service API and contract with web services
6. Service API design and contract in REST services and microservices
7. Software development process with microservice architecture
8. System design of microservice architecture
9. Security policies and protection in service-oriented architectures

Exercises:
1. Monolithic architecture
2. Microservice architecture
3. Building units
4. Entry point - API Gateway
5. Service bases
6. Transmission of messages
7. Project
8. Project
9. Project',
        'Предметот сервисно-ориентирани архитектури има за цел да ги запознае студентите со организација, дизајн и развој на на дистрибуираните системи базирани на сервиси. Сервисно-ориентираните архитектури опфаќа теми од софтверско и системско инженерство. Од аспект на софтверско инженерство студентите ќе се запознаат со процесот на анализа и дизајн при развој на сервисно-ориентирани апликации, како и со организацијата на процесот на развој на софвер погодни за сервисно-ориентирани системи. Во поглед на системско инженерство, предметот ќе го покрие целосниот екосистем на сервисно-ориентирана и микро-сервисно ориентирана архитектура, нејзините компоненти, поврзаност, соработка и координација.',
        'The subject of service-oriented architectures aims to familiarize students with the organization, design and development of distributed systems based on services. Service-oriented architectures cover topics from software and systems engineering. From the aspect of software engineering, students will get to know the process of analysis and design during the development of service-oriented applications, as well as the organization of the software development process suitable for service-oriented systems. In terms of systems engineering, the course will cover the complete ecosystem of service-oriented and micro-service-oriented architecture, its components, connectivity, collaboration and coordination.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на хардверска опрема и софтверски пакети), тимска работа, решени едноставни примери и проширување на знаењето со посложени задачи, поканети гости предавачи, самостојна изработка на домашни задачи. учење во електронско опкружување (форуми, консултации)',
        'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури',
        'Реализирани активности 15.1 и 15.2', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
