values ('F23L3S157', '613', 'Data warehouses and analytics', '600', '6', '1', '2023', 'македонски и англиски', 'Основни концепти кај складовите на податоци;
Архитектура на складовите на податоци и проток на податоци;
Моделирање на складови на податоци;
Бавно променливи димензии;
Организација на податоците во ѕвездеста и снегулка шема на склад на податоци;
Моделирање во податочни сефови;
Хиперкоцки и повеќедимензионални бази на податоци;
Технилогии за аналитичка обработка (ОLAP) на податоци и проширувања на SQL стандардот за потребите на ОLAP;
Врска помеѓу оперативните бази на податоци и складовите на податоци;
Автоматско ажурирање на податоците (инкрементално и целосно полнење) во складовите на податоци, прочистување и агрегација на податоци (ETL процеси);
Организација кај дистрибуирани складови на податоци и анализа на многу обемни податоци;
Проучување на водечките алатки и технологии за креирање, моделирање и одржување складовите на податоци.', 'Basic concepts in data warehouses;
Architecture of data warehouses and Data flow;
Modeling of data warehouses and data marts;
Slowly changing dimensions;
Organization of data in star and snowflake schemas;
Data vault modeling;
Hypercubes and multi-dimensional data stores;
Online analytical processing (OLAP) technologies and extension of SQL standard for OLAP queries;
Lineage between operational data stores and data warehouses;
Automatic loads (incremental and full) in data warehouses, data cleansing and wrangling processes, aggregation, and Extract-Transform-Load (ETL).
Basic concepts in distributed data warehouses and Big Data Analysis;
Showcase and analysis of leading tools and technologies for creating, modeling and maintaining data warehouses.',
        'Запознавање со oрганизацијата и манипулацијата со податоците организирани во складови на податоци, како и основните операции и алгоритми за работа со складови на податоци. Студентот ќе биде оспособен за интегрирање на оперативни бази на податоци во специјално дизајнирни модели погодни за аналитички потреби. Ова вклучува димензионо моделирање на складови на податоци, организација и манипулација со податоците сместени во складови на податоци, и изготвување на аналитички извештаи базирани на истите податоци.',
        'Introduction to organization and manipulation of data organized in data warehouses, as well as the basic operations in creating data warehouses. The students would be able to integrate operational data stores in specially designed models suitable for analytical workloads. This includes dimensional modeling of data warehouses and data marts, as well as data vaults. Likewise, it includes organization and manipulation of data in data warehouses and preparing analytical reports.',
        'предавања, аудиториски вежби, лабораториски вежби, проектни задачи, домашни задачи',
        'механизам на интерна евалуација и анкети', 'Освоени најмалку 100 ЕКТС', 'Реализирани активности 15, 16', '30',
