10. Swarm intelligence
11. Swarm Computing Algorithms
12. Systems and applications of networked mobile nodes',
        'Целта на предметот е да ги запознае студентите со можностите на толпата да споделува и обработува податоци кои овозможуваат да се решаваат проблеми кои се сеуште комплексни за компјутерските системи, но многу едноставни за колектив со човечка интелигенција. Предметот ќе ги воведе студентите во нов дизајн на апликации и концепт на програмирање кој се заснова на недоверливо учество на голем број поединци од толпата. Во предметот ќе се разгледаат постоечки апликации и платформи за собирање на податоци и решавање на обемни задачи на барање.',
        'The purpose of the course is to familiarize students with the possibilities of the crowd to share and process data that allow solving problems that are still complex for computer systems, but very simple for a collective with human intelligence. The course will introduce students to a new application design and programming concept based on the trustless participation of large numbers of individuals from the crowd. The course will review existing applications and platforms for collecting data and solving extensive tasks on demand.', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и
