        'The graduation work is a project of the student, which is worked on under the mentorship of a professor from the faculty. The thesis is defined by the mentor together with the student, after which the student works on the thesis. After completing the thesis, the student presents the results to a three-member public defence committee.',
        'Во рамките на дипломската работа, студентот се стекнува со вештина за дефинирање на проблем, и примена на стекнатото знаење на факултетот за дизајн и имплементација на решение на дадениот проблем. Дополнително, студентот успешно идентификува потреба од дополнителни знаења за решавање на проблемот. Исто така студнетот ги документира и презентира резултатите од дипломската работа',
        'Within the framework of the diploma work, the student acquires the skill of defining a problem, and applying the knowledge acquired at the faculty for the design and implementation of a solution to the given problem. In addition, the student successfully identifies the need for additional knowledge to solve the problem. Also, the student documents and presents the results of the diploma work', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети', '204 ЕКТС кредити',
