values ('F23L3W001', '2969', 'Mathematics 3', '600', '3', '1', '2023', 'Македонски и англиски', '1.	Елементи од комбинаторика.
2.	Експерименти и настани: множество елементарни настани, случајни настани, операции со настани  Дефиниција и својства на веројатност. Класична дефиниција на веројатност.
3.	Условна веројатност. Независност. Формула за тотална веројатност. Баесови формули.
4.	Дискретни случајни променливи: дефиниција, примери,  закон и функција на распределба. Познати распределби од дискретен тип (Бенулиева, биномна, рамномерна, Пуасонова)
5.	Случајни променливи од апсолутно непрекинат тип: дефиниција, функција и густина на распределба. Познати распределби од апсолутно непрекинат тип (рамномерна, експоненцијална, гама, нормална Независност на случајни променливи дефиниции и примери
6.	Бројни карактеристики: математичко очекување и дисперзија и нивни својства. Коваријанса и коефициент на корелација помеѓу две случајни променливи.
7.	Централна гранична теорема.   Позначајни распределби во статистика.
8.	Елементи од статистика: популација и примерок, видови податоци, параметри и статистики.
9.	Дескриптивни статистики (просек, дисперзија, стандардна девијација, медијана, подредени статистики, ранг, квантили, медијана).
10.	Интервали на доверба за математичко очекување, дисперзија, веројатност на настан.
11.	Тестирање на хипотези: грешка од прв и втор тип, моќ на тест, тест статистика, критичен домен. Тестови со едно обележје: тестови за вредност на математичко очекување, тест за вредност на веројатност на настан, тест за вредност на дисперзии.
12.	Тестови со две обележја: тест за еднаквост на дисперзии, тест за еднаквост на математички очекувања. Непараметарски тестови за независност на две категориски обележја.', '1. Elements of combinatorics.
2. Experiments and events: set of elementary events, random events, operations with events Definition and properties of probability. Classical definition of probability.
3. Conditional probability. Independence. Total Probability Formula. Bayesian formulas.
4. Discrete random variables: definition, examples, distribution law and function. Known distributions of discrete type (Benoulli, binomial, uniform, Poisson)
5. Random variables of absolutely continuous type: definition, function and distribution density. Known distributions of absolutely continuous type (uniform, exponential, gamma, normal) Independence of random variables definitions and examples
6. Quantitative features: mathematical expectation and dispersion and their properties. Covariance and correlation coefficient between two random variables.
7. Central limit theorem. More significant distributions in statistics.
8. Elements of statistics: population and sample, types of data, parameters and statistics.
9. Descriptive statistics (mean, dispersion, standard deviation, median, ordered statistics, rank, quantiles, median).
10. Confidence intervals for mathematical expectation, dispersion, probability of an event.
11. Hypothesis testing: first and second type error, test power, test statistic, critical domain. One-sign tests: mathematical expectation value tests, event probability value test, variance value test.
12. Two-sign tests: test for equality of variances, test for equality of mathematical expectations. Nonparametric tests of independence of two categorical features.',
        'Да се воведат основните концепти од веројатност и статистичка анализа со дискусија на примените во компјутерските науки. Да се оспособат студентите за успешно следење на стручните предмети во кои се применуваат елементи од теорија на веројатност и статистика.',
        'To introduce the basic concepts of probability and statistical analysis with a discussion of applications in computer science. To enable students to successfully follow vocational courses in which elements of probability theory and statistics are applied.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски',
        'механизам на интерна евалуација и анкети', null, null, '45', '45', '45', '0', '45', '180', null, '0', null,
        null);
