values ('F23L3W004', '432', 'Databases', '600', '5', '1', '2023', 'Македонски и англиски', '(2) Физичка организација на податоците (структури и индекси)
    (1) Вовед во СУБП
    (2) Модел на реалниот свет (П-ЕР дијаграми)
    (1) Релациски податочен модел
    (2) Релациона алгебра и релациони пресметки
    (2) Вовед во SQL - DDL и DML изрази
    (1) Напредно користење на SQL
    (1) Функционални зависности и нормализација на БП
    (1) Вовед во конкурентно рабoтење и трансакции', '(2) Physical organisation of data (data structures and indices)
(1) Introduction to DBMS
(2) Conceptual modelling and database design (E-ЕR diagrams)
(1) The relational data model
(2) Relational algebra and relational calculus
(2) Introduction to SQL - DDL and DML statements
(1) Advanced usage of SQL
(1) Functional dependencies and database normalization
(1) Introduction to transaction processing and concurrency control',
        'Запознавање на студентот со основните концепти за работа со бази на податоци, начините на нивно моделирање и имплементирање, како и работа со прашалните јазици. Студентот ќе биде способен да моделира бази на податоци преку семантичко и релациско моделирање и процес на нормализација, ќе знае практично да го применува SQL стандардот за креирање, одржување и манипулација на релациските бази на податоци. Студентот ќе има познавање за основните концепти на конкурентно работење и трансакции.',
        'Introducing the student with the basic concepts for using the databases; the ways of their modeling and implementation; as well as the application of the query languages. The student will be able to model databases through semantic and relational modeling and database normalization, he/she will know how to practically apply the SQL standard for creating, maintaining and manipulating relational databases. The student will have knowledge of the basic concepts of concurrency control and transactions.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури',
        'Реализирани актибвности 15.2 и 16.1', '30', '60', '10', '10', '70', '180', '10', '10', '70', '10');
