        'Запознавање со основите за науката базирана на податоци. Студентите ќе се запознаат со процесот и методологијата при работа со податоци, почнувајќи од идентификацијата на проблемите, преку собирање на податоци, а потоа и нивна обработка. Студентите ќе ги научат основните техники за обработка на податоците и идентификување на шаблони во нив, како и начините на визуелизација и интерпретација на добиените резултати.',
        'Introduction to the basics of data-driven science. Students will get to know the process and methodology when working with data, starting from the identification of problems, through data collection, and then their processing. Students will learn the basic techniques for data processing and identifying patterns in them, as well as ways of visualizing and interpreting the obtained results.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
