values ('F23L3W009', '654', 'Software design and architecture', '600', '5', '1', '2023', 'македонски и англиски', '(1) Дизајн концепти, дефиниција на дизајнот, основни проблеми во дизајнот (на пример, перзистентни податоци, управување со складиштата и исклучоци)
    (1) Контекст на дизајн во рамките на повеќе животни циклуси на развој на софтвер, принципи на проектирање (криење на информации, кохезија и спојување)
    (1) Интеракции помеѓу дизајнот и барањата, дизајн за квалитетни атрибути (на пример, сигурност, употребливост, одржливост, перформанси, тестирање, безбедност и толеранција на грешки)
    (1) Дизајн компромиси, дизајн стратегии, функционален дизајн, објектно-ориентиран дизајн
    (1) Податочно воден дизајн, аспектно-ориентиран дизајн, архитектонски дизајн
    (3) Архитектонски стилови, шаблони и рамки
    (1) Архитектонски размени меѓу различните атрибути
    (1) Хардверски и системски инженеринг прашања во софтверската архитектура, барања за следливост во архитектурата
    (1) Сервисно ориентирани и архитектури во облак
    (1) Архитектури за мрежни, мобилни и вградени системи
    (1) Однос помеѓу архитектурата на производот, структурата на организацијата, и пазарот', '(1) Design concepts, design definition, fundamental design issues (eg, data persistence, storage management, and exceptions)
(1) Design context within multiple software development life cycles, design principles (information hiding, cohesion and coupling)
(1) Interactions between design and requirements, design for quality attributes (eg, reliability, usability, maintainability, performance, testability, security, and fault tolerance)
(1) Design compromises, design strategies, functional design, object-oriented design
(1) Data-driven design, aspect-oriented design, architectural design
(3) Architectural styles, patterns and frameworks
(1) Architectural exchanges between different attributes
(1) Hardware and system engineering issues in software architecture, traceability requirements in architecture
(1) Service-oriented and cloud architectures
(1) Architectures for network, mobile and embedded systems
(1) Relationship between product architecture, organization structure, and market', 'Целта на курсот е студентите да ги научат главните концепти на објектно ориентирана анализа и дизајн. Да се запознаат со техниките на рефакторирање, шаблоните за дизајн и различните архитектури на софтвер. По завршувањето на курсот кандидатите ќе можат да ги идентификуваат ограничувањата и проценат квалитетите на софтверските системи. За конкретна софтверска спецификација ќе можат да ја проценат нејзината комплетност и
конзистентност, како и да дизајнираат софтверска архитектура во согласност со дадените барања.', 'The goal of the course is for students to learn the main concepts of object-oriented analysis and design. To become familiar with refactoring techniques, design patterns and different software architectures. After completing the course, candidates will be able to identify the limitations and evaluate the qualities of software systems. For a specific software specification they will be able to assess its completeness and
consistency, as well as to design a software architecture in accordance with the given requirements.',
        'предавања, аудиториски вежби, лабораториски вежби, проектни задачи, домашни задачи',
        'интерна евалуација и анкети', 'Објектно ориентирана анализа и дизајн или Објектно ориентирано програмирање',
        'Реализирани активности', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
