	4. Имплементација на управување со состојби
	5. Имплементација на Spring MVC контролери
	6. Мапирање на податоци со JPA
	7. Имплементација на Spring Data компоненти
	8. Конфигурација на заштита со Spring Security
	9. Имплементација на тестови
	10. Имплементација на реактивни апликации
