', '(1) Web application development trends
    (1) Introduction to web application development (protocols, client-server, generating HTML)
    (2) Server side development for web applications
    (2) Front-end development for web applications
    (1) State management for web applications and services
    (1) MVC development pattern for web applications
    (2) Working with data (persistence, object-relational mapping)
    (1) Web application security
