        'Целата на курсот е запознавање на студентите со воведните поими од областа на тестирање на софтвер, како потребата од тестирање на софтвер, како и практична работа на тестирање, валидација и верификација на софтвер.',
        'The purpose of the course is to acquaint students with the introductory concepts in the field of software testing, such as the need for software testing, as well as the practical work of software testing, validation and verification.',
