values ('F23L3W035', '479', 'Linear algebra and Applications', '600', '5', '1', '2023', 'Македонски и англиски',
        'Линеарна геометрија: Вектори во R2 и R3, скаларен производ на вектори, агол меѓу два вектори, векторски производ на вектори, равенка на права и рамнина и примени. Матрици: Дефиниција и операции со матрици и својства. Специјални видови на матрици, транспонирана матрица, симетрични матрици, дијагонална матрица, инверзна матрица. Системи линеарни равенки. Гаусов метод за решавање на системи линеарни равенки. Множество решенија на системи линеарни равенки. Геометриска интерпретација на решение на систем од линеарни равенки. Елиминација со помош на матрици: Елементарни матрици, елиминациони матрици и пермутациони матрици. LU факторизација и примена за решавање на системи линеарни равенки. Редуциран скалест облик на матрица. Реални векторски простори: Дефиниција на вектроски простор, векторски потпростори. Линеарна независност, база и димензија на векторски простор. Векторски простори и хомогени системи, ранг на матрица и примени. Координати и промена на бази. Примена. Ортогонални бази во Rn и ортогонален комплемент. Линеарни трансформации, дефиниција и примери. Јадро и ранг на линеарна трансформација. Матрица на линеарна трансформација. Ортогонални проекции и примена. Детерминанти и својства. Сопствени вредности и сопствени вектори. Дијагонализација на матрица.  Дијагонализација на симетрични матрица и примена. SV декомпозиција на матрици и примена.',
        'Linear Geometry: Vectors in R2 and R3, dot product of vectors, angle between two vectors, cross product of vectors, equation of line and plane and applications. Matrices: Definition and matrix operations and properties. Special types of matrices, transpose matrix, symmetric matrices, diagonal matrix, inverse matrix. Systems of linear equations. Gaussian method for solving systems of linear equations. Multiple solutions of systems of linear equations. Geometric interpretation of a solution of a system of linear equations. Elimination using matrices: Elementary matrices, elimination matrices and permutation matrices. LU factorization and application to solving systems of linear equations. Reduced staggered matrix form. Real vector spaces: Definition of vector space, vector subspaces. Linear independence, basis and dimension of a vector space. Vector spaces and homogeneous systems, matrix rank and applications. Coordinates and change of bases. Application. Orthogonal bases in Rn and orthogonal complement. Linear transformations, definition and examples. Kernel and rank of linear transformation. Linear transformation matrix. Orthogonal projections and application. Determinants and properties. Eigenvalues and eigenvectors. Diagonalization of a matrix. Diagonalization of symmetric matrix and application. SV matrix decomposition and application.',
        'Запознавање со концептите и методите на линеарната алгебра и како истите да се користат за рамислување и решавање на проблеми кои произлегуваат од компјутерските науки',
        'Familiarity with the concepts and methods of linear algebra and how to use them for thinking and solving problems arising from computer science', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
    пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
    задача и семинарска работа.', 'механизам на интерна евалуација и анкети',
        'Дискретна математика или Дискретни структури 2 или Математика 2 или Избрани теми од математика',
        'Реализирани актибвности 15.2 и 16.1', '30', '45', '15', '0', '90', '180', '0', '0', '80', '20');
