    9. Грид
    10. Big data и Дистрибуирани датотечни системи
    11. MapReduce концепти и имплементации (Hadoop)
    12. MapReduce концепти и имплементации (Hadoop) - дополнување
    13. Пресметување во облак - поддршка за паралелно и дистрибуирано процесирање
    14. Колоквиум 2

    Вежби:
    1.
    2. Проекти - вовед
    3. Вовед во MPI
    4. Примери со MPI
    5. Примери за програмирање со повеќе нишки
    6. Технологии и интерконекции
    7.
    8. Примери за хоризонтално и вертикално скалирање
    9. Управување со ресурси
    10. Hadoop - вовед
    11. Едноставни примери со Hadoop
    12. Примери со Hadoop
    13. Напредни можности на Hadoop
    14.
    ',
        '(1) Introduction (1) Enabling technologies and distributed system models (1) Basic concepts of parallel and distributed architectures (1) Parallel communications (1) Parallel algorithms (2) Clusters (1) Grids (1) Big data and distributed file systems (2) MapReduce concepts and implementations (Hadoop) (1) Cloud computing - support for parallel and distributed processing',
        'Цел на предметот е студентите да ги совладаат методите на паралелно и дистрибуирано процесирање, можностите за паралелизација на секвенцијална програма, дистрибуирано процесирање на голем број на податоци и проблемите со кои треба да се справат во тој процес',
        'The aim of the course is to let students master the methods of parallel and distributed processing, the possibilities for parallelization of a sequential program, distributed processing of a large number of data and the problems that have to be solved with in that process', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и
семинарска работа, учење во електронско опкружување (форуми, консултации).', 'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури',
        'Реализирани активности 15.2 и 16.1', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
