values ('F23L3W038', '474', 'Programming paradigms', '600', '7', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Преглед и споредба на императивна, објектно-ориентирана, декларативна и функционална програмска парадигма.
	2. Вовед во декларативна програмска парадигма. Исказно сметање. Предикатна логика од прв ред.
	3. Основи на логички програмски јазик. Унификација. Пребарување со враќање наназад.
	4. Клаузална репрезентација на податочни структури и алгоритми. Рекурзија. Прекини. Негација.
	5. Претставување и манипулација со знаење со логички програмски јазик.
	6. Вовед во функционална програмска парадигма. Програмирање без странични ефекти.
	7. Структурирани податочни типови и нивно процесирање.
	8. Функции како објекти од прв ред. Анонимни функции.
	9. Функции од повисок ред. Функционални затворања. Карринг. Парцијални функции.
	10. Мрзлива евалуација. Бесконечни секвенци. Апстракција на секвенци.
	11. Конкурентност и паралелизам 1
	12. Конкурентност и паралелизам 2', 'Предавања:
	1. Преглед и споредба на императивна, објектно-ориентирана, декларативна и функционална програмска парадигма.
	2. Вовед во декларативна програмска парадигма. Исказно сметање. Предикатна логика од прв ред.
	3. Основи на логички програмски јазик. Унификација. Пребарување со враќање наназад.
	4. Клаузална репрезентација на податочни структури и алгоритми. Рекурзија. Прекини. Негација.
	5. Претставување и манипулација со знаење со логички програмски јазик.
	6. Вовед во функционална програмска парадигма. Програмирање без странични ефекти.
	7. Структурирани податочни типови и нивно процесирање.
	8. Функции како објекти од прв ред. Анонимни функции.
	9. Функции од повисок ред. Функционални затворања. Карринг. Парцијални функции.
	10. Мрзлива евалуација. Бесконечни секвенци. Апстракција на секвенци.
	11. Конкурентност и паралелизам 1
	12. Конкурентност и паралелизам 2',
        'Целта на овој курс е запознавање на студентите со програмски парадигми различни од императивната и објектно-ориентираната, со фокус на декларативната и функционалната програмска парадигма. По завршувањето на курсот студентите треба да бидат способни да: Споредуваат различни програмски парадигми и да изберат соодветна за даден проблем, Користат логички програмски јазик за имплементација на ефикасни алгоритми,	Користат логички програмски јазик за репрезентација и манипулација со знаење, Користат функционален програмски јазик за пишување на програми без странични ефекти, Разбираат и користат функции од прв и повисок ред, функционални затворања, мрзлива евалуација и апстракција на секвенци, Разбираат и пишуваат едноставни конкурентни програми',
        'The aim of this course is to acquaint students with programming paradigms other than imperative and object-oriented, with a focus on declarative and functional programming paradigms. After completing the course, students should be able to: Compare different programming paradigms and choose the appropriate one for a given problem, Use a logical programming language to implement efficient algorithms, Use a logical programming language for knowledge representation and manipulation, Use a functional programming language for writing of programs without side effects, Understand and use first and higher order functions, functional closures, lazy evaluation and sequence abstraction, Understand and write simple concurrent programs',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури',
        'Реализирани активности 15.2 и 16.1', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
