	6. Изработка проекти со Ардуино 1
	7. Изработка проекти со Ардуино 2
	8. Изработка проекти со Ардуино 3
	9. Работа во групи - планирање
	10. Работа во групи - дизајн
	11. Работа во групи - имплементација
	12. Работа во групи - комерцијализација
',
        'Microprocessors. Processor Architecture for Embedded Systems. Comparison of different types of microcontrollers. Peripherals. Parallel I/O. Protocols. Asynchronous and synchronous serial communication. Interrupts. Conversion from/to analog and digital signals. Control, sensors and actuators. Techniques for working with low consumption. Arduino platform. Embedded Systems Programming.',
        'Студентите ќе се стекнат со разбирање на хардверот, софтверот и состемскиот дизајн на вградените системи. Тие ќе ја разберат важноста на интеракцијата меѓу хардверот и софтверот и поврзувањата со сензори и актуатори. Ќе ги стекнат основите на програмирање на вградени системи. Студентите ќе бидат способни да ги дефинираат архитектуралните барања, вклучувајќи го и хардверот и софтверот потребен за да се изгради модерен вграден систем.',
        'Students will gain an understanding of hardware, software, and system design of embedded systems. They will understand the importance of the interaction between hardware and software and connections with sensors and actuators. They will acquire the basics of programming embedded systems. Students will be able to define the architectural requirements, including the hardware and software needed to build a modern embedded system.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача.', 'механизам на интерна евалуација и анкети',
        'Архитектура и организација на компјутери или Компјутерски архитектури', 'Реализирани активности 15.2 и 16.1',
        '30', '45', '15', '15', '75', '180', '0', '15', '60', '10');
