values ('F23L3W043', '485', 'Information security', '600', '5', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Вовед во информациска безбедност (Основни поими и дефиниции поврзани со информациската безбедност).
	2. Основни криптографски поими (симетрична криптографија, криптографија со јавен клуч, xeш функции).
	3. Криптографски алгоритми (Видови криптографски алгоритми, Diffie-Hellman размена на клучеви, шеми за автентикациска енкрипција).
	4. Основни автентикациски поими (Автентикација, автентикациски методи, лозинки).
	5. Биометриски технологии (Биометрика, основни поими и видови, дво-факторска автентикација).
	6. Основни авторизациски поими (Авторизација, матрици за контрола на пристап).
	7. Автентикациски модели (Повеќенивовски сигурносни модели, прикриени канали, огнени ѕидови, IDS-системи).
	8. Протоколи (Едноставни протоколи, протоколи за размена на клучеви со симетрична криптографија, напади, Kerberos).
	9. Автентикациски протоколи (Примери со напади, Otway-Rees, Needham-Schroeder, инфраструктура со јавен клуч).
	10. Реални протоколи (SSH, SSL/TLS)
	11. Злонамерен софтвер (Видови злонамерен софтвер, софтверски напади).
	12. Безбедност на оперативни системи (Безбедносни функции на ОС, доверливи ОС).

Вежби:
	1. Вовед
	2. Симетрична криптографија
	3. Автентикациска енкрипција
	4. Размена на клучеви за симетрична криптографија
	5. Автентикациja (дво-факторна автентикација, single sign-on, веб колачиња)
	6. Авторизација (контрола на пристап)
	7. Авторизација (firewalls, IDS)
	8. Автентикациски протоколи - задачи
	9. Протоколи без никакво знаење (zero-knowledge)
	10. Инфраструктура со јавни клучеви (PKI)
	11. Користење на библиотеката OpenSSL за PKI
	12. Reverse engineering
', 'Lectures:
1. Introduction to information security (Basic terms and definitions related to information security).
2. Basic cryptographic terms (symmetric cryptography, public key cryptography, xesh functions).
3. Cryptographic algorithms (Types of cryptographic algorithms, Diffie-Hellman key exchange, authentication encryption schemes).
4. Basic authentication terms (Authentication, authentication methods, passwords).
5. Biometric technologies (Biometrics, basic terms and types, two-factor authentication).
6. Basic authorization terms (Authorization, access control matrices).
7. Authentication models (Multilevel security models, covert channels, firewalls, IDS-systems).
8. Protocols (Simple protocols, key exchange protocols with symmetric cryptography, attacks, Kerberos).
9. Authentication protocols (Examples with attacks, Otway-Rees, Needham-Schroeder, public key infrastructure).
10. Real Protocols (SSH, SSL/TLS)
11. Malware (Types of Malware, Software Attacks).
12. Security of operating systems (OS security features, trusted OS).

Exercises:
1. Introduction
2. Symmetric cryptography
3. Authentication encryption
4. Key exchange for symmetric cryptography
5. Authentication (two-factor authentication, single sign-on, web cookies)
6. Authorization (access control)
7. Authorization (firewalls, IDS)
8. Authentication protocols - tasks
9. Zero-knowledge protocols
10. Public Key Infrastructure (PKI)
11. Using the OpenSSL library for PKI
12. Reverse engineering', 'Изучување на поими поврзани со информациската безбедност; постапки и механизми за заштита кај компјутерските системи од
безбедносен аспект; методи што се применуваат за подигање на нивото на безбедност во однос на неовластен пристап.', 'Studying concepts related to information security; procedures and mechanisms for protection of computer systems from
security aspect; methods applied to raise the level of security against unauthorized access.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети',
        'Компјутерски мрежи или Компјутерски мрежи и безбедност', 'Реализирани актибвности 15.2 и 16.1', '30', '45',
        '15', '15', '75', '180', '10', '15', '70', '10');
