values ('F23L3W048', '484', 'Software for Embedded Systems', '600', '7', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Оперативни системи во реално време (RTOS)
	2. FreeRTOS
	3. Менаџмент на задачи
	4. Алгоритми за распределба
	5. Менаџмент на редици
	6. Менаџмент на софтверски тајмери
	7. Менаџмент на прекини
	8. Менаџмент со ресурси
	9. Групи на настани
	10. Нотификации на задачи
	11. Поддршка на развој и дебагирање
	12. Менаџмент на меморија

Вежби:
	1. Nucleo 64 развојна плоча
	2. GPIO и HAL
	3. Програмирање на сериска порта
	4. LCD и keyboard интерфејси
	5. ADC, DAC и сензорски интерфејси
	6. Тајмери
	7. Прекински системи
	8. SPI протокол и DAC интерфејс
	9. I2C протокол и RTC интерфејс
	10. Реле и степер мотори
	11. PWM и контрола на DC мотор
	12. DMA програмирање
',
        'The content of the program is divided into 12 teaching units. The lectures will be aimed at studying real-time operating systems. In classroom exercises, the Nucleo 64 development board will be used through which working with GPIO, HAL, interrupts, timers, DMA, LCD, ADC, DAC, PWM, motors and protocols will be studied. In laboratory exercises, the mentioned concepts will be implemented in the STM32CUBE IDE environment which supports debugging, register management, use of real-time operating systems, faults analysis, stack analysis, etc.',
        'Целта на курсот е да ги оспособи студентите да креираат апликации наменети за микроконтролери како и работа со влез/излез, подетално со СТМ микроконтролерите. Студентите ќе научат да работат со Nucleo развојните плочи, да имплементираат код, да дебагираат и да управуваат со софтверска конфигурација. Исто така студентите ќе научат кога и како се користи оперативен систем во реално време.',
        'The aim of the course is to enable students to create applications intended for microcontrollers as well as work with I/O, in more detail with STM microcontrollers. Students will learn to work with Nucleo development boards, implement code, debug and manage software configuration. Students will also learn when and how to use a real-time operating system.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача.',
        'Mеханизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури', 'Реализирани активности',
        '30', '45', '15', '15', '75', '180', '0', '15', '70', '10');
