values ('F23L3W050', '489', 'Educational Software Design', '600', '5', '1', '2023', 'македонски', 'Предавања:
	1. -	Модели и теории на учење
	2. -	Традиционални околини за учење. Алатки кои се користат во традиционалните околини за учење
	3. -	Интеграција на технологијата во процесот на учење. Технолошки потпомогнати околини за учење
	4. -	Типови образовен софтвер
	5. -	Содржини за учење
	6. -	Циклус на развој на образовен софтвер
	7. -	Примери на примена на алатки за учење во средно образование
	8. -	Примери на примена на алатки за учење во основно образование
	9. -	Колаборативно учење и поучување.
	10. Е-учење 2.0
	11. Интерфејси за учење
	12. Евалуација на образовен софтвер', 'Lectures:
1. - Learning models and theories
2. - Traditional learning environments. Tools used in traditional learning environments
3. - Integration of technology in the learning process. Technology-assisted learning environments
4. - Types of educational software
5. - Learning contents
6. - Educational software development cycle
7. - Examples of application of learning tools in secondary education
8. - Examples of application of learning tools in primary education
9. - Collaborative learning and teaching.
10. E-learning 2.0
11. Learning Interfaces
12. Evaluation of educational software',
        'По успешното завршување на овој предмет, студентот ќе биде во состојба да ги: разбере принципите (педагошки, когнитивни, инженерски) кои треба да се искористат при дизај на образовен софтвер, местото и примената на различните типови на образовен софтвер во образованието, начинот на кој образовниот софтвер помага да се остварат одередени педагошко-едукативни цели, како и основните принципи за користење на образовен софтвер без притоа тој да ја наруши дидактиката на образовниот процес.',
        'Upon successful completion of this course, the student will be able to: understand the principles (pedagogical, cognitive, engineering) that should be used in the design of educational software, the place and application of different types of educational software in education, the way in which educational software helps to achieve certain pedagogical and educational goals, as well as the basic principles for using educational software without disturbing the didactics of the educational process.',
        'настава, колаборативно учење. презентации, проектинастава, колаборативно учење. презентации, проекти',
        'механизам на интерна евалуација и анкети', 'Освоени најмалку 60 ЕКСТ', 'Реализирани актибвности 15.2 и 16.1',
        '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
