values ('F23L3W053', '625', 'Computer ethics', '600', '5', '1', '2023', 'македонски и англиски',
        '1. Новите технологии и нивното влијание Што е плагијат и како да се избегне? 2.	Воведни поими за етиката Од десетте заповеди на компјутерската етика до етичките кодекси на професионалните здруженија 3.	Основни поими за приватноста Приватност на информациите 4.	Законска заштита на приватноста Техники за зголемување на заштитата на приватноста 5.	Концепти и класификација на довербата Доверба во компјутерската технологија 6.	Надежност на технологијата Основни поими за безбедноста 7.	Презентација на првите групни проекти 8.	Безбедност на технологијата Безбедност на информациите 9.	Надзор Пристап кон информациите 10.	Слобода на изразувањето Асистивни технологии 11. Интелектуална сопственост Заштита на интелектуалната сопственост 12.	Софтверско пиратство Софтверски патенти 13.	Влијанието на ИКТ Глобализација Професионално однесување 14.	Презентација на вторите групни проекти',
        '1. New technologies and their impact What is plagiarism and how to avoid it? 2. Introductory concepts of ethics From the ten commandments of computer ethics to ethical codes of professional associations 3. Basic concepts of privacy Information privacy 4. Legal protection of privacy Techniques for increasing privacy protection 5. Concepts and classification of trust Trust in computing technology 6. Reliability of technology Basic concepts of security 7. Presentation of the first group projects 8. Security of technology Information security 9. Surveillance Access to information 10. Freedom of expression Assistive technologies 11. Intellectual property Protection of intellectual property 12. Software piracy Software patents 13. The impact of ICT Globalization Professional behavior 14. Presentation of the second group projects', 'Способност да се согледаат клучните културни, општествени, правни и етички аспекти на ИКТ, влијанието на ИКТ, значењето и професионалните одговорности на ИКТ професионалците; Способност критички да се согледаат и дискутираат потенцијалните
ризици што со себе ги носи ИКТ, вклучувајќи ги и последиците од нејзиниот развој врз развојот на човештвото; Стекнување информации за националните и меѓународните закони за спречување и заштита од компјутерскиот криминал.', 'Ability to perceive the key cultural, social, legal and ethical aspects of ICT, the impact of ICT, the meaning and professional responsibilities of ICT professionals; Ability to critically perceive and discuss potential
risks that ICT brings with it, including the consequences of its development on the development of humanity; Acquiring information about national and international laws to prevent and protect against computer crime.', 'предавања, аудиториски вежби, индивидуални и групни проектни
задачи', 'Механизам за интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури',
        'Реализирани активности 15, 16', '60', '0', '35', '40', '45', '180', '0', '40', null, '25');
