	4. Алатки за запознавање со начинот на учење на секој ученик
	5. Ученик - ориентирано оценување
	6. Технологија и оценување
	7. Употреба на технологија за унапредување на предавање и учење во персонализирана околина
	8. Развивање колегијални релации и колаборативно учење
