        'Introduction to personalized learning - educational models, tools, design and support for establishing a personalized learning environment, theory of motivation and involvement in the learning process, tools for getting to know each student`s learning style, student-oriented assessment, technology and assessment, use of technology to improve teaching and learning in a personalized environment, developing collegial relationships and collaborative learning, changing the role of the teacher - the teacher in the role of an encourager of acquiring new knowledge. Personalized learning for students with learning disabilities',
        'Персонализираното учење е современ начин на одржување на наставата која ги пресретнува индивудуалните потреби на секој ученик. Студентите се оспособуваат да ги препознаат спецификите на совладување на знаењата кај учениците од основните и средните училишта. Студентите ќе осознаат како да се справат со предизвикот за вклучување на персонализираното учење во рамки на класичната училница и како да се поттикнува усвојувањето на нови знаења кај различните стилови на учење.',
        'Personalized learning is a modern way of teaching that meets the individual needs of each student. Students are trained to recognize the specifics of mastering knowledge among primary and secondary school students. Students will understand how to meet the challenge of incorporating personalized learning within the traditional classroom and how to encourage the acquisition of new knowledge across different learning styles.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
