values ('F23L3W060', '461', 'System administration', '600', '5', '1', '2023', 'Македонски и англиски', '(1) Управување со корисници, датотеки и софтвер на компјутерски систем во клиент сервер околина (MANAGEMENT)
    (2) Инсталација и конфигурација на мрежни сервиси за интранет и Интернет домени (NETWORKING)
    (2) Администрација на мрежни безбедносни полиси во Linux и Windows околина (SECURITY)
    (1) Техники за интероперабилност на компјутерски системи во мешана околина (INTEROPERABILITY)
    (2) Идентификација на можни извори на лоши перформанси и потенцијални решенија (PERFORMANCE DEBUGGING)
    (1) Дизајн на мали и средни бизнис ИТ инфраструктури (CAPACITY PLANNING).
    (2) Развој на скриптни механизми и автоматизирани скрипти за изведба на комплицирани административни задачи (SYSTEM SCRIPTING)
    (1) Евалуација на различни полиси и механизми за обезбедување на надежност на компјутерските сервиси и работа (BACKUPS)
    (1) Инсталација и конфигурација на Linux и Windows виртуелни машини (VIRTUALIZATION)
    (1) Системи за работа со големи количества на податоци за голем број различни корисници (DATA CENTRES)', '(1) Management of users, files and computer system software in a client server environment (MANAGEMENT)
(2) Installation and configuration of network services for intranet and Internet domains (NETWORKING)
(2) Administration of network security policies in Linux and Windows environment (SECURITY)
(1) Techniques for interoperability of computer systems in a mixed environment (INTEROPERABILITY)
(2) Identification of possible sources of poor performance and potential solutions (PERFORMANCE DEBUGGING)
(1) Design of small and medium business IT infrastructures (CAPACITY PLANNING).
(2) Development of script mechanisms and automated scripts for performing complicated administrative tasks (SYSTEM SCRIPTING)
(1) Evaluation of various policies and mechanisms for ensuring the reliability of computer services and work (BACKUPS)
(1) Installation and configuration of Linux and Windows virtual machines (VIRTUALIZATION)
(1) Systems for working with large amounts of data for a large number of different users (DATA CENTRES)',
        'Системската администрација претставува комплексен процес на оперативно управување со системските и софтверските компоненти кај компјутерските системи, се со цел да се обезбеди безбедни, надежни и достапни сервиси и услуги на корисниците. Организацијата на процесот на системска администрација е повеќестран и вклучува активности поврзани со управување со оперативни системи, мрежни сервиси како и на апликативни и други серверски системи.',
        'System administration is a complex process of operational management of system and software components in computer systems, all with the aim of providing safe, reliable and accessible services to users. The organization of the system administration process is multifaceted and includes activities related to the management of operating systems, network services, as well as application and other server systems.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети',
