        'Предметот има за цел запознавање со развојот на middleware системите. Предмеот ги покрива принципите врз кои се изградени дистрибуираните системи, пред се комуникациите, процесирањето, именување, конзистентност и репликација, справувње со дефекти и безбедност. Овие принципи се понатаму обработени во нивната примена кај дистрибуираните веб базирани системи, дистрибуираните објектно базирани системи, дистрибуираните датотечни системи и дистрибуираните коориднациски системи.',
        'The subject aims to familiarize with the development of middleware systems. The subject covers the principles on which distributed systems are built, primarily communications, processing, naming, consistency and replication, fault handling, and security. These principles are further elaborated in their application to distributed web-based systems, distributed object-based systems, distributed file systems, and distributed coordination systems.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
