values ('F23L3W068', '462', 'Cloud computing', '600', '7', '1', '2023', 'Македонски и англиски',
        '(1) Вовед. Дефиниција и еволуција. Технологии, сервиси, модели. Популарни решенија. (1) Предности, ризици, предизвици. Економски модели и SLA. (1) Историска перспектива на инфраструктурата за облак. Компоненти на податочни центри. Дизајн на податочен центар, барања, моќност, ефикасност и редундантност. (2) Управување со облакот, софтвер за cloud deployment. Техники за автоматизација и оркестрација на ресурси. (1) Градење на  multi-tier апликација во облак со надежност и еластичност и импликации за доцнењето. (2) Виртуелизација и пресметување во облакот. (1) Складирање во облакот. Концепти. Дистрибуирани системи за датотеки (1) Бази на податоци во облакот. Складирање на облак објекти. (1) Модели на програмирање. Дистрибурирано програмирање во облакот (1) Податочно паралелна аналитика со MapReduce, Apache Spark, GraphLab. (1) Безбедност во облак околина. (1) Вовед во fog и dew computing.',
        '(1) Introduction. Definition and evolution. Technologies, services, models. Popular solutions. (1) Advantages, risks, challenges. Economic models and SLA. (1) Historical perspective of cloud infrastructure. Components of data centers. Data center design, requirements, power, efficiency and redundancy. (2) Cloud management, cloud deployment software. Resource Automation and Orchestration Techniques. (1) Building a multi-tier cloud application with reliability and resilience and latency implications. (2) Virtualization and cloud computing. (1) Cloud storage. Concepts. Distributed file systems (1) Cloud databases. Cloud object storage. (1) Programming models. Distributed Programming in the Cloud (1) Data Parallel Analytics with MapReduce, Apache Spark, GraphLab. (1) Security in the cloud environment. (1) Introduction to fog and dew computing.',
        'Овој предмет ќе го оспособи студентот со основни познавања за концептот на облак и услуги во облак.',
