values ('F23L3W075', '530', 'Analysis and design of IS', '600', '7', '1', '2023', 'македонски', 'Предавања:
	1. Општи информации за предметот, начин на предавања, начин на учество на студенти, претставување на литературата што се користи во предметот, содржина на домашни задачи, содржина на проектна задача, испит и услови за полагање, начини на комуникација во предметот
	2. Вовед во анализа и дизајн на информациски системи:
- Зошто е значајна информатичката технологија?
- Дефиниција за информациски систем и негови компоненти
- Што се профили и модели и како се тие поврзани со бизнис функции и операции?
- Како интернет технологиите влијаат на анализата и дизајнот на информациските системи?
 - Типови на информациски системи и нивни корисници
	3. Анализа на бизнис случај:
- Што е бизнис случај и како е тоа поврзано со информациските системи?
- Што е стратешко планирање и како е тоа поврзано со ИС?
- SWOT анализа
- Што се системски побарувања?
- Што е операциска, техничка, економска и временска исплатливост (feasibility)?
	4. Техники за собирање на податоци потребни за анализа на ИС:
- Пристапи базирани на интервјуа и анкети
- Пристапи базирани на анализа на документи
- Пристапи базирани на надбљудување
- Хибридни пристапи

	5. Дизан на ИС: пишување спецификации:
- Зошто е потребно да се пишуваат спецификации
- Спецификации за внатрешен развој
- Спецификации за стратешко планирање
- Составни делови на техничка тендерска документација
- Типови побарувања во техничка спецификација (генерални побарувања, функционални побарувања, нефункционални побарувања, останати побарувања)

	6. Дизан на ИС: пишување спецификации:
- Примери на интерконективност
- Примери за перформанси
	7. Дизајн на ИС како раководење на проект:
- Поделба на работата, задачи, критичен пат
- Gantt табели, PERT/CPM табели
- Техники за естимација на време и цени
- Управување со ризици
Примери пракси за анализа и дизајн на Информациски системи во Р.Македонија
- Типови индустрии
	8. Дизан на ИС: пишување спецификации:
- Услови за постигнување обезбедување на квалитет
- Метрики за обезбедување на квалитет на софтверот и нивно рефлектирање во дизајнот на ИС
	9. Дизајнирање на одржување на ИС:
- Обука на корисници
- Грижа за корисници
- Типови на одржување
- Гарантни периоди
- Управување со одржување
	10. Управување со имплементација на ИС со фокус на користење на агилен пристап:
- Традиционални методи за имплементација на ИС
- Агилни методи за имплементација на ИС
- Елементи на агилен развој (тимови, скрум, спринт, рилиз)
- Проблеми со агилниот развој на ИС

	11. Пристапи за тестирање и инсталација на ИС
- Тестирање и одобрување на код, пристапи за инсталација
- Тест околини, околини за развој, продукциски околини
- Мигрирање на податоци и процеси од стар во нов ИС (пристапи и проблеми)
	12. Управување со проблеми при работа на ИС
- Справување со падови на ИС
- Престанок на работа на ИС

Вежби:
	1. Дефинирање на темите за домашните задачи и проектната задача, дикусија околу изборот на студиите на случај
	2. Студии на случај
	3. Анализа на конкретни примери од Р.Македонија, студии на случај
	4. Практични примери со користење на различни алатки
	5. Алатки за моделирање:
- Пишување на пример технички спецификации со користење на податочни текови
- Дизајн на интеркација, податоци и извештаии
- Модификации на податочни текови за да се рефлектираат финесите на техничките побарувања
	6. Алатки за моделирање:
- Пишување на пример технички спецификации со користење на објектно ориентирани алатки како УМЛ
- Како да се изберат правилни дијаграми за опис на различни побарувања
- Како може имплементациските специфики да се рефлектираат во дизајнот на ИС

	7. Анализа на конкретни примери од Р.Македонија, студии на случај
- Примери од јавен сектор
- Примери од приватен сектор (во локален контекст)
- Примери од приватен сектор (во меѓународен контекст)
	8. Алатки за дизајнирање на ИС преку пример
	9. Анализа на студии на случај
	10. Анализа на студии на случај
	11. Анализа на студии на случај
	12. Студии на случај
',
        'Functions of a business and systems analyst. Definition of information systems and their components. Principled paradigms for information systems analysis and design. Feasibility study. Specifics of the information system design process as a project. Data and process modelling. Writing specifications. Approaches to initial quality assurance in information systems design. Design of information systems. Reference to an agile approach to the implementation of information systems. Basic principles of specification by example.',
        'Запознавање на студенти со актуелните техники за анализа и дизајн на информациските системи (ИС). Навлегување во студија на случај на развој на ИС со користење на актуелни методологии. Оспособување за практична анализа на кориснички побарувања и креирање ефективни модели во сите фази  развој на еден ИС, со нагласок на фазите на анализа и дизајн. По завршување на курсот се очекува студентот да демонстрира знаење за користење на современи пристапи во процесот на анализа и дизајн на информациските системи.',
        'An acquaintance of students with current techniques for analysis and design of information systems (IS). Development of a case study of IS development using current methodologies. Training for practical analysis of user requirements and creation of effective models in all phases of development of an IS, with an emphasis on the phases of IS analysis and design. After completing the course, the student is expected to demonstrate knowledge of using modern approaches in the process of analysis and design of information systems.',
        'предавања, аудиториски вежби, лабораториски вежби, проектни задачи, домашни задачи',
        'интерна евалуација и анкети', 'Бази на податоци', 'Реализирани активности 15, 16', '30', '45', '15', '15',
        '75', '180', '10', '15', '30', '20');
