values ('F23L3W076', '645', 'Introductio to time series analysis', '600', '7', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Карактеристики на временски серии
	2. Корелација и автокорелација
	3. Регресија на временски серии и истражувачка анализа на податоци
	4. ARIMA модели
	5. Спектрална анализа и филтрирање
	6. Екстракција на карактеристики од временски домен и статистички методи во фреквентен домен
	7. Инженерство и генерирање на атрибути од временски серии
	8. Откривање на аномалии
	9. Откривање на концептуални промени
	10. Моделирање на целни променливи за препознавање на тековни настани и предвидување на идни настани
	11. Употреба на различни архитектури на длабоки невронски мрежи за анализа на временски серии
	12. Употреба на различни методи за учење во реално време', 'Lectures:
1. Characteristics of time series
2. Correlation and autocorrelation
3. Time Series Regression and Exploratory Data Analysis
4. ARIMA models
5. Spectral analysis and filtering
6. Feature extraction from time domain and statistical methods in frequency domain
7. Engineering and generation of time series attributes
8. Detection of anomalies
9. Detection of conceptual changes
10. Modeling of target variables for recognition of current events and prediction of future events
11. Use of different deep neural network architectures for time series analysis
12. Use of different learning methods in real time',
        'Запознавање на студентите со анализа на произволни временски серии со традиционални статистички методи, како и со методи базирани на длабоко учење. Курсот дава вовед во типовите на временски серии, покрива стационарни процеси, ARMA модели, ARIMA и сезонални ARIMA модели, временско-просторни методи. Со знаењето стекнато на курсот студентите ќе може да анализираат временски серии од разновидни извори, податочни текови (data streams), IoT и да откриваат трендови и аномалии, да предвидуваат идни појави, како и да ги користат за препознавање на разновидни настани кои се опишани со временски серии.',
        'Familiarization of students with the analysis of arbitrary time series with traditional statistical methods, as well as with methods based on deep learning. The course provides an introduction to the types of time series, covering stationary processes, ARMA models, ARIMA and seasonal ARIMA models, spatio-temporal methods. With the knowledge acquired in the course, students will be able to analyze time series from various sources, data streams, IoT and discover trends and anomalies, predict future occurrences, as well as use them to recognize various events that are described by time series.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети',
        'Вештачка интелигенција или Вовед во науката за податоци или Машинско учење', 'Реализирани активности', '30',
        '45', '15', '15', '75', '180', '10', '15', '70', '10');
