	2. RDF Schema
	3. Библиотеки за работа со RDF податоци
	4. Прашален јазик за RDF податоци: SPARQL
	5. Јазик за веб онтологии: OWL
	6. Развој на онтологии
	7. Вовед во концептот на поврзани податоци и графови на знаење
	8. Консумирање на поврзани податоци и графови на знаење
	9. Креирање на поврзани податоци и графови на знаење
	10. RDF бази на податоци и RDF податочни множества
	11. Објавување на поврзани податоци и графови на знаење
	12. Статистичка и машинска анализа на графови на знаење
	13. Интелегентни апликации базирани на податоци и визуелизација на графови на знаење (вежби)
', 'Lectures:
