values ('F23L3W081', '516', 'Visualization', '600', '5', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Визуелизација. Вовед. Основни концепти. Репрезентација. Успешни примери низ историјата. Поим за лоши визуелизации. Фактор на лажење.
	2. Процес на визуелизација. Проточен модел на процес за визуелизација. Податочни видови и графичка репрезентација (континуални и дискретни вредности, едноставни и сложени вредности, информации, структура на податоците). Визуелизациски техники за различни видови податоци.
	3. Визуелизација на скалари. Визуелизациски техники со користење на боја. Графикони. Пити. Хистограми.
	4. Визуелизација на скалари. Изоконтури. Изоповршини. Алгоритам на марширачки коцки.
	5. Визуелизација на скалари. Волуменска визуелизација.  Техники за волуменска визуелизација.
	6. Визуелизација на векторски податоци. Техники. Користење на знаци. Визуелизација со користење на боја. Визуелизација со користење на различни репрезентации  на тек.
	7. Визуелизација на информации. Видови податоци. Класификација на техники. Геометриски техники. Техники базирани на икони.
	8. Визуелизација на информации - 2. Техники базирани на пиксели. Хиерархиски техники.
	9. Визуелизација на информации - 3.  Техники базирани на графови. Хиперболични визуелизации. Конусни дрва.
	10. Визуелизација на информации -4. Дисторзиски техники. 3Д техники.', 'Lectures:
1. Visualization. Introduction. Basic concepts. Representation. Successful examples throughout history. A clue to bad visualizations. The lying factor.
2. Visualization process. A process flow model for visualization. Data types and graphical representation (continuous and discrete values, simple and complex values, information, data structure). Visualization techniques for different types of data.
3. Visualization of scalars. Visualization techniques using color. Charts. Pies. Histograms.
4. Visualization of scalars. Isocontours. Isosurfaces. Marching Dice Algorithm.
5. Visualization of scalars. Volume visualization. Volumetric visualization techniques.
6. Visualization of vector data. Techniques. Using characters. Visualization using color. Visualization using different flow representations.
7. Visualization of information. Types of data. Classification of techniques. Geometric techniques. Icon based techniques.
8. Information visualization - 2. Pixel based techniques. Hierarchical techniques.
9. Visualization of information - 3. Techniques based on graphs. Hyperbolic visualizations. Conical trees.
10. Visualization of information -4. Distortion techniques. 3D techniques.', 'Предметот треба да овозможи запознавање на студентите со концептот на вузуелизација на податоци, избор на
техники и алгоритми за визуелизација на различни податочни множества, и нивна програмска реализација. По
завршување на курсот се очекува студентот да демонстрира познавање на концептот на визуелизација на
податоци, да знае да избере и да реализира алгоритми за визуелизација на различни видови податоци
програмски и со користење на алатки за визуелизација.', 'The subject should enable students to get acquainted with the concept of data visualization, selection of
techniques and algorithms for visualization of different data sets, and their program implementation. After
completion of the course the student is expected to demonstrate knowledge of the concept of visualization of
data, to know how to choose and implement algorithms for visualization of different types of data
programmatically and using visualization tools.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури',
        'Реализирани активности 15.2 и 16.1', '30', '45', '15', '15', '75', '180', '0', '15', '70', '10');
