values ('F23L3W089', '578', 'Introduction to pattern recognition', '600', '7', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед во проблематиката на препознавање на облици.
	2. Машинска перцепција, компоненти на систем за препознавање на облици.
	3. Класификатори базирани на Баесовата теорија на одлучување, Линеарни класификатори.
	4. Видови на обележја, екстракција на обележја, селекција на обележја.
	5. Машинско учење за препознавање на облици. Надгледувано, ненадгледувано учење, полунадгледувано учење учење, проценка на перформанси на калсификатор
	6. Непараметарски методи за класификација, kNN класификатор, имплементација, kd дрва.
	7. Неметрички методи за класификација, дрва за одлучување, обука, поткастрување.
	8. Класификатори со големи маргини, кернел техники, Машини со носечки вектори.
	9. Bias/Variance декомпозиција, ансамбли од класификатори, фузија на обележја
	10. Невронски мрежи и длабоки архитектури за препознавање на облици
	11. Ненадгледувано учење, кластерирање
	12. Примена во реални системи за препознавање на облици и специфики

Вежби:
	1. Алатки за анализа на податоци и препознавање на облици
	2. Библиотеки за анализа на податоци и препознавање на облици
	3. Задачи - Баесов класификатор, линеарен класификатор, логистичка регресија
	4. Задачи - екстракција на обележја, трансформација на обележја, селекција на обележја
	5. Процедура за надгледувано учење  и проценка и евалуација на перформанси и метрики
	6. Задачи со kNN класификатор и kd дрва
	7. Задачи со дрва на одлучување и екстракција на знаење
	8. Задачи со машини со носечки вектори
	9. Задачи анасмбли од класификатори и фузија на обележја
	10. Задачи од невронски мрежи и дефинирање на архитектури на мрежи
	11. Задачи од ненадгледувано учење
	12. Имплементација на реални системи за препознавање на облици
', 'Lectures:
1. Introduction to the problem of shape recognition.
2. Machine perception, components of a pattern recognition system.
3. Classifiers based on Bayesian decision theory, Linear classifiers.
4. Types of landmarks, feature extraction, feature selection.
5. Machine learning for pattern recognition. Supervised, unsupervised learning, semi-supervised learning, calcifier performance evaluation
6. Non-parametric classification methods, kNN classifier, implementation, kd trees.
7. Non-metric classification methods, decision trees, training, pruning.
8. Large margin classifiers, kernel techniques, Support vector machines.
9. Bias/Variance decomposition, ensembles of classifiers, feature fusion
10. Neural networks and deep architectures for pattern recognition
11. Unsupervised learning, clustering
12. Application in real systems for recognizing shapes and specifics

Exercises:
1. Tools for data analysis and pattern recognition
2. Libraries for data analysis and pattern recognition
3. Tasks - Bayesian classifier, linear classifier, logistic regression
4. Tasks - feature extraction, feature transformation, feature selection
5. Procedure for supervised learning and assessment and evaluation of performance and metrics
6. Tasks with kNN classifier and kd trees
7. Tasks with decision trees and knowledge extraction
8. Problems with machines with support vectors
9. Tasks ensembles of classifiers and feature fusion
10. Neural network tasks and defining network architectures
11. Tasks from unsupervised learning
12. Implementation of real shape recognition systems', 'Целта на курсот е студентите да ги научат главните концепти на методите и техниките кои се применуваат за
препознавање на облици.По завршувањето на курсот кандидатитеќе бидат оспособени за дизајнирање,
реализирање и имплементација на системи за автоматско препознавање на облици, проценка на нивните
перформанси и нивна оптимизација.', 'The aim of the course is for students to learn the main concepts of the methods and techniques applied to
recognition of shapes. After completing the course, candidates will be able to design,
realization and implementation of systems for automatic recognition of shapes, their assessment
performance and their optimization.',
        'предавања, аудиториски вежби, лабораториски вежби, проектни задачи, домашни задачи',
        'интерна евалуација и анкети', 'Вештачка интелигенција или Вовед во науката за податоци или Машинско учење',
        'Реализирани активности 15, 16', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
