values ('F23L3W092', '611', 'Digital Postproduction', '600', '7', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед во предметот. Дигитална препродукција, продукција и постпродукција.
	2. Вовед во дигитална композиција. Секвенци од слики, компресии на слики, информации на ниво на пиксел. Алатки за дигитално композитирање.
	3. Виртуелни камери. Стереоскопија.
	4. Ротоскопија и останати техники за изолација на пиксели.
	5. Отстранување на еднобојни позадини. Вметнување на пејсажи. Отстранување на боја според клучни параметри.
	6. Дигитално маскирање на објекти.
	7. Следење на објекти во слика. Тракирање на движења.
	8. Спарување на движења. Стабилизација на слика.
	9. Вметнување на дигитални 3Д објекти во проспродукциски сцени.
	10. Системи за честички. Постпродукциски ефекти.
	11. Видео монтажа. Композиција на видео и аудио датотеки.
	12. Оценување на боја (color grading).
	13. Дигитализација на движење. Интегрирање во сцени.
	14. Фотограмометрија

Вежби:
	1. Типови на софтвери за постпродукција. Запознавање со фази и потреби за пост-продукција.
	2. Алатки за манипулација на растерски слики.
	3. Вкомпонирање на слики од стереоскопски и виртуелни камери
	4. Ротоскопија и останати техники за изолација на пиксели.
	5. Отстранување на еднобојни позадини. Вметнување на пејсажи. Отстранување на боја според клучни параметри.
	6. Дигитално маскирање на објекти.
	7. Следење на објекти во слика. Тракирање на движења.
	8. Спарување на движења. Стабилизација на слика.
	9. Вметнување на дигитални 3Д објекти во проспродукциски сцени.
	10. Системи за честички. Постпродукциски ефекти.
	11. Видео монтажа. Композиција на видео и аудио датотеки.
	12. Оценување на боја (color grading).
	13. Дигитализација на движење. Интегрирање во сцени.
	14. Фотограмометрија
',
        'Digital post-production. Digital composition. Information at the pixel level. Tools for digital compositing. Virtual cameras. Stereoscopy. Rotoscopy and other pixel isolation techniques. Removing solid color backgrounds. Inserting landscapes. Color removal by key parameters (keying). Digital masking of objects. Tracking of objects in an image and movements. Match moving. Image stabilization. Insertion of digital 3D objects in an image. Particle systems. Post-production effects. Video editing. Color grading. Digitization of movement',
        'По завршување на курсот се очекува студентите да се оспособени за основни методи за дигитална постпродукција, дигитално композитирање, работа со секвенци од слики, интеграција на дигитални објекти во слики и следење и спарување на движења од различни извори',
        'Upon completion of the course, students are expected to be proficient in basic digital post-production methods, digital compositing, working with image sequences, integrating digital objects into images, and tracking and matching movements from different sources.', 'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски
пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна
задача и семинарска работа.', 'Механизам за интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури', 'Реализирани активности 15.2',
        '30', '45', '15', '15', '75', '180', '10', '15', '30', '10');
