values ('F23L3W098', '564', 'Distributed datastorage', '600', '7', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Архитектура на системи за складирање на податоци
	2. Околини за безбедно складирање на податоци
	3. Заштита на податоци од губење
	4. Интелигентни системис за скчадирање
	5. Storage area network (SAN) и network attached storage (NAS)
	6. Fiber Channel SAN
	7. IP SAN i FCoE SAN
	8. Објектно базирани системи за складирање на податоци
	9. Паралелни, дистрибуирани и споделени датотечни системи', 'Lectures:
1. Architecture of data storage systems
2. Secure data storage environments
3. Protection of data from loss
4. Intelligent storage systems
5. Storage area network (SAN) and network attached storage (NAS)
6. Fiber Channel SAN
7. IP SAN and FCoE SAN
8. Object-based data storage systems
9. Parallel, distributed and shared file systems',
        'Се поголемата важност и големиот обем на податоците побаруваат соодветни техники и технологии за нивно безбедно, достапно, надежно и скалабилно складирање. Се почестите приоди за складирање на податоци се ориентираат кон дистрибуирани решенија чии имплементации вклучуваат најразлични архитектури и модели со што се добиваат различни придобивки, специфични за секоја имплемнетација. Предметот има за цел да ги обработи техниките на хардверско, мрежно и софтвеско ниво за обезбедување на дистрибуирано складирање на податоците.',
        'The increasing importance and large volume of data require appropriate techniques and technologies for their safe, accessible, reliable and scalable storage. More and more common approaches to data storage are oriented towards distributed solutions whose implementations include a variety of architectures and models, thereby obtaining different benefits, specific to each implementation. The subject aims to process the techniques at the hardware, network and software level for providing distributed data storage.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'Компјутерски мрежи или Компјутерски мрежи и безбедност',
        'реализирани активности 15.1 и 15.2', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
