Economic analysis of free and open source systems. Business analysis. Business models. Patenting. Free and open source licensing and license types (GNU General Public License (GPL)). Comparison with non-free or closed source systems. Comparison with freeware.
Free and open source application software. Free and open source operating systems. Programming languages ​​for free and open source development. Free and open source server software. Widely used free and open source products. Free and open source educational systems.
Free and open source software development tools. Addiction management systems. Free and open source development models. Patterns in the development of free and open source systems. SOLID principles. Free and open source software project management. Project development monitoring, change management. Patterns implemented in Open Source platforms. Libraries based on free and open source platforms. Practical techniques in developing free and open source web applications. Coding and documentation standards.
Free and open source software security. Support for free and open source systems (OSS development communities). FOSS Blogs, Groups, Forums, Social Networks. The future of free and open source software.', 'По завршување на курсот се очекува студентите да се оспособени за продуктивно учество во поголеми софтверски
