базиран на технологии со слободен и отворен код.', 'After completing the course, students are expected to be equipped for productive participation in larger software projects
teams working using free and open source technologies. Be able to work in open source programming languages, to develop web applications on those platforms. Be able to lead a software project based on free and open source technologies.', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и
