values ('F23L3W108', '522', 'Internet of things', '600', '7', '1', '2023', 'македонски и англиски', '(1) Вовед во Интернет на Нешта (ИнН). Еволуција од персонални мрежи кон Интернет на Нештата. Хардверски апстракции.
    (1) Воспоставување на ИнН инфраструктура.
    (1) Електроника потребна за ИнН, сензори и ИнН платформи.
    (1) ИнН безжично поврзување. LoRaWAN, ZigBee и Bluetooth Технологија за поврзување. RFID и NFC технологија.
    (1) 6LowPAN. Архитектура. 6LowPAN заглавие. 6LowPAN  адресирање. 6LowPAN   Компресија. Фрагментација и рутирање.
    (1) Протоколи на апликациско ниво. MQTT и COAP.
    (1) Алгоритми за рутирање, самоорганизирање на ИнН.
    (1) Системи за прибирање (аквизиција) на сензорски (ИнН) податоци.
    (1) Обработка на податоците добиени од ИнН сензорите. Податочна анализа со користење на различни Python пакети и визуелизација на податоците.
    (1) Насоки/можности/предизвици при дизајн. Безбедност и доверливост на ИнН системи.
    (1) Безжичен транспорт на енергија и energy harvesting кај ИнН .
    (1) Преглед на популарни апликативни домени на ИнН: паметни домови, паметни енергетски мрежи, паметни градови, транспорт, заштита на природата, здравствена заштита, системи за мониторинг, биолошките и безбедносните системи.', '(1) Introduction to the Internet of Things (IoT). Evolution from personal networks to the Internet of Things. Hardware abstractions.
(1) Establishment of InN infrastructure.
(1) Electronics required for InN, sensors and InN platforms.
(1) InN wireless connection. LoRaWAN, ZigBee and Bluetooth Connectivity Technology. RFID and NFC technology.
(1) 6LowPAN. Architecture. 6LowPAN header. 6LowPAN addressing. 6LowPAN Compression. Fragmentation and Routing.
(1) Application level protocols. MQTT and COAP.
(1) Routing Algorithms, Self-Organizing InN.
(1) Sensor data acquisition systems.
(1) Processing of data received from InN sensors. Data analysis using various Python packages and data visualization.
(1) Design Directions/Opportunities/Challenges. Security and reliability of InN systems.
(1) Wireless energy transport and energy harvesting at InN.
(1) Overview of popular application domains of IoT: smart homes, smart energy networks, smart cities, transportation, nature protection, health care, monitoring systems, biological and security systems.',
        'Студентот ќе биде запознаен со главните развојни чекори  и предизвици при дизајнирање на решенија базирани на Интернет на нештата.  Студентот ќе може да моделира, дизајнира и имплементира вакви системи во различни апликативни домени.',
        'The student will be familiar with the main development steps and challenges in designing solutions based on the Internet of Things. The student will be able to model, design and implement such systems in different application domains.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'Компјутерски мрежи или Компјутерски мрежи и безбедност',
        'Изработени лабораториски вежби', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
