        'Целите на предметот се да ги запознае студентите со карактеристиките на мултимедиските содржини кои се важни за далечински пренос, механизмите за дистрибуција на мултимедиски содржини од гледна точка на мрежните протоколи, пречките во мрежите при пренос, како и начините како да се подобори квалитетот на достава. Исто така, студентите ќе се запонзаат со различни платформи и архитектури за достава на мултимедиски содржини. Студентите ќе се оспособат да ги анализираат мулитмедиските содржини, да ги прилагодат и постават на сервери кои ќе обезбедат нивна достава во различни мрежни услови.',
        'The objectives of the course are to familiarize students with the features of multimedia content that are important for remote transmission, the mechanisms of distribution of multimedia content from the point of view of network protocols, obstacles in networks during transmission, as well as ways to improve the quality of delivery. Students will also become familiar with various platforms and architectures for delivering multimedia content. Students will be able to analyze multimedia contents, adapt them and place them on servers that will ensure their delivery in different network conditions.', 'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и
