values ('F23L3W136', '423', 'Advanced Web Design', '600', '5', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед во предметот. Јазици за клиентско програмирање
	2. Естетика за на Веб
	3. Растерска графика за Веб. Canvas
