	6. Развој на апликации на клиентска страна (Front-end web development)
	7. Рамки за развивање на сајтови базирани на CSS
	8. Мултимедијални елементи во веб страници. Аудио и Видео
	9. HTML5 Offline и Прогресивни Веб Апликации
	10. Препроцесори за генерирање на каскадни стилови
	11. Интернет Маркетинг
	12. Системи за управување на содржини (Content Management Systems)

Вежби:
	1. Основи концепти во клиентско програмирање
	2. Напредни концепти за клиентски апликации
	3. Функционални аспекти на програмирање. Closures
	4. Објектно-ориентирано програмирање базирано на прототипови.
	5. Нови техники и пристапи при развивање на клиентски веб апликации.
	6. Front-end рамки и библиотеки за клиентски развој
	7. Основни концепти на front-end рамки за развој
	8. Реактивност и пренос на податоци до клиентска страна
	9. Компоненти за на веб
	10. Настани и пропагација на настани во рамките на веб станиците
	11. Напредно концепти за развивање на клиентски веб апликации (Рутирање на клиентска страна, менаџирање на состојби)
	12. Нови концепти за развој на клиентски апликации
',
        'Client-side programming, Web Aesthetics, Raster Graphics, Canvas, Vector Graphics, SVG. Advanced cascading styles. Responsive CSS. CSS Frameworks, Front-end web development, Multimedia elements in web pages. Audio and Video, HTML5 Offline and Progressive Web Applications, CSS Preprocessors , Internet Marketing, Content Management Systems',
        'Целта на наставната програма е студентите да се запознаат со напредните технологии во областа на веб дизајнот и развојот на модерни динамички веб апликации. По завршување на предметот, студентите ќе имаат преглед на најновите технички достигнувања во областа на веб дизајнот и ќе бидат способни да ги користат истите во изработкa на практични проекти',
        'The aim of the curriculum is to familiarize students with advanced technologies in the field of web design and the development of modern dynamic web applications. After completing the course, students will have an overview of the latest technical developments in the field of web design and will be able to use them in the creation of practical projects.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации)',
        'механизам на интерна евалуација и анкети', 'Објектно ориентирано програмирање',
