values ('F23L3W137', '556', 'Advanced human-computer interaction', '600', '7', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед во курсот
	2. Општи трендови во ИЧК
	3. Актери во ИЧК
	4. Основи на интеракцијата
	5. Техники на евалуација
	6. Специфични групи корисници
	7. Кориснички групи со посебни кориснички барања
	8. Специфични апликативни домени
	9. ИЧК и интернет на нештата
	10. Човек во интеракција со паметни општества, паметни градови, паметни домови.
	11. Асистивни технологии
	12. Интеракција човек - робот

Вежби:
	1. Вовед во курсот
	2. Принципи за визуелен дизајн за употребливи интерфејси
	3. Спецификација на побарувања. Анализа на задачи
	4. Прототипови и нивна евалуација
	5. Дизајн на анкети и имплементација во ИЧК и евалуација
	6. Разбирање на однесувањето на корисникот преку податоци од логови и анализа
	7. Crowdsourcing во истражувањето на HCI
	8. Интеракција меѓу луѓето и податоците
	9. Визуелизација на податоци за човечка перцепција
	10. Истражување преку дизајн во HCI
	11. Истражувачка етика и HCI
	12. ИЧК во иднината
',
        'Introduction to the course. General trends in human-computer interaction (HCI). Actors in HCI - man and the devices in his environment. Basics of interaction. Evaluation techniques. Specific groups of participants in the interaction - specifics of user groups. Specific application domains. HCI and the Internet of Things. Man interacting with smart societies, smart cities, smart homes. Assistive technologies. Human - robot interaction.',
        'Овој предмет ги запознава студентите со основите на комплексната интеракција која се одвива меѓу човекот и компјутерот. Студентите се запознаваат и со техниките за моделирање на корисници, проблеми, апликации и средини како и на техники за евалуација и анализа на интелигентни интефејси. Се разгледуваат принципи за градење посредници кои ги опфаќаат ограничувањата и во двете примарно афектирани групи: човекот и компјутерот. Студентите треба да научат дека корисникот е еден од главните елементи при креирање на компјутерските системи. При тоа, се дава увид во начинот за развивање на хардверот и софтверот за различни групи на корисници, како и за специфични апликациски домени. Студентите стекнуваат познавања на принципи за проектирање на кориснички интерфејси адаптибилни на околината, интелигентни кориснички интерфејси базирани на агенти и интерфејси чувствителни на контекст, како и интелигентни решенија наменети за специфични типови на кориснички групи.',
        'The students will be acquainted with the basics of the complex interaction between the human and the computer. They will gain knowledge in the techniques for modeling the users, the, problems, the applications and the ambient. They will also learn the techniques for evaluation and analysis of intelligent interfaces. Students will be familiarized with the principles of building interfaces that encompass the limitations of the two affected groups: human and computer. Students will learn that the user is one of the main elements in crating computer systems. They will gain insight in hardware and software development for different user groups, as well as for specific application domains. Students will be familiarized with the principles for building user interfaces adaptable to the environment, agent based intelligent user interfaces, context sensitive interfaces, and intelligent solutions for specific user groups.', 'Предавања, вежби, самостојна работа, проектни задачи, семинарски
работи', 'механизам на интерна евалуација и анкети',
        'Дизајн на интеракцијата човек-компјутер или Алгоритми и податочни структури или Примена на алгоритми и податочни стуктури',
        'реализирани активности 15.1 и 15.2', '30', '45', '15', '15', '75', '180', '0', '15', '60', '10');
