	6. Контрола и управување со оптички мрежи
	7. Робустност на оптички мрежи
	8. Дизајн на WDM мрежи
	9. Динамичко рутирање и алокација на спектар
	10. Пристапни оптички мрежи
	11. Пакетно свичување
	12. Различни аспекти во примери на реални оптички мрежи
',
        'Introduction to optical networks. Propagation of signals through optical fiber. Optical components and modulation. Client layers of the optical layer (SONET/SDH, OTN). WDM network elements. Control and management of optical networks. Optical networks survivability. Design of WDM networks, Dynamical routing and spectrum allocation. Optical access networks. Optical packet switching. Different aspects in examples of real optical networks.',
        'Студентот ќе се стекне со основни познавања за дизајн, контрола и управување на оптички мрежи со помош на современите мрежни технологии, како и со некои тековни развои во областа.',
        'The students will acquire the fundamental knowledge of design, control and management of optical networks using contemporary network technologies, as well as some of the recent developments in the area.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети', 'Комјутерски мрежи или Компјутерски мрежи и безбедност',
