	5. Кинематика кај роботи.
	6. Динамика на роботи.
	7. Планирање
	8. Планирање во реалниот свет.
	9. Управување. Управување врз основа на поведенија.
	10. Хибридни архитектури.
	11. Повеќе-роботски системи.
	12. Иднината на роботиката.', 'Lectures:
1. Introduction to robotics.
2. Robots as intelligent agents.
3. Sensors, effectors and platforms.
4. Degrees of freedom and configuration space.
5. Kinematics in robots.
6. Robot dynamics.
7. Planning
8. Planning in the real world.
9. Management. Management based on behaviors.
10. Hybrid architectures.
11. Multi-robotic systems.
12. The future of robotics.',
        'По завршувањето на овој предмет, студентот се очекува да има познавања од принципите на развој на роботи и системи кои вклучуваат сензори и ефектори. Студентите ќе се запознаат со начините на програмирање роботи кои овозможуваат нивно управување. Студентите ќе се запознаат со примената на роботите во индустријата и општеството',
        'After completing this course, the student is expected to have knowledge of the principles of developing robots and systems that include sensors and effectors. Students will get to know the ways of programming robots that enable their management. Students will learn about the application of robots in industry and society',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури', 'Реализирани активности',
