values ('F23L3W152', '519', 'Video Games Programming', '600', '7', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед. Дефиниција. Кратка историја. Класификации и видови игри.
	2. Архитектура на игра. Иницијализација на игра. Обезбедување излез од играта.
	3. Актери во играта. Начини на дефинирање на актери. Композиција од објекти за дефинирање карактеристики на актери.
	4. Главен циклус на игра. Начини за контрола на текот на играта. Користење на нитки.
	5. Кеширање на ресурси за играта. Видови податоци. Техники за ефикасно сметување на податоците и ефикасно читање на истите.
	6. Влезни уреди. Видови. Контрола на влез.
	7. Кориснички интерфејси за игри. Дефинирање на поглед. Програмирање на контроли и екрански елементи. Локализација.
	8. Менаџирање на настани во игра. Додавање и контрола на звук во игра.
	9. Основни принципи за графика во игра. Дефинирање на материјали. Координатни системи и трансформации. Репрезентација на графички објекти во игра. Светлински модел.
	10. Графика во игра. Користење на текстури. Репрезентација и програмирање на 3Д сцени.
	11. Физика во игри. Закони и вметнување на закони во однесување на елементите. Програмирање на колизии.
	12. Вештачка интелигенција. Техники за опишување на однесување на виртуелни актери.

Вежби:
	1. Вовед во технологии и програмски јазици што овозможуваат програмирање на видео игри.
	2. Понапредни карактеристики на технологиите и програмските јазици што овозможуваат програмирање на видео игри.
	3. Имплементација на примери за дефинирање актери и нивните карактеристики.
	4. Имплементација на основен облик на главниот циклус на играта.
	5. Имплементација на покомплексен облик на главниот циклус на играта. Сместување и читање податоци.
	6. Имплементација на примери што вклучуваат влез и контрола на влез во играта,
	7. Имплементација на кориснички интерфејс за играта. Програмирање на контроли и екрански елементи. Локализација.
	8. Имплементација на примери со менаџирање на настани во игра. Додавање и контрола на звук во игра.
	9. Примери што вклучуваат графика во играта. Дефинирање на материјали. Координатни системи и трансформации. Репрезентација на графички објекти во игра. Светлински модел.
	10. Примери што вклучуваат користење на текстури. Репрезентација и програмирање на 3Д сцени.
	11. Примери што се донесуваат на физиката во игрите. Закони и вметнување на закони во однесување на елементите. Програмирање на колизии.
	12. Примери што вклучуваат вештачка интелигенција. Техники за опишување на однесување на виртуелни актери.
',
        'Introduction. Definition. A brief history. Classifications and types of games. Game architecture. Game initialization. Providing an exit from the game. Actors in the game. Ways of defining actors. A composition of objects for defining actor characteristics. Main game cycle. Ways to control the flow of the game. Using threads. Caching game resources. Types of data. Techniques for efficient data storage and efficient data reading. Input devices. Types. Input control. User interfaces for games. Defining a view. Programming controls and screen elements. Localization. Managing in-game events. Add and control in-game sound. Basic principles of in-game graphics. Defining materials. Coordinate systems and transformations. Representation of graphical objects in a game. Light model. In-game graphics. Using textures. Representation and programming of 3D scenes. Physics in games. Laws and the insertion of laws into the behavior of elements. Collision programming. Artificial intelligence. Techniques for describing the behavior of virtual actors.',
        'Целта на предметот е да ги запознае студентите со процесот на програмирање на видео игри. За таа цел студентите ќе бидат запознаени со основните компоненти на една видео игра и начинот на кој истите се програмираат. По завршување на курсот се очекува кандидатот да ги разбира концептите за програмирање на видео игри и да може да реализира програмски самостојно или во тим едноставна видео игра.',
        'The aim of the course is to introduce students to the video game programming process. For this purpose, students will be introduced to the basic components of a video game and the way in which they are programmed. After completing the course, the candidate is expected to understand the concepts of video game programming and to be able to program a simple video game independently or in a team.',
        'Предавања поддржани со презентации преку слајдови, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа, учење во електронско опкружување (форуми, консултации).',
        'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури',
        'реализирани активности 15.1 и 15.2', '30', '45', '15', '15', '75', '180', '10', '15', '50', '10');
