values ('F23L3W154', '552', 'Introduction to mining massive dataset', '600', '7', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Вовед во MapReduce
	2. Фреквентни множества и асоцијативни правила
	3. Барање на најблиски соседи во многу-димензионални податоци, локациски сензитивни хеширања
	4. Намалување на димензионалноста (SVD и CUR)
	5. Системи на препораки базирани на колаборативно филтрирање
	6. Системи на препораки базирани на содржина и хибридни системи за препораки
	7. Кластерирање на масивни податочни множества
	8. Надгледувано учење кај масивни податочни множества (К-најблиски соседи, апроксимативен К-најблиски соседи)
	9. Надгледувано учење кај масивни податочни множества (класификациски и регресиски дрвa)
	10. Надгледувано учење кај масивни податочни множества (длабоки невронски мрежи)
	11. Континуирана обработка на масивни податоци базирано на прозорец
	12. Рударење на податоци репрезентирани со графови

Вежби:
	1. Примери на MapReduce
	2. Градење на асоцијативни правила
	3. Употреба на локациски сензитивни хеширања и барање на најблиски соседи во многу-димензионални податоци
	4. Употреба на SVD и CUR
	5. Работа со алгоритми за препораки базирани на колаборативно филтрирање
	6. Работа со алгоритми за препораки базирани на содржина и колаборативно филтрирање
	7. Употреба на методи за кластерирање на масивни податочни множества
	8. Употреба на методите К-најблиски соседи на реални проблеми
	9. Работа со класификациски и регресиски дрвa
	10. Работа со длабоки невронски мрежи за анализа на масивни податочни множества (само-надгледувано учење)
	11. Работа со алгоритми за континуирана обработка на масивни податоци базирано на прозорец
	12. Работа со граф невронски мрежи
', 'Lectures:
1. Introduction to MapReduce
2. Frequent sets and associative rules
3. Nearest Neighbor Search in High-Dimensional Data, Location-Sensitive Hashing
4. Dimensionality reduction (SVD and CUR)
5. Recommendation systems based on collaborative filtering
6. Content-Based Recommender Systems and Hybrid Recommender Systems
7. Clustering of massive data sets
8. Supervised learning on massive data sets (K-nearest neighbors, approximate K-nearest neighbors)
9. Supervised learning with massive data sets (classification and regression trees)
10. Supervised learning on massive data sets (deep neural networks)
11. Window-based continuous processing of massive data
12. Mining data represented by graphs

Exercises:
1. MapReduce examples
2. Building associative rules
3. Use of location-sensitive hashing and nearest-neighbor search in multi-dimensional data
4. Use of SVD and CUR
5. Work with recommendation algorithms based on collaborative filtering
6. Working with content-based recommendation algorithms and collaborative filtering
7. Use of clustering methods on massive data sets
8. Use of K-nearest neighbors methods on real problems
9. Working with classification and regression trees
10. Working with deep neural networks to analyze massive data sets (self-supervised learning)
11. Work with algorithms for continuous processing of massive data based on a window
12. Work with graph neural networks',
        'Студентите да се запознаат со алгоритмите и техниките на податочно рударење и машинско учење за анализа на големи податочни множества. Фокус ќе биде даден на дистрибуираните платформи како и на начинот на дефинирање и креирање на алгоритми за процесирање и анализа на многу големи податочни множества.',
        'Students will become familiar with data mining and machine learning algorithms and techniques for analyzing large data sets. Focus will be given to distributed platforms as well as how to define and create algorithms for processing and analyzing very large data sets.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури', 'реализирани активности',
        '30', '45', '0', '30', '75', '180', '0', '30', '60', '0');
