	12. Предвидување на временски серии
',
        'Expert systems. Process of knowledge engineering. Knowledge representation. Knowledge discovery. Reasoning with uncertainty. Fuzzy logic. Decision making, systems, modeling and support. Decision support systems, concepts, methodologies and technologies. Modeling and analysis in decision making. Analysis of decisions. Applications for making business decisions in management, marketing, sales, customer relationship management, e-commerce, innovations, etc. Collaboration, communication, decision support systems for making decisions in a group. Knowledge management. Decision support systems for management, trends and influences. Tools and frameworks for development and design.',
        'Овој курс претставува вовед во примена на анализа на податоци за донесување деловни одлуки. Целта на курсот е студентите да се запознаат со методите, техниките и системите за поддршка при одлучувањето, како и анализа на одлуките. Да се запознаат со техниките за стекнување на знаење и репрезентација на знаење. По завршување на курсот студентите ќе стекнат знаење како да ги користат системите за поддршка при одлучувањето, правилно да изберат соодветен систем за поддршка при одлучувањето во даден бизнис контекст, како и да дизајнираат, развијат и менаџираат системи за поддршка при одлучувањето.',
        'This course is an introduction to the application of data analysis for making business decisions. The aim of the course is students to become familiar with the methods, techniques and decision support systems, as well as analysis of the decisions. To become familiar with the techniques for acquiring knowledge and representing knowledge. After completion of the course, students will gain knowledge of how to use decision support systems, how to properly choose an appropriate decision support system in a given business context, as well as to design, develop and manage decision support systems.',
        'предавања, аудиториски вежби, лабораториски вежби, проектни задачи, домашни задачи',
        'механизам на интерна евалуација и анкети',
        'Вештачка интелигенција или Вовед во науката за податоци или Машинско учење', 'Реализирани активности 15, 16',
