values ('F23L3W161', '586', 'Graph theory and social media', '600', '5', '1', '2023', 'Македонски и англиски', 'Предавања:
	1. Графови и нивно претставување, ориентирани и неориентирани графови. Подграфови, изоморфизам во графови, пат, циклус
	2. Дрва, растојание, BFS и DFS дрва.
	3. Сврзаност, Ојлерови и Џамилтонови патишта. Бипартитивност и спарување.
	4. Боење на темиња и ребра, независни множества и кликови, планарни графови
	5. Мрежи. Структура и модели на мрежи. Јаки и слаби врски во мрежи. Позитивни и негативни врски. Симетричност, дихотомија, мерки на централна симетрија Метрики.
	6. Профил на мрежа - основни мрежни карактеристики
	7. Примена на машинско учење за анализа на социјални мрежи
	8. Репрезентација на јазли, врски, графови
	9. Извлекување знаење од социјални мрежи
	10. Моделирање на корисници и заедници. Антисоцијално однесување
	11. Примена на теорија на игра во анализа на мрежи и однесување на поединци и заедници
	12. Персонализација и профилирање на корисници. Студии на случај

