', 'Lectures:
1. Graphs and their representation, oriented and unoriented graphs. Subgraphs, isomorphism in graphs, path, cycle
2. Trees, distance, BFS and DFS trees.
3. Connectivity, Euler and Hamiltonian paths. Bipartiteness and pairing.
4. Vertex and edge coloring, independent sets and cliques, planar graphs
5. Networks. Structure and models of networks. Strong and weak ties in networks. Positive and negative relationships. Symmetry, dichotomy, measures of central symmetry Metrics.
6. Network profile - basic network characteristics
7. Application of machine learning for social network analysis
8. Representation of nodes, connections, graphs
9. Extracting knowledge from social networks
10. Modeling users and communities. Antisocial behavior
11. Application of game theory in analysis of networks and behavior of individuals and communities
12. Personalization and user profiling. Case studies',
        'Целта на курсот е студентите да се воведат во најважните аспекти од теоријата на графови, со подетален осврт на теоријата која е значајна за анализа на социјални мрежи.  Студентите ќе се запознаат со концептите, компонентите и организацијата на социјалните мрежи, како и технологиите за развој, интеркација и анализа на истите.',
        'The aim of the course is to introduce students to the most important aspects of graph theory, with a more detailed review of the theory relevant to social network analysis. Students will get acquainted with the concepts, components and organization of social networks, as well as technologies for their development, interaction and analysis.',
        'Предавања со користење на презентации, интерактивни предавања, вежби (користење на опрема и софтверски пакети), тимска работа, пример случаи, поканети гости предавачи, самостојна изработка и одбрана на проектна задача и семинарска работа.',
        'механизам на интерна евалуација и анкети',
        'Алгоритми и податочни структури или Примена на алгоритми и податочни структури',
        'реализирани активности 15.1 и 15.2', '30', '45', '15', '15', '75', '180', '10', '15', '70', '10');
