values ('F23L3W200', '115', 'Sensor systems', '600', '7', '1', '2023', 'македонски и англиски', 'Предавања:
	1. Запознавање со сензори и нивните карактеристики.
Основни градбени компоненти на сензорски јазли.
Оперативни системи за сензорски јазли.
	2. Безжични сензорски мрежи (БСМ) и системи.
Класификација на БСМ.
Архитектури за БСМ.
	3. Предизвици при дизајн на БСМ.
Воспоставување на сензорска инфраструктура.
Калибрирање, самоорганизирање, синхронизација, локализација и обработка на податоци.
	4. Рутирање на податоци кај БСМ.
	5. Локализација кај БСМ.
Класификација на локализацијата.
	6. Локализација кај 3Д мрежа.
Преглед на алгоритми и техники за 3Д локализација.
	7. Преглед на алгоритми и техники за локализација во затворен простор кај мобилни уреди.
	8. Преглед на техники за заштеда на енергија кај БСМ.
Агрегација на податоци.
Компресија на податоци.
	9. Двојна шема за предикција.
Преглед на модели за предикција.
	10. Вовед во податочна фузија.
	11. Вовед во интернет на нештата.
Архитектура на апликации базирани на ИнН.
	12. Преглед на современи и идни примени на сензорските системи.
Беспилотни летала UAV.

Вежби:
	1. Истажување на сензорски јазли достапни на пазарот и нивна споредба.
	2. Преглед на апликации во кои се применуваат БСМ.
	3. Дизајнирање на БСМ според зададени барања.
	4. Дизајнирање на БСМ според зададени барања.
	5. Развој на алгоритам за локализација базиран на трилатерација во 2Д околина.
	6. Развој на алгоритам за локализација базиран на трилатерација во 3Д околина.
	7. Развој на симулатор за локализација во 2Д/3Д околина.
	8. Развој на алгоритам за компресија.
	9. Развој на модели за предикција базирани на LMS, ARMA, ARIMA, и сл.
	10. Развој на алгоритам кој фузира податоци од различни хетерогени јазли.
	11. Преглед на апликации базирани на ИнН.
	12. Преглед на апликации за UAV.
', 'Lectures:
1. Familiarity with sensors and their characteristics.
Basic building components of sensor nodes.
Sensor Node Operating Systems.
2. Wireless sensor networks (WSN) and systems.
Classification of BSM.
Architectures for BSM.
3. Challenges in BSM design.
Establishment of sensor infrastructure.
Calibration, self-organization, synchronization, localization and data processing.
4. Data routing at BSM.
5. Localization at BSM.
Classification of localization.
6. Localization in 3D network.
Overview of 3D localization algorithms and techniques.
7. Overview of algorithms and techniques for indoor localization in mobile devices.
8. Overview of energy saving techniques at BSM.
Aggregation of data.
Data compression.
9. Dual prediction scheme.
An overview of prediction models.
10. Introduction to data fusion.
11. Introduction to the Internet of Things.
Architecture of InN-based applications.
12. Overview of modern and future applications of sensor systems.
UAVs.

Exercises:
1. An overview of sensor nodes available in the market and their comparison.
2. Overview of applications in which BSM is applied.
3. Designing BSM according to given requirements.
4. Designing BSM according to given requirements.
5. Development of a localization algorithm based on trilateration in a 2D environment.
6. Development of a localization algorithm based on trilateration in a 3D environment.
7. Development of a localization simulator in a 2D/3D environment.
8. Development of compression algorithm.
9. Development of prediction models based on LMS, ARMA, ARIMA, etc.
10. Development of an algorithm that fuses data from different heterogeneous nodes.
11. Overview of InN-based applications.
12. Overview of UAV Applications.',
