insert into weekly_subject_topic(id, subject_details_id, week_number, lecture_topic, exercise_topic)
values ('1', 'F23L1W020', '1',
        'Вовед. Алгоритми и програми. Програмирање и програмски јазици. Структурно програмирање. Процес на креирање и извршување на програма',
        'Структурно програмирање. IDE. Процес на креирање и извршување на програма.'),
       ('2', 'F23L1W020', '2',
        'Алгоритамски контролни структури (само набројување). Редоследна структура. Елементи од С++. Величини и податоци. Променливи. Оператор за доделување. Основни типови на податоци. Влез и излез. Први програми со редоследна структура.',
        'Редоследна структура. Елементи од С++. Величини и податоци. Променливи. Оператор за доделување. Основни типови на податоци. Влез и излез. Први програми со редоследна структура.'),
       ('3', 'F23L1W020', '3',
        'Претставување на броеви во компјутер, опсег на броеви, повеќе за типови  на податоци и нивни опсези. Конверзија на тип на податоци. Релациски оператори. Споредбени и логички изрази. Структура за избор од 2 можности.',
        'Претставување на броеви во компјутер, опсег на броеви, повеќе за типови  на податоци и нивни опсези. Конверзија на тип на податоци. Релациски оператори. Споредбени и логички изрази. Кратки примери со структура за избор од 2 можности.'),
       ('4', 'F23L1W020', '4', 'Контролни структури за избор (if – else, Условен оператор ?:, switch)',
        'Контролни структури за избор (if – else, Условен оператор ?:, switch)'),
       ('5', 'F23L1W020', '5', 'Контролни структури за повторување', 'Контролни структури за повторување'),
       ('6', 'F23L1W020', '6',
        'Алгоритамско размислување, правилен алгоритам. Внимателна употреба на break и continue и неупотреба на goto. Сложеност на алгоритми. Временска сложеност.',
        'Вежби со изучените контролни структури'),
       ('7', 'F23L1W020', '7', 'Подготовка за колоквиум. Тест', 'Подготовка за колоквиум'),
       ('8', 'F23L1W020', '8', '- Колоквиумска седмица -', '- Колоквиумска седмица -'),
       ('9', 'F23L1W020', '9', 'Функции. Примена на функции. Подрачје на важење на променливите',
        'Функции. Примена на функции. Подрачје на важење на променливите'),
       ('10', 'F23L1W020', '10', 'Низи: еднодимензионални, дводимензионални...',
        'Низи: еднодимензионални, дводимензионални...'),
       ('11', 'F23L1W020', '11',
        'Едноставни алгоритми за работа со низи/ познати алгоритми и решавање проблеми (пребарување, сортирање...)',
        'Едноставни алгоритми за работа со низи/ познати алгоритми и решавање проблеми (пребарување, сортирање...)'),
       ('12', 'F23L1W020', '12', 'Рекурзија и покажувачи', 'Рекурзија'),
       ('13', 'F23L1W020', '13', 'Работа со низи од знаци, стрингови, датотеки',
        'Работа со низи од знаци, стрингови, датотеки'),
       ('14', 'F23L1W020', '14', 'Подготовка за колоквиум. Тест', 'Подготовка за колоквиум'),
       ('15', 'F23L1W020', '15', '- Колоквиумска седмица -', '- Колоквиумска седмица -'),
       ('16', 'F23L1S116', '1',
        'Структура на компјутерски системи. Најнови технлогии на периферни уреди и конектори на десктоп и преносни компјутерски систем.',
        'Инсталација, администрација и конфигурација на компјутерски систем. Индентификација на периферни уреди и конектори на типичен компјутерски систем. Типови на куќишта на компјутерски систем.'),
       ('17', 'F23L1S116', '2',
        'Tехнолошки дистигнувања во областа на процесорите во компјутерските системи. Анализа на различни типови на процесори. Споредба на различни типови на призводители на процесори. Најнови iCore i3, i5, i7, i9 процесори.',
